/files/2021/02/8_tip_import_export-1.mov\";s:6:\"length\";s:7:\"5534991\";s:4:\"type\";s:15:\"video/quicktime\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:8;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:65:\"https://wordpress.org/news/files/2021/02/10_complex_layouts-2.mov\";s:6:\"length\";s:8:\"22852109\";s:4:\"type\";s:15:\"video/quicktime\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Chloe Bringmann\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8397:\"\n<p><strong><em>Created by Joen Asmussen, <a href=\'https://profiles.wordpress.org/joen/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>joen</a></em></strong></p>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img loading=\"lazy\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/02/Reusable-Blocks-featured.png?resize=585%2C329&#038;ssl=1\" alt=\"\" class=\"wp-image-9803\" width=\"585\" height=\"329\" srcset=\"https://i1.wp.com/wordpress.org/news/files/2021/02/Reusable-Blocks-featured.png?resize=1024%2C577&amp;ssl=1 1024w, https://i1.wp.com/wordpress.org/news/files/2021/02/Reusable-Blocks-featured.png?resize=300%2C169&amp;ssl=1 300w, https://i1.wp.com/wordpress.org/news/files/2021/02/Reusable-Blocks-featured.png?resize=768%2C433&amp;ssl=1 768w, https://i1.wp.com/wordpress.org/news/files/2021/02/Reusable-Blocks-featured.png?w=1440&amp;ssl=1 1440w, https://i1.wp.com/wordpress.org/news/files/2021/02/Reusable-Blocks-featured.png?w=1264&amp;ssl=1 1264w\" sizes=\"(max-width: 585px) 100vw, 585px\" data-recalc-dims=\"1\" /></figure></div>\n\n\n\n<p>The WordPress block editor (a.k.a. Gutenberg) comes with a feature called &#8220;reusable blocks.” They are blocks, saved for later, edited in one place.</p>\n\n\n\n<p>Have you ever wanted to:</p>\n\n\n\n<ul><li>Re-use the same snippet of text across posts and pages?</li><li>Save complex layouts to spare you having to copy/paste from one post to another?</li></ul>\n\n\n\n<p>Reusable blocks can do these things.</p>\n\n\n\n<h2>Like templates, you mean?</h2>\n\n\n\n<p>Not quite. Think of reusable blocks as snippets of globally synchronized content that are personal to you. You can edit all your reusable blocks in one place, and any post or page you inserted that block into, get the updated version as well.&nbsp;</p>\n\n\n\n<p>Where you might use templates to structure your website, you can use reusable blocks to structure your content. For example:</p>\n\n\n\n<ul><li>A testimonial on your homepage and your product page.</li><li>A &#8220;this post is part of a series&#8221; box that you insert part-way through your article.</li><li>A &#8220;Follow me on social media&#8221; section you can weave into the prose of your popular article.</li><li>Complex but static blocks, such as a &#8220;Subscribe to my newsletter&#8221; box, a contact form, a survey, quiz, or polls.</li></ul>\n\n\n\n<p>Key properties are that reusable blocks are unbeatable when you want to reuse a snippet of content, edit it in one place, and have the changes propagate to every instance.</p>\n\n\n\n<h2>Show me how</h2>\n\n\n\n<p>To create a reusable block, open the block editor and create the content you want to reuse:</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/1_create_content.mov\"></video></figure>\n\n\n\n<p>Now select the content you want to turn into a reusable block, then click the three-dot &#8220;More&#8221; menu and choose &#8220;Add to Reusable blocks.”</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/2_convert_to_reusable.mov\"></video></figure>\n\n\n\n<p>Voilà, you’ve now created a reusable block. From now on, you can find this block, and any other you create, in the &#8220;Reusable blocks&#8221; tab in the block library:</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/3_reusable_blocks_tab.mov\"></video></figure>\n\n\n\n<p>This is also where you can insert the newly created block on any of your posts or pages.</p>\n\n\n\n<h2>Where do I edit my existing reusable blocks?</h2>\n\n\n\n<p>To edit a reusable block, select it and make your edits. When you make an edit, the Publish button will have a little dot indicator:</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/4_saving_global_changes.mov\"></video></figure>\n\n\n\n<p>This dot indicates you’ve made a global change that potentially affects posts beyond just the one you’re editing, the same as when you’re editing templates. This lets you confirm the change was intentional.</p>\n\n\n\n<p><strong>Another way to edit your reusable blocks</strong> is to click the global three-dot &#8220;More&#8221; menu and selecting &#8220;Manage all reusable blocks&#8221;:</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/5_manage_all_reusable_blocks.mov\"></video></figure>\n\n\n\n<p>This takes you to a section letting you edit, rename, export, or delete every reusable block you created.&nbsp;</p>\n\n\n\n<h2>What else can I do?</h2>\n\n\n\n<p>Here are a couple of tips and tricks you can leverage to get the most out of reusable blocks.</p>\n\n\n\n<h3>Give them a good name</h3>\n\n\n\n<p>When you name a reusable block, you are essentially choosing your search terms, as the name is what you search for in the block library (or when you use the &#8220;slash command,” typing / in an empty paragraph):</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/6_tip_name_them.mov\"></video></figure>\n\n\n\n<p>Avoid names such as &#8220;Gallery&#8221; or &#8220;Image,” as that’ll be annoying when you just want to insert one of those. You can avoid that with a unique name, such as &#8220;My author biography.”</p>\n\n\n\n<h3>Insert in the best place of your content flow</h3>\n\n\n\n<p>One obvious benefit of reusable blocks is that they are just blocks, just like everything else in the block editor. That means you can insert it anywhere in your content. You might want your rich author biography to sit at the top or bottom of the post, but <em>This post is part of a series</em> box that might sit well two or three paragraphs not to disrupt the reading flow.</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/7_tip_place_in_flow.mov\"></video></figure>\n\n\n\n<h3>A design shortcut</h3>\n\n\n\n<p>Maybe you created a complex layout you&#8217;re happy with, a call to action with the right image and buttons, and it took a while to get it just right. Go on and save it as a reusable block: even if you mean to insert it only to convert it to a regular block, it might still save you a minute.&nbsp;</p>\n\n\n\n<p>To convert a reusable block to regular (blocks, select it and click the &#8220;Convert to regular blocks&#8221;:</p>\n\n\n\n<p></p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/10_complex_layouts-2.mov\"></video></figure>\n\n\n\n<p><em>Design by </em><a href=\"https://beatrizfialho.com/\"><em>Beatriz Fialho</em></a><em>.</em></p>\n\n\n\n<p><strong>Tip:</strong> You can also find some nice patterns on <a href=\"https://gutenberghub.com/\">Gutenberg Hub</a> or <a href=\"https://shareablock.com/\">ShareABlock</a>.</p>\n\n\n\n<h3>Take it with you</h3>\n\n\n\n<p>Need to move to another site? You can both export and import reusable blocks. Go to the <em>Manage all reusable blocks</em> section from the global three-dot &#8220;More&#8221; menu, hover over the block you want to export, and click &#8220;Export as JSON&#8221;:</p>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2021/02/8_tip_import_export-1.mov\"></video></figure>\n\n\n\n<p>The downloaded file can be imported on any WordPress 5.0 or newer website.</p>\n\n\n\n<h2>Try it</h2>\n\n\n\n<p>Create a draft post and play around with Reusable Blocks to see how you might start using them. You can always delete them when you’re done playing.</p>\n\n\n\n<p>You can test importing and using a small reusable block I created as an example. It&#8217;s a &#8220;Further reading&#8221; block that shows the four latest posts from the category &#8220;Featured&#8221;:</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://lh6.googleusercontent.com/33_L1WQrTxNiidm8IKcSfn7_nYjcpq5zpSzycmKliDnGzFI_hLu7yLPV1vnqWgCS7H6JtFAGEXz-AVkNBLtQQEM80VA6KUfcmj1JAoVZ5ZNMavVzlGzBPEiqiD3-eUzZSvOTYm_E\" alt=\"\" /></figure>\n\n\n\n<p>It might work well as a highlight in an article, giving the reader something new to read or awareness of your other content.</p>\n\n\n\n<p><em><strong>The videos in this post show the reusable blocks flow in the upcoming WordPress 5.7.</strong></em></p>\n\n\n\n<p><a href=\"https://gist.github.com/jasmussen/53cb51dcd9a2bb561893aa7c5e126cdf\"><strong>Download the block from this gist</strong></a>, import it to your WordPress site, then customize to make it yours.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9777\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"WordPress 5.7 Release Candidate\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wordpress.org/news/2021/02/wordpress-5-7-release-candidate/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Feb 2021 21:07:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9773\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:374:\"The first release candidate for WordPress 5.7 is now available! 🎉 Please join us in celebrating this very important milestone in the community&#8217;s progress towards the final release! “Release Candidate” means that the new version is ready for release, but with millions of users and thousands of plugins and themes, it’s possible something was missed. [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ebonie Butler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3752:\"\n<p>The first release candidate for WordPress 5.7 is now available! <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f389.png\" alt=\"🎉\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Please join us in celebrating this very important milestone in the community&#8217;s progress towards the final release!</p>\n\n\n\n<p>“Release Candidate” means that the new version is ready for release, but with millions of users and thousands of plugins and themes, it’s possible something was missed. WordPress 5.7 is slated for release&nbsp;on&nbsp;<strong>March 9, 2021</strong>, but <em>your</em>&nbsp;help is needed to get there—if you haven’t tried 5.7 yet,&nbsp;<strong>now is the time</strong>!</p>\n\n\n\n<p>You can test the WordPress 5.7 release candidate in two ways:</p>\n\n\n\n<ul><li>Try the&nbsp;<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>&nbsp;plugin (choose the “Bleeding edge” channel and Beta/RC Only” stream options)</li><li>Or&nbsp;<a href=\"https://wordpress.org/wordpress-5.7-RC1.zip\">download the release candidate here (zip)</a>.</li></ul>\n\n\n\n<p>Thank you to all of the contributors who tested the&nbsp;Beta releases and gave feedback. Testing for bugs is a critical part of polishing every release and a great way to contribute to WordPress.</p>\n\n\n\n<h2>What’s in WordPress 5.7?</h2>\n\n\n\n<ul><li>Robots API and Media Search Engine Visibility</li><li>Detect HTTPS support</li><li>Lazy-load iframes</li><li>jQuery migrate-related Deprecation notice clean-up</li><li>Admin color palette standardization</li><li>The newest version of the Gutenberg plugin</li></ul>\n\n\n\n<h2>Plugin and Theme Developers</h2>\n\n\n\n<p>Please test your plugins and themes against WordPress 5.7 and update the&nbsp;<em>Tested up to</em>&nbsp;version in the readme file to 5.7. If you find compatibility problems, please be sure to post to the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta/\">support forums</a>,&nbsp;so those can be figured out before the final release.</p>\n\n\n\n<p>The&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://make.wordpress.org/core/2021/02/23/wordpress-5-7-field-guide\">WordPress 5.7 Field Guide</a>&nbsp;will give you a more detailed dive into the major changes.</p>\n\n\n\n<h2>How to Help</h2>\n\n\n\n<p>Do you speak a language other than English?&nbsp;<a href=\"https://translate.wordpress.org/projects/wp/dev\">Help us translate WordPress into more than 100 languages!</a>&nbsp;This release also marks the&nbsp;<a href=\"https://make.wordpress.org/polyglots/handbook/glossary/#hard-freeze\">hard string freeze</a>&nbsp;point of the 5.7 release schedule.</p>\n\n\n\n<p><em><strong>If you think you’ve found a bug</strong>, you can post to the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta area</a>&nbsp;in the support forums. We’d love to hear from you! If you’re comfortable writing a reproducible bug report,&nbsp;<a href=\"https://make.wordpress.org/core/reports/\">file one on WordPress Trac</a>, where you can also find&nbsp;<a href=\"https://core.trac.wordpress.org/tickets/major\">a list of known bugs</a>.</em></p>\n\n\n\n<p><em>Props to <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a> for copy suggestions and <a href=\'https://profiles.wordpress.org/davidbaumwald/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>davidbaumwald</a> for final review.</em></p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p><em>Test this test that <br>Catch everything that you can<br>Before it&#8217;s live&#8230;</em><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f92f.png\" alt=\"🤯\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9773\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:57:\"\n		\n		\n		\n		\n		\n				\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"WordPress 5.6.2 Maintenance Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/news/2021/02/wordpress-5-6-2-maintenance-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 22 Feb 2021 15:35:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9764\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:452:\"WordPress 5.6.2 is now available! This maintenance release includes&#160;5 bug fixes. These bugs affect WordPress version 5.6.1, so you’ll want to upgrade. You can&#160;download WordPress 5.6.2 directly, or visit the&#160;Dashboard → Updates&#160;screen&#160;and click&#160;Update Now. If your sites support automatic background updates, they’ve already started the update process. WordPress 5.6.2 is a small maintenance release focused [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Jonathan Desrosiers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5124:\"\n<p>WordPress 5.6.2 is now available!</p>\n\n\n\n<p>This maintenance release includes&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.6.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">5 bug fixes</a>. These bugs affect WordPress version 5.6.1, so you’ll want to upgrade.</p>\n\n\n\n<p>You can&nbsp;<a href=\"https://wordpress.org/wordpress-5.6.2.zip\">download WordPress 5.6.2 directly</a>, or visit the<strong>&nbsp;Dashboard → Updates</strong>&nbsp;screen&nbsp;and click&nbsp;<strong>Update Now</strong>. If your sites support automatic background updates, they’ve already started the update process.</p>\n\n\n\n<p>WordPress 5.6.2 is a small maintenance release focused on fixing user-facing issues discovered in 5.6.1. The next major release will be&nbsp;<a href=\"https://make.wordpress.org/core/5-7/\">version 5.7</a>, currently scheduled for release on March 9, 2021.</p>\n\n\n\n<p>To see a full list of changes, you can browse the&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.6.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">list on Trac</a>, read the&nbsp;<a href=\"https://make.wordpress.org/core/2021/02/17/wordpress-5-6-2-rc1/\">5.6.2 RC1</a>&nbsp;post, or visit the&nbsp;<a href=\"https://wordpress.org/support/wordpress-version/version-5-6-2/\">5.6.2 documentation page</a>.</p>\n\n\n\n<h2>Thanks and props!</h2>\n\n\n\n<p>The 5.6.2 release was led by <a href=\'https://profiles.wordpress.org/desrosj/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>desrosj</a>. Special props to <a href=\'https://profiles.wordpress.org/isabel_brison/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>isabel_brison</a> and <a href=\'https://profiles.wordpress.org/talldanwp/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>talldanwp</a> for helping to prepare the block editor related fixes, and <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a> and <a href=\'https://profiles.wordpress.org/sergeybiryukov/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>sergeybiryukov</a> for helping with other release related tasks.</p>\n\n\n\n<p>Props to everyone who helped make WordPress 5.6.2 happen:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">aaronrobertshaw</a>, <a href=\"https://profiles.wordpress.org/addiestavlo/\">Addie</a>, <a href=\"https://profiles.wordpress.org/nosolosw/\">André Maneiro</a>, <a href=\"https://profiles.wordpress.org/archon810/\">archon810</a>, <a href=\"https://profiles.wordpress.org/aristath/\">Ari Stathopoulos</a>, <a href=\"https://profiles.wordpress.org/bartosz777/\">bartosz777</a>, <a href=\"https://profiles.wordpress.org/bernhard-reiter/\">Bernhard Reiter</a>, <a href=\"https://profiles.wordpress.org/talldanwp/\">Daniel Richards</a>, <a href=\"https://profiles.wordpress.org/davidanderson/\">David Anderson</a>, <a href=\"https://profiles.wordpress.org/dbtedg/\">dbtedg</a>, <a href=\"https://profiles.wordpress.org/glendaviesnz/\">glendaviesnz</a>, <a href=\"https://profiles.wordpress.org/hmabpera/\">hmabpera</a>, <a href=\"https://profiles.wordpress.org/ibiza69/\">ibiza69</a>, <a href=\"https://profiles.wordpress.org/isabel_brison/\">Isabel Brison</a>, <a href=\"https://profiles.wordpress.org/viablethought/\">Jason Ryan</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/jrf/\">Juliette Reinders Folmer</a>, <a href=\"https://profiles.wordpress.org/kevin940726/\">Kai Hao</a>, <a href=\"https://profiles.wordpress.org/gwwar/\">Kerry Liu</a>, <a href=\"https://profiles.wordpress.org/hwk-fr/\">Konrad Chmielewski</a>, <a href=\"https://profiles.wordpress.org/jorgefilipecosta/\">Jorge Costa</a>, <a href=\"https://profiles.wordpress.org/magnuswebdesign/\">magnuswebdesign</a>, <a href=\"https://profiles.wordpress.org/clorith/\">Marius L. J.</a>, <a href=\"https://profiles.wordpress.org/mattwiebe/\">Matt Wiebe</a>, <a href=\"https://profiles.wordpress.org/mukesh27/\">Mukesh Panchal</a>, <a href=\"https://profiles.wordpress.org/paaljoachim/\">Paal Joachim Romdahl</a>, <a href=\"https://profiles.wordpress.org/freewebmentor/\">Prem Tiwari</a>, <a href=\"https://profiles.wordpress.org/itsjonq/\">Q</a>, <a href=\"https://profiles.wordpress.org/youknowriad/\">Riad Benguella</a>, <a href=\"https://profiles.wordpress.org/noisysocks/\">Robert Anderson</a>, <a href=\"https://profiles.wordpress.org/roger995/\">roger995</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov/\">Sergey Biryukov</a>, <a href=\"https://profiles.wordpress.org/yakimun/\">Sergey Yakimov</a>, <a href=\"https://profiles.wordpress.org/sterndata/\">Steven Stern (sterndata)</a>, <a href=\"https://profiles.wordpress.org/inc2734/\">Takashi Kitajima</a>, <a href=\"https://profiles.wordpress.org/tonysandwich/\">tonysandwich</a>, <a href=\"https://profiles.wordpress.org/worldedu/\">worldedu</a>, <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9764\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:66:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"Reflecting on Gutenberg’s 100th Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wordpress.org/news/2021/02/reflecting-on-gutenbergs-100th-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 19 Feb 2021 18:34:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:7:\"General\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:13:\"Uncategorized\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:9:\"Gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9750\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:227:\"Gutenberg 10.0 released this week, February 17, 2021, marking the 100th release of the Gutenberg plugin; the 100th release of a journey that started more than four years ago when Matt announced the project at WordCamp US 2016. \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Riad Benguella\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3881:\"\n<figure class=\"wp-block-jetpack-image-compare\"><div class=\"juxtapose\" data-mode=\"horizontal\"><img loading=\"lazy\" id=\"9751\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/02/gutenberg_past_3.png?resize=632%2C336&#038;ssl=1\" alt=\"\" width=\"632\" height=\"336\" class=\"image-compare__image-before\" data-recalc-dims=\"1\" /><img loading=\"lazy\" id=\"9752\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/02/gutenberg_today_4.png?resize=632%2C336&#038;ssl=1\" alt=\"\" width=\"632\" height=\"336\" class=\"image-compare__image-after\" data-recalc-dims=\"1\" /></div><figcaption>1.0 to 10.0</figcaption></figure>\n\n\n\n<p>Gutenberg 10.0 released this week, February 17, 2021, marking the 100th release of the Gutenberg plugin; the 100th release of a journey that started more than four years ago when Matt announced the project at WordCamp US 2016.&nbsp;</p>\n\n\n\n<h2>Where We Started</h2>\n\n\n\n<p>The past four years have not always been an easy journey. Shipping something this impactful is not easy, and there was precedent for keeping the editor as it was: WordPress had already tried to replace TinyMCE a couple of times already. What would be different this time around? The worry was “not much” and initially, very few people actively joined the project.</p>\n\n\n\n<p>Six months later came WordCamp Europe 2017 and the first release of the plugin. The editor was nowhere close to being usable, but it “clicked” for some. The reactions to <a href=\"https://wordpress.tv/2017/07/01/interview-and-qanda-with-matt-mullenweg/\">the presentation</a> were hopeful, but afterward, there was a lot of pushback.</p>\n\n\n\n<p>Gutenberg was (and is) an audacious project. With a project this big it attracted a lot of attention, and it became difficult to discern constructive debate from mere opposition. We each come with our context, and some people had a fixed idea about what they wanted for the project. Some wanted to reuse an existing page builder, others wanted to revive the Fields API project, some wanted it to be front-end-first, others wanted it just to replace the classic editor’s content area, some wanted it to be in Vue.JS, others wanted no change at all. With a product used by 40% of the web, you hope to find consensus, and when compromises have to be made, it can be difficult for those involved to avoid feeling that their voice is being ignored.</p>\n\n\n\n<p>We have also made quite a few mistakes: stability wasn’t great in some releases, performance suffered in others, and accessibility as well. But we kept pushing forward, using feedback to improve the editor and the project in all aspects until its first inclusion in WordPress 5.0, and we’re still working to improve it today.</p>\n\n\n\n<h2>Where We Are</h2>\n\n\n\n<p>It’s a delight to see some people who strongly disagreed with the initial vision or approach to Gutenberg gradually come to enjoy using the editor and join the project to carry on its vision. Others might still not like it; some won’t ever use it. One thing is certain; we’ll continue doing our best to push forward, improve what’s already shipped, and ship new exciting features. We’ll continue making mistakes and hopefully continue learning from them.</p>\n\n\n\n<p>Wednesday marked the 100th release of Gutenberg, and while that looks remarkable on the outside, the release itself holds what all the other releases did. It holds improvements to the existing features, it fixes bugs that users reported, adds new features, and it highlights experiments with new ideas.</p>\n\n\n\n<p>What is remarkable about the release is the people. The ones who were with us from the start, the ones who were with us but left, the ones who joined in our journey, everyone who helped along the way, everyone who provided feedback, everyone who got their hands dirty, and everyone who tried to use this editor, extend it and provide ideas.</p>\n\n\n\n<p>Thank you all.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9750\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"WordPress 5.7 Beta 3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Feb 2021 21:25:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9727\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:335:\"WordPress 5.7 Beta 3 is now available for testing! 🗣 This software is still in development,&#160;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with it. You can test the WordPress 5.7 Beta 3 in two ways: Install/activate the WordPress Beta Tester plugin (select [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ebonie Butler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:4891:\"\n<p>WordPress 5.7 Beta 3 is now available for testing! <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p><strong>This software is still in development,</strong>&nbsp;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with it.</p>\n\n\n\n<p>You can test the WordPress 5.7 Beta 3 in two ways:</p>\n\n\n\n<ul><li>Install/activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (select the&nbsp;<code>Bleeding edge</code>&nbsp;channel and the&nbsp;<code>Beta/RC Only</code> stream)</li><li>Direct download the beta version here (<a href=\"https://wordpress.org/wordpress-5.7-beta3.zip\">zip</a>).</li></ul>\n\n\n\n<p>The current target for final release is March 9, 2021. That’s just <strong>three weeks away</strong>, so your help is vital to making sure that the final release is as good as it can be.</p>\n\n\n\n<h2><strong>Some Highlights</strong></h2>\n\n\n\n<p>Since <a href=\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-2/\">Beta 2</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=02%2F10%2F2021..02%2F17%2F2021&amp;milestone=5.7&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">27</a> bugs have been fixed. Here is a summary of some of the included changes:</p>\n\n\n\n<ul><li>Adjusted color contrast on various admin buttons to improve accessibility and readability (<a href=\"https://core.trac.wordpress.org/ticket/52402\">#52402</a>)</li><li>Several fixes for the Twenty Twenty-One theme (<a href=\"https://core.trac.wordpress.org/ticket/52287\">#52287</a>, <a href=\"https://core.trac.wordpress.org/ticket/52377\">#52377</a>, <a href=\"https://core.trac.wordpress.org/ticket/52431\">#52431</a>, <a href=\"https://core.trac.wordpress.org/ticket/52500\">#52500</a>, <a href=\"#52502\">#5</a><a href=\"https://core.trac.wordpress.org/ticket/52502\">2</a><a href=\"#52502\">502</a>, <a href=\"https://core.trac.wordpress.org/ticket/52412\">#52412</a>)</li><li>Replaced editor typeface with system fonts to improve privacy and performance (<a href=\"#46169\">#46169</a>)</li><li>Added i18n support to <code>register_block_type_from_metadata</code> function (<a href=\"https://core.trac.wordpress.org/ticket/52301\">#52301</a>)</li><li>Media upload errors are now more accessible (<a href=\"https://core.trac.wordpress.org/ticket/47120\">#47120</a>)</li><li>New filter to modify how pagination links are rendered when using <code>paginate_links</code> function (<a href=\"https://core.trac.wordpress.org/ticket/44018\">#44018</a>)</li></ul>\n\n\n\n<h2><strong>How You Can Help</strong></h2>\n\n\n\n<p>Watch the Make WordPress Core blog for 5.7-related developer notes in the coming weeks, which will break down these and other changes in greater detail.</p>\n\n\n\n<p>So far, contributors have fixed <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=..02%2F16%2F2021&amp;milestone=5.7&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">171 tickets in WordPress 5.7</a>, including <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;status=reopened&amp;changetime=..02%2F16%2F2021&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=changetime&amp;col=owner&amp;col=priority&amp;col=keywords&amp;order=changetime\">64 new features and enhancements</a>, and more bug fixes are on the way.</p>\n\n\n\n<p><strong>Do some testing!</strong></p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/handbook/testing/beta-testing/\">Testing for bugs</a> is a vital part of polishing the release during the beta stage and a great way to contribute. <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>If you think you’ve found a bug, please post to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta</a> area in the support forums. We would love to hear from you! If you’re comfortable writing a reproducible bug report, file one on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. That’s also where you can find a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p><em>Props to <a href=\"https://profiles.wordpress.org/audrasjb/\">@audrasjb</a> and <a href=\"https://profiles.wordpress.org/lukecarbis/\">@lukecarbis</a> for your peer revisions.</em></p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p><em>Finish line ahead<br>Defects in focus<br>We are almost there&#8230;</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9727\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:72:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"People of WordPress: Pooja Derashri\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://wordpress.org/news/2021/02/people-of-wordpress-pooja-derashri/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Feb 2021 23:10:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:6:{i:0;a:5:{s:4:\"data\";s:9:\"Community\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:9:\"heropress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:10:\"Interviews\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:16:\"ContributorStory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:9:\"HeroPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:5;a:5:{s:4:\"data\";s:19:\"People of WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9652\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:169:\"Pooja Derashri shares the story of how she went from being an introverted girl from a small village in India to becoming a developer, thanks to the WordPress community. \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"webcommsat AbhaNonStopNewsUK\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:10697:\"\n<p><em>WordPress is open source software, maintained by a global network of contributors. There are many examples of how WordPress has changed people’s lives for the better. In this monthly series, we share some of the amazing stories that are lesser-known.</em></p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" width=\"632\" height=\"331\" src=\"https://i0.wp.com/wordpress.org/news/files/2021/02/pic1.jpg?resize=632%2C331&#038;ssl=1\" alt=\"Pooja standing in a banner &quot;I\'m a WordPress fan&quot;\" class=\"wp-image-9719\" srcset=\"https://i0.wp.com/wordpress.org/news/files/2021/02/pic1.jpg?resize=1024%2C536&amp;ssl=1 1024w, https://i0.wp.com/wordpress.org/news/files/2021/02/pic1.jpg?resize=300%2C157&amp;ssl=1 300w, https://i0.wp.com/wordpress.org/news/files/2021/02/pic1.jpg?resize=768%2C402&amp;ssl=1 768w, https://i0.wp.com/wordpress.org/news/files/2021/02/pic1.jpg?w=1200&amp;ssl=1 1200w\" sizes=\"(max-width: 632px) 100vw, 632px\" data-recalc-dims=\"1\" /></figure>\n\n\n\n<p>Pooja Derashri shares the story of how she went from being an introvert from a small village in India to becoming a developer and working on international projects, thanks to the WordPress community. </p>\n\n\n\n<p>As her interest grew, Pooja started following some WordPress-based groups on Facebook, where she first heard about conference-style WordPress events known as WordCamps. She later joined her first WordCamp in Ahmedabad, India. This three day event in 2017 opened up a new world—the WordPress community—and what would become a life changing moment. “WordCamp Ahmedabad has one of the best WordPress communities in India,&#8221; she said, &#8220;and everyone, including organizers and attendees were so humble and welcoming.”</p>\n\n\n\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"https://i0.wp.com/wordpress.org/news/files/2021/02/pooja600x600.jpg?w=500&#038;ssl=1\" alt=\"\" class=\"wp-image-9654\" srcset=\"https://i0.wp.com/wordpress.org/news/files/2021/02/pooja600x600.jpg?w=600&amp;ssl=1 600w, https://i0.wp.com/wordpress.org/news/files/2021/02/pooja600x600.jpg?resize=300%2C300&amp;ssl=1 300w, https://i0.wp.com/wordpress.org/news/files/2021/02/pooja600x600.jpg?resize=150%2C150&amp;ssl=1 150w\" sizes=\"(max-width: 600px) 100vw, 600px\" data-recalc-dims=\"1\" /></figure>\n\n\n\n<h2><strong>The thirst for learning</strong></h2>\n\n\n\n<p>A fascination with how things worked and a desire never stop learning were traits that shone through in Pooja from a young age. She moved from Banera, a rural village in India, to a nearby city, where she lived with her uncle while completing her higher education. With her enthusiasm for learning, she decided to become an engineer. When thinking back on that time she says, “Being from a rural background, people in my village tended not to be keen on the idea of sending their girl child to another city for further studies. Fortunately, that was not the case for me because my parents were immensely supportive of me and my interests. They’ve always encouraged me to believe in myself and fulfill my dreams. With their support, I pursued my engineering in electronics and communication.”</p>\n\n\n\n<h2><strong>Discovering the opportunities in web development&nbsp;</strong></h2>\n\n\n\n<p>On completing her engineering training, Pooja was not sure what to do next. One of her friends suggested that she should explore web development. The idea intrigued her, and she sought out learning resources to study. She also secured an internship as a PHP Developer to give herself the chance to learn alongside professionals in the field.</p>\n\n\n\n<h2><strong>Getting started with WordPress</strong></h2>\n\n\n\n<blockquote class=\"wp-block-quote has-text-align-center\"><p><strong>“I found WordPress surpassed other platforms. The vast knowledge base made it easy for me to learn.” &#8211; Pooja</strong></p></blockquote>\n\n\n\n<p>This internship led Pooja to her first job where she discovered a range of content management systems. Her view of the opportunities offered by these systems changed when the manager assigned her a small project using the WordPress platform.&nbsp;</p>\n\n\n\n<p>She recalls: “I found WordPress surpassed other platforms I had worked on earlier. The vast knowledge base made it easy for me to learn.” She soon became comfortable managing WordPress, working with plugins and themes, and wanted to learn it more in-depth.</p>\n\n\n\n<p>Pooja soon joined WPVibes as its first team member. Being part of a new startup gave her a lot of experience and a chance to be involved in new processes. As the company expanded they started providing custom plugin development services per the client’s requirement and created some free and paid plugins. Pooja said, &#8220;We found it very exciting and productive. Today, we are a team of 10.”</p>\n\n\n\n<h2><strong>Encouragement from the WordPress community</strong></h2>\n\n\n\n<blockquote class=\"wp-block-quote has-text-align-center\"><p><strong>Contributing to WordPress increases your knowledge</strong></p></blockquote>\n\n\n\n<p>At the event, she was able to listen to speakers from India and abroad, many of whom shared their journey with WordPress and how it had changed their lives. “One of the most inspiring sessions was by Rahul Bansal,&#8221; she said. &#8220;He talked about contributing to WordPress and giving back to the community. He also explained how contributing to WordPress can help you to enhance your knowledge. It inspired me to contribute to WordPress.”</p>\n\n\n\n<p>The WordPress community of Ahmedabad continued to inspire Pooja and her husband Anand Upadhyay, and they later started a Meetup group in their home city of Ajmer as part of their contribution to the community. They continue to be involved in supporting local users through the <a href=\"https://www.meetup.com/ajmer-wordpress-meetup/\">Ajmer Meetup</a>.</p>\n\n\n\n<figure class=\"wp-block-image is-resized\"><img src=\"https://lh5.googleusercontent.com/KmA8iDgGrRar_cgD2jp2ThrzPxuzGTSI7SWkxDdHKyN4p2iNoj0e-VdOxO0xa1TtH56Uci9wEfYYfnW8DYji8c1HuaI7L-xhNqXyXt_kdchWtVxe_PnSea2knlWhP_O7qqG0Quju\" alt=\"Pooja with a WordCamp Ahmedabad badge\" width=\"500\" /></figure>\n\n\n\n<p>At the next WordCamp Pooja attended, she joined its contributor day, which brings users together to give back to the open source platform and global community. Most of the contributors she met were interested in giving time to the WordPress CMS. She decided to venture into a different path and took her first steps by joining the WordPress TV group, where you can explore videos from WordPress events across the world. She also discovered the joy of translating into her local language, and is a <a href=\"https://make.wordpress.org/polyglots/\">Polyglot</a> contributor for the Hindi language.</p>\n\n\n\n<p>In 2019, she was selected as a volunteer for WordCamp Asia in Bangkok, Thailand, and it became an impetus to become even more involved with the community. She was very excited about this role, and to be part of her first WordCamp outside India. Sadly, due to the global COVID pandemic, the event had to be cancelled. Her enthusiasm has not diminished and she is eagerly waiting to support in-person WordCamps in the future and meet even more members of the global community.</p>\n\n\n\n<p>Her determination to be part of making WordPress and sharing skills has only increased, which has led to contribute to the WordPress Training team. This team manages lesson plans and prepares content to support people who are training others to use WordPress. The team recently joined a few other teams to <a href=\"https://wordpress.org/news/2020/12/introducing-learn-wordpress/\">launch Learn WordPress</a>, which brings learning materials together for users of all levels, and Pooja contributed to two different teams during the project.</p>\n\n\n\n<h2><strong>Message to the WordPress Community</strong></h2>\n\n\n\n<p>Pooja is eager to share her belief in the power for good in the WordPress community. “There is a huge community to help you with your learning, so start learning and try to give back to the community. It doesn’t matter if you are not comfortable with programming, there are many different ways in which you can contribute.”&nbsp;</p>\n\n\n\n<p>“What I have learned in my life is that it doesn’t matter from where you came and what background you have. All that matters is your hard work and positive attitude towards life.”</p>\n\n\n\n<p>Read more stories in the <a href=\"https://wordpress.org/news/category/heropress/\">People of WordPress series</a>.</p>\n\n\n\n<h2>Contributors</h2>\n\n\n\n<p><em>Thanks to Abha Thakor (<a href=\"https://profiles.wordpress.org/webcommsat/\">@webcommsat</a>) and Nalini Thakor (<a href=\'https://profiles.wordpress.org/nalininonstopnewsuk/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>nalininonstopnewsuk</a>) for writing this story, and to Surendra Thakor (<a href=\"https://profiles.wordpress.org/sthakor/\">@sthakor</a>), Josepha Haden (<a href=\"https://profiles.wordpress.org/chanthaboune/\">@chanthaboune</a>), Meher Bala (<a href=\"https://profiles.wordpress.org/meher/\">@meher</a>), Chloé Bringmann (<a href=\"https://profiles.wordpress.org/cbringmann/\">@cbringmann</a>), Olga Glekler (<a href=\'https://profiles.wordpress.org/oglekler/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>oglekler</a>), Christopher Churchill (<a href=\'https://profiles.wordpress.org/vimes1984/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>vimes1984</a>), Larissa Murillo (<a href=\'https://profiles.wordpress.org/lmurillom/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>lmurillom</a>), and Yvette Sonneveld (<a href=\"https://profiles.wordpress.org/yvettesonneveld/\">@yvettesonneveld</a>) for work on the series this month. Thank you also to Pooja Derashri (<a href=\'https://profiles.wordpress.org/webtechpooja/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>webtechpooja</a>) for sharing her #ContributorStory.</em></p>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:100%\">\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\" style=\"grid-template-columns:27% auto\"><figure class=\"wp-block-media-text__media\"><img src=\"https://lh4.googleusercontent.com/E9y8t1dTqeOylNc4mkC0KeQfmCisFLy4790Idt2DYwWdKSEwCh7RlsAmTcnRYuTb7jqXzwtYVjPRsXDVTh_HREDUWAbB-sOOXuC7HEZR-uEeV046dl8X3eU9kG6fpIXkRn0SbDcT\" alt=\"HeroPress logo\" /></figure><div class=\"wp-block-media-text__content\">\n<p><em>This post is based on an article originally published on HeroPress.com, an initiative focused around people in the WordPress community created by </em><a href=\"https://profiles.wordpress.org/topher1kenobe/\"><em>Topher DeRosia</em></a><em>.</em></p>\n</div></div>\n</div>\n</div>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9652\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"WordPress 5.7 Beta 2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 09 Feb 2021 20:42:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9688\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:335:\"WordPress 5.7 Beta 2 is now available for testing! 🗣 This software is still in development,&#160;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with it. You can test the WordPress 5.7 Beta 2 in two ways: Install/activate the WordPress Beta Tester plugin (select [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ebonie Butler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5291:\"\n<p>WordPress 5.7 Beta 2 is now available for testing! <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p><strong>This software is still in development,</strong>&nbsp;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with it.</p>\n\n\n\n<p>You can test the WordPress 5.7 Beta 2 in two ways:</p>\n\n\n\n<ul><li>Install/activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (select the&nbsp;<code>Bleeding edge</code>&nbsp;channel and the&nbsp;<code>Beta/RC Only</code> stream)</li><li>Direct download the beta version here (<a href=\"https://wordpress.org/wordpress-5.7-beta2.zip\">zip</a>).</li></ul>\n\n\n\n<p>The current target for final release is March 9, 2021. That’s just <strong>four weeks away</strong>, so your help is vital to making sure that the final release is as good as it can be.</p>\n\n\n\n<h2><strong>Some Highlights</strong></h2>\n\n\n\n<p>Since <a href=\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-1/\">Beta 1</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=02%2F03%2F2021..02%2F10%2F2021&amp;milestone=5.7&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">38</a> bugs have been fixed. Here is a summary of some of the included changes:</p>\n\n\n\n<ul><li>Italicized text has been removed to improve accessibility and readability (<a href=\"https://core.trac.wordpress.org/ticket/47327\">#47326</a>)</li><li>Pause any playing media when closing the the media modal (<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/48562\">#48562</a>)</li><li>Add Content-Security-Policy script loaders (<a rel=\"noreferrer noopener\" href=\"https://core.trac.wordpress.org/ticket/39941\" target=\"_blank\">#39941</a>)</li><li>Several fixes for the Twenty Twenty-One theme (<a rel=\"noreferrer noopener\" href=\"https://core.trac.wordpress.org/ticket/50454\" target=\"_blank\">#50454</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52432\">#52432</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52433\">#52433</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52473\">#52473</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52477\">#52477</a>, <a href=\"https://core.trac.wordpress.org/ticket/52374\">#52374</a>)</li><li>Gutenberg editor support for custom spacing (<a href=\"https://core.trac.wordpress.org/ticket/51760\">#51760</a>)</li><li>Resolved Menu UI issues on medium-large screen sizes (<a href=\"https://core.trac.wordpress.org/ticket/49576\">#49576</a>)</li><li>Admin UI color palette: ensure that all interactive elements have an appropriate contrast ratio (<a href=\"https://core.trac.wordpress.org/ticket/52402\">#52402</a>)</li></ul>\n\n\n\n<h2><strong>How You Can Help</strong></h2>\n\n\n\n<p>Watch the Make WordPress Core blog for 5.7-related developer notes in the coming weeks, which will break down these and other changes in greater detail.</p>\n\n\n\n<p>So far, contributors have fixed <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=..02%2F09%2F2021&amp;milestone=5.7&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">157 tickets in WordPress 5.7</a>, including <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;status=reopened&amp;changetime=..02%2F03%2F2021&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=changetime&amp;col=owner&amp;col=priority&amp;col=keywords&amp;order=changetime\">68 new features and enhancements</a>, and more bug fixes are on the way.</p>\n\n\n\n<p><strong>Do some testing!</strong></p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/handbook/testing/beta-testing/\">Testing for bugs</a> is a vital part of polishing the release during the beta stage and a great way to contribute. <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>If you think you’ve found a bug, please post to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta</a> area in the support forums. We would love to hear from you! If you’re comfortable writing a reproducible bug report, file one on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. That’s also where you can find a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p><em>Props to <a href=\"https://profiles.wordpress.org/audrasjb/\">@audrasjb</a>, <a style=\"font-style: italic\" href=\"https://profiles.wordpress.org/hellofromtonya/\">@hellofromtonya</a>, <a href=\"https://profiles.wordpress.org/francina/\">@francina</a> and <a href=\"https://profiles.wordpress.org/desrosj/\">@desrosj</a> for your peer revisions!</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9688\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:57:\"\n		\n		\n		\n		\n		\n				\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"WordPress 5.6.1 Maintenance Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/news/2021/02/wordpress-5-6-1-maintenance-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 21:30:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9574\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:468:\"WordPress 5.6.1 is now available! This maintenance release features&#160;20 bug fixes as well as&#160;7 issues fixed for the&#160;block&#160;editor. These bugs affect WordPress version 5.6, so you’ll want to upgrade. You can&#160;download WordPress 5.6.1 directly, or visit the&#160;Dashboard → Updates&#160;screen&#160;and click&#160;Update Now. If your sites support automatic background updates, they’ve already started the update process. WordPress [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8347:\"\n<p>WordPress 5.6.1 is now available!</p>\n\n\n\n<p>This maintenance release features&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.6.1&amp;group=status&amp;col=id&amp;col=summary&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">20 bug fixes</a> as well as&nbsp;7 issues fixed for the&nbsp;block&nbsp;editor. These bugs affect WordPress version 5.6, so you’ll want to upgrade.</p>\n\n\n\n<p>You can&nbsp;<a href=\"https://wordpress.org/wordpress-5.6.1.zip\">download WordPress 5.6.1 directly</a>, or visit the<strong>&nbsp;Dashboard → Updates</strong>&nbsp;screen&nbsp;and click&nbsp;<strong>Update Now</strong>. If your sites support automatic background updates, they’ve already started the update process.</p>\n\n\n\n<p>WordPress 5.6.1 is a short-cycle maintenance release. The next major release will be&nbsp;<a href=\"https://make.wordpress.org/core/5-7/\">version 5.7</a>.</p>\n\n\n\n<p>To see a full list of changes, you can browse the&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.6.1&amp;group=status&amp;col=id&amp;col=summary&amp;col=status&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=priority\">list on Trac</a>, read the&nbsp;<a href=\"https://make.wordpress.org/core/2021/01/28/wordpress-5-6-1-rc1/\">5.6.1 RC1</a>&nbsp;post, or visit the&nbsp;<a href=\"https://wordpress.org/support/wordpress-version/version-5-6-1/\">5.6.1 documentation page</a>.</p>\n\n\n\n<h2>Thanks and props!</h2>\n\n\n\n<p>The 5.6.1 release was led by <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a>, <a href=\'https://profiles.wordpress.org/desrosj/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>desrosj</a>, <a href=\'https://profiles.wordpress.org/sergeybiryukov/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>sergeybiryukov</a> and <a href=\'https://profiles.wordpress.org/whyisjake/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>whyisjake</a>. Thanks to <a href=\'https://profiles.wordpress.org/metalandcoffee/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>metalandcoffee</a> and <a href=\'https://profiles.wordpress.org/hellofromtonya/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>hellofromtonya</a> for running bug scrubs, <a href=\'https://profiles.wordpress.org/planningwrite/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>planningwrite</a> and <a href=\'https://profiles.wordpress.org/davidbaumwald/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>davidbaumwald</a> for their help on the release post.</p>\n\n\n\n<p>Props to everyone who helped make WordPress 5.6.1 happen:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/aaribaud/\">aaribaud</a>, <a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>, <a href=\"https://profiles.wordpress.org/engahmeds3ed/\">Ahmed Saeed</a>, <a href=\"https://profiles.wordpress.org/azaozz/\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/antpb/\">Anthony Burchell</a>, <a href=\"https://profiles.wordpress.org/archon810/\">archon810</a>, <a href=\"https://profiles.wordpress.org/aristath/\">Ari Stathopoulos</a>, <a href=\"https://profiles.wordpress.org/ayeshrajans/\">Ayesh Karunaratne</a>, <a href=\"https://profiles.wordpress.org/basscan/\">basscan</a>, <a href=\"https://profiles.wordpress.org/carloscastilloadhoc/\">carloscastilloadhoc</a>, <a href=\"https://profiles.wordpress.org/poena/\">Carolina Nymark</a>, <a href=\"https://profiles.wordpress.org/celendesign/\">celendesign</a>, <a href=\"https://profiles.wordpress.org/cfinke/\">Christopher Finke</a>, <a href=\"https://profiles.wordpress.org/copons/\">Copons</a>, <a href=\"https://profiles.wordpress.org/danfarrow/\">Dan Farrow</a>, <a href=\"https://profiles.wordpress.org/talldanwp/\">Daniel Richards</a>, <a href=\"https://profiles.wordpress.org/davidbinda/\">david.binda</a>, <a href=\"https://profiles.wordpress.org/denisco/\">Denis Yanchevskiy</a>, <a href=\"https://profiles.wordpress.org/dilipbheda/\">Dilip Bheda</a>, <a href=\"https://profiles.wordpress.org/ocean90/\">Dominik Schilling</a>, <a href=\"https://profiles.wordpress.org/metalandcoffee/\">Ebonie Butler</a>, <a href=\"https://profiles.wordpress.org/flixos90/\">Felix Arntz</a>, <a href=\"https://profiles.wordpress.org/mista-flo/\">Florian TIAR</a>, <a href=\"https://profiles.wordpress.org/garrett-eclipse/\">Garrett Hyder</a>, <a href=\"https://profiles.wordpress.org/gkibria69/\">gKibria</a>, <a href=\"https://profiles.wordpress.org/gziolo/\">Greg Ziółkowski</a>, <a href=\"https://profiles.wordpress.org/helen/\">Helen Hou-Sandi</a>, <a href=\"https://profiles.wordpress.org/iandunn/\">Ian Dunn</a>, <a href=\"https://profiles.wordpress.org/ifnoob/\">ifnoob</a>, <a href=\"https://profiles.wordpress.org/isabel_brison/\">Isabel Brison</a>, <a href=\"https://profiles.wordpress.org/ismailelkorchi/\">Ismail El Korchi</a>, <a href=\"https://profiles.wordpress.org/whyisjake/\">Jake Spurlock</a>, <a href=\"https://profiles.wordpress.org/macmanx/\">James Huff</a>, <a href=\"https://profiles.wordpress.org/madtownlems/\">Jason LeMahieu (MadtownLems)</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/johnbillion/\">John Blackbourn</a>, <a href=\"https://profiles.wordpress.org/desrosj/\">Jonathan Desrosiers</a>, <a href=\"https://profiles.wordpress.org/jonathanstegall/\">Jonathan Stegall</a>, <a href=\"https://profiles.wordpress.org/jorgefilipecosta/\">Jorge Costa</a>, <a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha</a>, <a href=\"https://profiles.wordpress.org/justinahinon/\">Justin Ahinon</a>, <a href=\"https://profiles.wordpress.org/kevin940726/\">Kai Hao</a>, <a href=\"https://profiles.wordpress.org/ryelle/\">Kelly Choyce-Dwan</a>, <a href=\"https://profiles.wordpress.org/kjellr/\">Kjell Reigstad</a>, <a href=\"https://profiles.wordpress.org/xkon/\">Konstantinos Xenos</a>, <a href=\"https://profiles.wordpress.org/litemotiv/\">litemotiv</a>, <a href=\"https://profiles.wordpress.org/lucasbustamante/\">lucasbustamante</a>, <a href=\"https://profiles.wordpress.org/akramipro/\">Mahdi Akrami</a>, <a href=\"https://profiles.wordpress.org/majhajob/\">majhajob</a>, <a href=\"https://profiles.wordpress.org/manzurahammed/\">Manzur Ahammed</a>, <a href=\"https://profiles.wordpress.org/clorith/\">Marius L. J.</a>, <a href=\"https://profiles.wordpress.org/mattwiebe/\">Matt Wiebe</a>, <a href=\"https://profiles.wordpress.org/maxpertici/\">Maxime Pertici</a>, <a href=\"https://profiles.wordpress.org/melchoyce/\">Mel Choyce-Dwan</a>, <a href=\"https://profiles.wordpress.org/mbabker/\">Michael Babker</a>, <a href=\"https://profiles.wordpress.org/mukesh27/\">Mukesh Panchal</a>, <a href=\"https://profiles.wordpress.org/nicolaskulka/\">NicolasKulka</a>, <a href=\"https://profiles.wordpress.org/ntsekouras/\">Nik Tsekouras</a>, <a href=\"https://profiles.wordpress.org/oakesjosh/\">oakesjosh</a>, <a href=\"https://profiles.wordpress.org/peterwilsoncc/\">Peter Wilson</a>, <a href=\"https://profiles.wordpress.org/freewebmentor/\">Prem Tiwari</a>, <a href=\"https://profiles.wordpress.org/youknowriad/\">Riad Benguella</a>, <a href=\"https://profiles.wordpress.org/iamfriendly/\">Richard Tape</a>, <a href=\"https://profiles.wordpress.org/noisysocks/\">Robert Anderson</a>, <a href=\"https://profiles.wordpress.org/rodrigosprimo/\">Rodrigo Primo</a>, <a href=\"https://profiles.wordpress.org/sebsz/\">SeBsZ</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov/\">Sergey Biryukov</a>, <a href=\"https://profiles.wordpress.org/slaffik/\">Slava Abakumov</a>, <a href=\"https://profiles.wordpress.org/sabernhardt/\">Stephen Bernhardt</a>, <a href=\"https://profiles.wordpress.org/t-p/\">t-p</a>, <a href=\"https://profiles.wordpress.org/inc2734/\">Takashi Kitajima</a>, <a href=\"https://profiles.wordpress.org/tanvirul/\">Tanvirul Haque</a>, <a href=\"https://profiles.wordpress.org/thorlentz/\">thorlentz</a>, <a href=\"https://profiles.wordpress.org/timothyblynjacobs/\">Timothy Jacobs</a>, <a href=\"https://profiles.wordpress.org/skithund/\">Toni Viemerö</a>, <a href=\"https://profiles.wordpress.org/arcangelini/\">Tony A</a>, <a href=\"https://profiles.wordpress.org/hellofromtonya/\">Tonya Mork</a>, <a href=\"https://profiles.wordpress.org/transl8or/\">transl8or</a>, and <a href=\"https://profiles.wordpress.org/vladytimy/\">Vlad T</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9574\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:57:\"\n		\n		\n		\n		\n		\n				\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"The Month in WordPress: January 2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/news/2021/02/the-month-in-wordpress-january-2021/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 15:01:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Month in WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9632\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:382:\"For WordPress, 2021 started on a high note. Read on to learn about updates from last month.&#160; WordPress release updates WordPress project executive director — Josepha Haden (@chanthaboune) shared big picture goals for WordPress in 2021. Highlights include shipping&#160; Full Site Editing&#160; — first on the Gutenberg plugin in April 2021&#160; and later in core [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Hari Shanker R\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:11659:\"\n<p>For WordPress, 2021 started on a high note. Read on to learn about updates from last month.&nbsp;</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>WordPress release updates</h2>\n\n\n\n<p>WordPress project executive director — Josepha Haden (<a href=\'https://profiles.wordpress.org/chanthaboune/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>chanthaboune</a>) <a href=\"https://make.wordpress.org/updates/2021/01/21/big-picture-goals-2021/\">shared big picture goals for WordPress in 2021</a>. Highlights include shipping&nbsp; Full Site Editing&nbsp; — first on the Gutenberg plugin in April 2021&nbsp; and later in core (with WordPress 5.8), improved learning opportunities on learn.wordpress.org, and better tooling for contributors. As per the updated <a href=\"https://wordpress.org/about/roadmap/\">WordPress roadmap</a>, WordPress version 5.7 is planned to launch in March 2021 and WordPress 5.8 in June 2021. Some related updates:</p>\n\n\n\n<ul><li>Contributor teams are working on <a href=\"https://make.wordpress.org/core/2021/01/29/introducing-css-custom-properties/\">an updated admin color palette for WordPress 5.7</a> that will be more accessible and easy to read.&nbsp;</li><li>The Core team is working on a proposal to <a href=\"https://make.wordpress.org/core/2021/01/12/recap-and-proposal-align-the-wordpress-release-cycle-with-the-industry-standard/\">align WordPress release cycles with industry standards</a>.&nbsp;</li><li>WordPress 5.6.1 <a href=\"https://make.wordpress.org/core/2021/01/28/wordpress-5-6-1-rc1/\">Release Candidate 1</a> is out. This release is set to launch by<a href=\"https://make.wordpress.org/core/2021/02/02/a-week-in-core-february-1-2021/\"> February 3, 2021</a>. Questions and answers for <a href=\"https://github.com/wpmarketingteam/WP5.6Marcomms\">WordPress 5.6</a> are now <a href=\"https://github.com/wpmarketingteam/WP5.6Marcomms\">available on GitHub</a>. Contact the <a href=\"https://wordpress.slack.com/archives/C0GKJ7TFA\">#marketing</a> channel in the WordPress Slack, if you would like to contribute.</li><li>The <a href=\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-1/\">WordPress 5.7 Beta 1</a> release is out! Download the <a href=\"https://wordpress.org/wordpress-5.7-beta1.zip\">zip file</a> or use the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">beta tester plugin</a> to test it out.&nbsp;</li></ul>\n\n\n\n<p>Want to be involved in the next release? You can help build WordPress Core by following<a href=\"https://make.wordpress.org/core/\"> the Core team blog</a> and joining the <a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">#core</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>.</p>\n\n\n\n<h2>Proposal to return to in-person WordPress events in safe locations</h2>\n\n\n\n<p>The Community team is <a href=\"https://make.wordpress.org/community/2021/01/26/proposal-update-decision-making-checklist-for-safe-in-person-meetups/\">discussing an updated proposal</a> to create a decision-making checklist for meetup organizers. The proposal is aimed at locations that have more effectively contained COVID-19 (such as New Zealand and Taiwan, for instance) so that local meetup groups in these areas can organize safe, in-person events. According to the proposal, in-person meetup organizers should review local/global health instructions based on resources and complete a checklist — which recommends whether to organize an event or not based on the organizer’s inputs and other factors. Compulsory safety precautions should be taken for any in-person meetup, and participants/organizers can share event feedback with WordCamp Central. The proposal is still being discussed, so if you have any thoughts, please<a href=\"https://make.wordpress.org/community/2021/01/26/proposal-update-decision-making-checklist-for-safe-in-person-meetups/\"> share them in the comments</a>. <strong>Please note: WordPress meetups and WordCamps are still online at this time and will continue to remain online until further notice.</strong></p>\n\n\n\n<p>Want to get involved with the Community team? <a href=\"https://make.wordpress.org/community/\">Follow the Community blog</a>, or join them in the <a href=\"https://wordpress.slack.com/archives/C02RQC7RN\">#community-events</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>. To organize a local WordPress community event, <a href=\"https://make.wordpress.org/community/handbook/virtual-events/welcome/applying-for-a-virtual-event/\">visit the handbook page</a>.&nbsp;</p>\n\n\n\n<h2>Gutenberg 9.7 and 9.8</h2>\n\n\n\n<p>Contributor teams released Gutenberg <a href=\"https://make.wordpress.org/core/2021/01/07/whats-new-in-gutenberg-6-january/\">Version 9.7</a> on January 6th and <a href=\"https://make.wordpress.org/core/2021/01/20/whats-new-in-gutenberg-9-8-20-january/\">Version 9.8</a> on January 20th. Version 9.7 allows users to drag block patterns from the inserter right into a desired position within the editor. It also has a new block variations feature and several improvements to reusable blocks. Version 9.8 makes the spacer block semi-transparent, adds a variation icon to the block switcher, adds site editor content to an iframe, and stabilizes Full Site Editing (FSE) by removing the auto drafts feature. </p>\n\n\n\n<p>Want to get involved in building Gutenberg? Follow <a href=\"https://make.wordpress.org/core/\">the Core team blog</a>, contribute to <a href=\"https://github.com/WordPress/gutenberg/\">Gutenberg on GitHub</a>, and join the <a href=\"https://wordpress.slack.com/archives/C02QB2JS7\">#core-editor</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>. You can find out more about the Gutenberg roadmap in the latest <a href=\"https://make.wordpress.org/core/2021/02/01/whats-next-in-gutenberg-february-2021/\">What’s next in Gutenberg blog post</a>.</p>\n\n\n\n<h2>Inviting Learn WordPress Contributors</h2>\n\n\n\n<p>Contributor teams working on the <a href=\"https://learn.wordpress.org/\">Learn WordPress</a> initiative are asking for <a href=\"https://learn.wordpress.org/contribute/\">new workshop presenters and discussion group facilitators</a>. The Training Team is recruiting<a href=\"https://make.wordpress.org/training/2021/01/27/learn-wordpress-working-group-call-for-handbook-volunteers/\"> volunteers for the Learn WordPress handbook</a> and has put up a <a href=\"https://make.wordpress.org/training/2021/01/29/request-for-testing-slides-plugin/\">call for testing for the slides plugin</a> to identify a simplified way to present slides. The Polyglots Team has floated a proposal to <a href=\"https://make.wordpress.org/polyglots/2021/01/13/proposal-translating-learn-wordpress/\">translate Learn WordPress</a>. The Meta Team is exploring the possibility of <a href=\"https://make.wordpress.org/meta/2021/01/03/protecting-childrens-privacy-on-wordpress-through-the-lens-of-coppa/\">making Learn WordPress (and wordpress.org) COPPA-compliant</a> to host workshops aimed at kids. </p>\n\n\n\n<p>Want to contribute to the Training team? Follow the <a href=\"https://make.wordpress.org/training/\">Training team</a> blog, or join them in the <a href=\"https://wordpress.slack.com/archives/C02RW657Q\">#training</a> channel in the Make WordPress Slack.&nbsp;</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>Further Reading</h2>\n\n\n\n<ul><li><a href=\"https://make.wordpress.org/test/2020/12/23/fse-program-testing-call-1-template-editing/\">Round 1</a> of the Full Site Editing (FSE) outreach program <a href=\"https://make.wordpress.org/test/2021/01/15/fse-program-template-editing-testing-summary/\">has wrapped up</a>. As a result, gaps were identified in the Gutenberg 9.6 template-switching experience &#8211; you can follow the issues in GitHub. You can follow issues in GitHub and submit questions to the team. The program identified gaps in the current template-switching experience that shipped with Gutenberg 9.6. You can follow the <a href=\"https://github.com/WordPress/gutenberg/issues/27814\">issues reported in GitHub</a>. Do you have questions about the FSE program? You can now <a href=\"https://make.wordpress.org/test/2021/02/02/fse-program-bring-your-questions/\">submit them here as part of the outreach program</a>.</li><li><a href=\"https://wordpress.org/news/category/heropress/\">People of WordPress</a> — A cross-team initiative led by the Marketing team to highlight WordPress contributors is back with <a href=\"https://wordpress.org/news/2021/01/people-of-wordpress-thelma-mutete/\">a post featuring Thelma Muelte of Zimbabwe</a>. If you are an active contributor to a WordPress.org team or a local WordCamp, contact the Marketing Team with the #ContributorStory tag to be featured in the series.</li><li>Joseph Haden (<a href=\'https://profiles.wordpress.org/chanthaboune/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>chanthaboune</a>) launched a podcast titled <a href=\"https://wordpress.org/news/2021/02/welcome-to-your-wp-briefing/\">WP Briefing</a> which is aimed at WordPress users, builders, and contributors of all levels. The podcast &#8211; which is available on all major platforms, will include overviews of WordPress philosophy, community success stories, and major updates.&nbsp;</li><li>The Plugin team has added a requirement that <a href=\"https://make.wordpress.org/plugins/2021/01/26/reminder-plugins-must-not-interfere-with-updates/\">plugins in the WordPress repository must not make changes to the default auto-update settings on a site</a>. The only exception to this requirement is for those plugins that manage auto-updates.</li><li><a href=\"https://india.wordcamp.org/2021/\">WordCamp India 2021</a> — a regional online WordCamp has begun. It’s running over three weekends and started with <a href=\"https://india.wordcamp.org/2021/workshops/\">Multilingual workshop sessions on January 30 and 31</a>. The workshops <a href=\"https://india.wordcamp.org/2021/workshops/\">can be found on the event site</a> and will soon be featured on <a href=\"https://learn.wordpress.org/\">Learn WordPress</a>. <a href=\"https://india.wordcamp.org/2021/tickets/\">Tickets are still available</a> for the event —which will have a contribution event on February 6-7, followed by sessions on February 13th and 14th.&nbsp;</li><li>The WordPress Foundation has <a href=\"https://wordpressfoundation.org/2021/do_action-hackathons-and-open-source-workshops-in-2021/\">invited applications for online do_action hackathons and encouraged folks to organize online open-source workshops</a> in 2021.</li><li>The Themes Team shared a post on the usage of the “Report this theme” button in 2020. The team is also <a href=\"https://make.wordpress.org/themes/2021/01/25/call-for-maintainers-theme-unit-test/\">looking for maintainers</a> for its <a href=\"https://codex.wordpress.org/Theme_Unit_Test\">Theme unit test</a>.</li><li>The Meta Team has launched an initiative to <a href=\"https://make.wordpress.org/meta/2021/02/01/call-for-feedback-automated-theme-testing/\">facilitate automated theme testing</a> and is <a href=\"https://make.wordpress.org/meta/2021/02/01/call-for-feedback-automated-theme-testing/\">requesting feedback</a>.</li><li>Members of the Core Team are <a href=\"https://make.wordpress.org/core/2021/01/14/stale-issues-in-gutenberg-repository/\">considering a “stale bot”</a> to close out stale issues in the Gutenberg GitHub repository.</li></ul>\n\n\n\n<p><em>Have a story that we should include in the next “Month in WordPress” post? Please </em><a href=\"https://make.wordpress.org/community/month-in-wordpress-submissions/\"><em>submit it using this form</em></a><em>.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"9632\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:60:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"WordPress 5.7 Beta 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 02 Feb 2021 22:31:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9599\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:333:\"WordPress 5.7 Beta 1 is now available for testing! 🗣 This software is still in development,&#160;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with the new version. You can test the WordPress 5.7 Beta 1 in two ways: Install/activate the WordPress Beta Tester [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ebonie Butler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7908:\"\n<p>WordPress 5.7 Beta 1 is now available for testing! <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p><strong>This software is still in development,</strong>&nbsp;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with the new version.</p>\n\n\n\n<p>You can test the WordPress 5.7 Beta 1 in two ways:</p>\n\n\n\n<ul><li>Install/activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (select the&nbsp;<code>Bleeding edge</code>&nbsp;channel and the&nbsp;<code>Beta/RC Only</code> stream)</li><li>Direct download the beta version here (<a href=\"https://wordpress.org/wordpress-5.7-beta1.zip\">zip</a>).</li></ul>\n\n\n\n<p>The current target for final release is March 9, 2021. That’s just <strong>five weeks away</strong>, so your help is vital to making sure that the final release is as good as it can be.</p>\n\n\n\n<p>So what’s new? <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f914.png\" alt=\"🤔\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<h2><strong>Improvements in Core</strong></h2>\n\n\n\n<p><strong>Lazy-load iframes</strong><br>Now you can enable lazy-loading of iframes by adding the <code>loading=\"lazy\"</code> attribute to iframe tags on the front-end.&nbsp;</p>\n\n\n\n<p><strong>Migrating from HTTP to HTTPS is streamlined</strong><br>Switching a WordPress site from HTTP to HTTPS has proven to be a pain for all involved. While on the surface, the Site Address and WordPress Address have to be updated, content with embedded HTTP URLs remains unchanged in the database. With this release, migrating a site to HTTPS is now a one-click interaction. URLs in the database are automatically replaced when the Site and WordPress Address are both using HTTPS.&nbsp; Also, Site Health now includes an HTTPS status check.</p>\n\n\n\n<p><strong>Standardize colors used in WP-Admin CSS to a single palette</strong><br>This change collapses all colors used in the CSS to one of the available shades of blue, green, red, yellow, grey, black, and white. The palette makes it simpler than ever to build components your users can read, because half the range gives you great contrast with white type and a half with black, according to current accessibility guidelines.</p>\n\n\n\n<p><strong>Ongoing cleanup after update to jQuery 3.5.1</strong><br>jQuery deprecations in WordPress Core and bundled themes show up a lot less often, and the notifications make more sense to the user.</p>\n\n\n\n<p><strong>New Robots API</strong><br>The new Robots API allows the filter directives to be included in the ‘robots’ meta tag. Also, the directive <code>max-image-preview:large</code> is now included by default to allow large image previews to be displayed in search engines (unless the blog is marked as not being public).</p>\n\n\n\n<h2><strong>Improvements in the Editor</strong></h2>\n\n\n\n<ul><li>Inserter drag and drop: Blocks and block patterns can now be dragged directly from the inserter into the post canvas.</li><li>Full height alignment: Blocks such as the Cover block now can have an option to expand to fill the entire viewport.</li><li>Block variations: The icon and description of a block variation is now shown in the block inspector, and a new dropdown in the block inspector lets you switch between block variations.</li><li>Reusable blocks: Several enhancements to the usability and stability of reusable blocks have been made, and reusable blocks are now saved at the same time that the post is saved.</li><li>Buttons block: The Buttons block now supports vertical alignments, and you can set the width of a button to a preset percentage.</li><li>Social Icons block: You can now change the size of the icons in the Social Icons block.</li><li>Font size in more places: You can now change the font size in the List and Code blocks.</li><li>Many many other enhancements and bug fixes. To see all of the features for each release in detail check out the Gutenberg release posts: <a href=\"https://make.wordpress.org/core/2020/11/04/whats-new-in-gutenberg-4-november/\">9.3</a>, <a href=\"https://make.wordpress.org/core/2020/11/19/whats-new-in-gutenberg-18-november-2/\">9.4</a>, <a href=\"https://make.wordpress.org/core/2020/12/02/whats-new-in-gutenberg-2-december/\">9.5</a>, <a href=\"https://make.wordpress.org/core/2020/12/23/whats-new-in-gutenberg-23-december/\">9.6</a>, <a href=\"https://make.wordpress.org/core/2021/01/07/whats-new-in-gutenberg-6-january/\">9.7</a>, <a href=\"https://make.wordpress.org/core/2021/01/20/whats-new-in-gutenberg-9-8-20-january/\">9.8</a>, and <a href=\"https://make.wordpress.org/core/2021/02/05/whats-new-in-gutenberg-9-9-5-february/\">9.9</a>.</li></ul>\n\n\n\n<h2><strong>How You Can Help</strong></h2>\n\n\n\n<p>Watch the Make WordPress Core blog for 5.7-related developer notes in the coming weeks, which will break down these and other changes in greater detail.</p>\n\n\n\n<p>So far, contributors have fixed <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=..02%2F03%2F2021&amp;milestone=5.7&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">143 tickets in WordPress 5.7</a>, including <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;status=reopened&amp;changetime=..02%2F03%2F2021&amp;type=enhancement&amp;type=feature+request&amp;milestone=5.7&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=status&amp;col=milestone&amp;col=changetime&amp;col=owner&amp;col=priority&amp;col=keywords&amp;order=changetime\">68 new features and enhancements</a>, and more bug fixes are on the way.</p>\n\n\n\n<p><strong>Do some testing!</strong></p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/handbook/testing/beta-testing/\">Testing for bugs</a> is a vital part of polishing the release during the beta stage and a great way to contribute. <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>If you think you’ve found a bug, please post to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta</a> area in the support forums. We would love to hear from you! If you’re comfortable writing a reproducible bug report, file one on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. That’s also where you can find a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p><em>Props to <a href=\"https://profiles.wordpress.org/hellofromtonya/\">@hellofromtonya</a>, <a href=\"https://profiles.wordpress.org/sarahricker/\">@sarahricker</a>, <a href=\"https://profiles.wordpress.org/webcommsat/\">@webcommsat</a>, <a href=\"https://profiles.wordpress.org/marybaum/\">@marybaum</a>, <a href=\'https://profiles.wordpress.org/jeffpaul/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>jeffpaul</a>, and <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a> for your peer revisions and <a href=\'https://profiles.wordpress.org/desrosj/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>desrosj</a>, <a href=\'https://profiles.wordpress.org/davidbaumwald/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>davidbaumwald</a>, <a href=\'https://profiles.wordpress.org/cbringmann/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>cbringmann</a>, and <a href=\'https://profiles.wordpress.org/chanthaboune/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>chanthaboune</a> for final review on this exciting news.</em></p>\n\n\n\n<p>____________________________________</p>\n\n\n\n<p><em>New Year, new goals<br>Each day, one small step<br>It’s the little things&#8230;</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0