"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:175:\"https://wptavern.com/editor-plus-2-6-adds-block-pattern-and-template-library?utm_source=rss&utm_medium=rss&utm_campaign=editor-plus-2-6-adds-block-pattern-and-template-library\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6226:\"<p class=\"has-drop-cap\">A couple of weeks ago, Munir Kamal released version 2.6 of his <a href=\"https://wordpress.org/plugins/editorplus/\">Editor Plus</a> WordPress plugin. The latest version does not add a slew of features as its users have seen in the past. However, it introduces one major upgrade. The new version lets users insert templates from <a href=\"https://gutenberghub.com/\">Gutenberg Hub&rsquo;s</a> growing library directly from the block editor.</p>\n\n\n\n<p>I first asked Kamal whether he would include a template inserter in his plugin in July 2020. &ldquo;I will possibly include a direct inserter for templates and blocks in the Editor Plus plugin,&rdquo; he said at the time, not giving away too much.</p>\n\n\n\n<p>He had just launched <a href=\"https://wptavern.com/copy-and-paste-editor-blocks-via-gutenberghubs-block-library\">Gutenberg Hub&rsquo;s block library</a> (<em>really, something more akin to block patterns</em>). The system was useful but far from perfect. Users could copy a JSON code snippet and import it via Editor Plus. This was a slight improvement over copying separate block HTML and CSS snippets from an earlier iteration of a <a href=\"https://wptavern.com/gutenberg-hub-launches-collection-of-100-block-templates\">block template system</a> he had launched last March. It was still not an ideal system, but anyone paying attention could see the possibilities.</p>\n\n\n\n<p>Over the months since that launch, Kamal continued to build more tools into Editor Plus. He launched a separate <a href=\"https://wptavern.com/gutenberg-hub-launches-landing-page-templates-directory\">landing page template directory</a>. And, he continued adding more items to Gutenberg Hub&rsquo;s library.</p>\n\n\n\n<p>&ldquo;I am already working on adding a Template Inserter in my EditorPlus plugin,&rdquo; he said when we talked in September. &ldquo;It will allow users to browse and insert these templates directly from Gutenberg without leaving the website.&rdquo;</p>\n\n\n\n<p>I had already been hounding him for months, and he knew that I would ask. He was looking for feedback, not wanting to push something out before he felt that it worked.</p>\n\n\n\n<p>&ldquo;Earlier, I created a template inserter similar to other blocks plugins, but later I changed my mind and thought that I should integrate with the Gutenberg Patterns API and load the templates into the &lsquo;patterns&rsquo; panel in the block inserter,&rdquo; he said. &ldquo;But, I am having a few issues and thinking about going back to the original idea to have a Templates button on the top toolbar that opens a popup window to browse and filter templates that users can insert on a click.&rdquo;</p>\n\n\n\n<p>It was an almost methodical process toward building a massive body of work in a year. As is often the case with Kamal&rsquo;s work, he quietly pushed out version 2.6 of his plugin. Even without much fanfare, he has managed to surpass 4,000 active installs, doubling its number in the past few months.</p>\n\n\n\n<p>Now all of the plugin&rsquo;s users have direct access to Gutenberg Hub&rsquo;s section patterns and landing page templates.</p>\n\n\n\n<h2>The Template Library</h2>\n\n\n\n<p class=\"has-drop-cap\">Editor Plus 2.6 adds a new &ldquo;Library&rdquo; button to the block editor&rsquo;s post header toolbar. It pops up a simple overlay of the plugin&rsquo;s layout choices.</p>\n\n\n\n<p>Users can insert a &ldquo;Pattern&rdquo; or a &ldquo;Template,&rdquo; as they are called through the plugin&rsquo;s UI. Patterns are pre-designed sections that end-users can use to piece together larger page layouts. Templates are full-blown page designs, ready for deployment after content customization. Many of the patterns are present in the templates. It all comes down to how users want to build their pages &mdash; piecemeal vs. having everything in place.</p>\n\n\n\n<img />Modal showing block templates.\n\n\n\n<p>Of course, everything is editable. Users can insert a template then proceed to removing the bits they do not need and adding custom blocks of their choosing.</p>\n\n\n\n<p>The overlay that appears after clicking the Library button allows users to select a pattern or template. This method is becoming increasingly common among block-related plugins. Where the Gutenberg project has <a href=\"https://wptavern.com/proposal-to-create-an-expanded-view-or-overlay-for-the-block-patterns-inserter\">fallen behind in its patterns UI</a>, plugin authors are filling the gaps and creating better user experiences. Genesis Blocks, for example, adds a similar <a href=\"https://wptavern.com/genesis-block-theme-beta-studiopress-pursuing-a-block-first-future\">overlay for choosing layouts</a>. Patterns, templates, layouts, or whatever-you-want-to-call-them all need room to breathe instead of being relegated to a width-restrained flyout. What makes sense on mobile does not always create an ideal experience on larger screens.</p>\n\n\n\n<img />Viewing a photography template.\n\n\n\n<p>Once a user finds a pattern or template to insert, they can click on it to view a larger version. If they are satisfied, they merely need to click the &ldquo;Add&rdquo; button to insert it into the content canvas.</p>\n\n\n\n<p>An important caveat is that what you see in the library is not <em>exactly</em> what you will get. The library uses screenshots to showcase the patterns and templates. These images are created while using a different theme than what a particular user has installed on their site. Things like fonts will match whatever theme is installed. Generally speaking, the overall designs should match up fine.</p>\n\n\n\n<p>In the future, perhaps Editor Plus will handle the pattern and template previews with live instances instead of screenshots.</p>\n\n\n\n<img />Cafe-type full landing template.\n\n\n\n<p>The plugin breaks its library down into 15 categories, such as Arts &amp; Entertainment, Photography, and Real Estate. It is almost a bit excessive. Some contain only one or two templates. Combining categories like Home Services, Professional Services, and Retail into an all-encompassing Business group could help curb the dizzying effects of <em>too much choice</em>.</p>\n\n\n\n<p>The new library in Editor Plus 2.6 is a welcome addition. Overall, it worked well in testing.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 01 Mar 2021 21:35:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Elementor Raises Eyebrows with Google Ads Targeting Full-Site Editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112932\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:203:\"https://wptavern.com/elementor-raises-eyebrows-with-google-ads-targeting-full-site-editing?utm_source=rss&utm_medium=rss&utm_campaign=elementor-raises-eyebrows-with-google-ads-targeting-full-site-editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6143:\"<p>WordPress&rsquo; <a href=\"https://wptavern.com/wordpress-passes-40-market-share-of-alexa-top-10-million-websites\">growing market share</a> is fueling a continual influx of new users but also a higher level of scrutiny around advertising. Companies with large advertising budgets target this segment of consumers, because many who are new to WordPress need help hosting and creating their websites.</p>\n\n\n\n<p>Last week Bluehost pulled an advertisement that <a href=\"https://wptavern.com/bluehost-misuses-wordpress-trademark-reigniting-controversy-over-recommended-hosts-page\">misused WordPress&rsquo; trademark</a>. The company&rsquo;s PR department has not responded to our request for comment, but onlookers have noted that this isn&rsquo;t the first time Bluehost has floated questionable ads. <a href=\"https://www.facebook.com/ads/library/?active_status=all&ad_type=all&country=ALL&view_all_page_id=235969756424648&sort_data%5Bdirection%5D=desc&sort_data%5Bmode%5D=relevancy_monthly_grouped\">Multiple Facebook campaigns</a>, dating back several years, include trademark abuses, as well as <a href=\"https://www.youtube.com/channel/UCURv2b4zbEiwN626-T321HQ\">active campaigns</a> on YouTube in various markets. </p>\n\n\n\n<p>In another advertising-related matter, <a href=\"https://wordpress.org/plugins/elementor/\">Elementor</a>, a popular page builder used by more than five million websites, has caught some attention recently for its Google ads that target &ldquo;full-site editing.&rdquo; Birgit Pauli-Haack, publisher of the <a href=\"https://gutenbergtimes.com/\">Gutenberg Times</a>, pointed out the ads last week in the <a href=\"https://poststatus.com/\">Post Status</a> Slack community. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>&ldquo;I have no trouble if Elementor and Beaver Builder duke it out on the Google Ads,&rdquo; Pauli-Haack said. &ldquo;It&rsquo;s certainly fair game. Why I think it&rsquo;s shady in regards to WordPress? It&rsquo;s the searcher&rsquo;s intent diverted, in a misleading way. <a href=\"https://www.wordstream.com/blog/ws/2012/07/17/google-advertising#SEO%20vs%20PPC\">30% of Google Searchers</a> do not know that the first results are paid ads and are led astray. Information about Full Site Editing has people already confused and worried. It doesn&rsquo;t help if someone hijacks the new feature&rsquo;s keyword. WordPress is also an easy target because the Foundation certainly doesn&rsquo;t have any money to throw at the problem to bid higher on the keywords.&rdquo;</p>\n\n\n\n<p>At first glance the keyword targeting may appear to skirt the line of ethical advertising, but Elementor representative Ben Pines claims the company is simply advertising for <a href=\"https://elementor.com/help/full-site-editing/\">a feature set of the same name</a>. It enables customers to edit the header, footer, archive and single templates, and page or post content on the same screen.</p>\n\n\n\n<p>&ldquo;Our google ads vary to provide the most value for users in the search,&rdquo; Pines said. &ldquo;This one is no different. This doesn&rsquo;t represent any new strategy. We released full site editing back in March 2020.&rdquo;</p>\n\n\n\n<p>Pines referenced a <a href=\"https://github.com/elementor/elementor/issues/10718\">beta release post</a> dated March 1, 2020, which referred to Elementor&rsquo;s &ldquo;groundbreaking&nbsp;Full Site Editing&nbsp;feature.&rdquo; WordPress&rsquo; Full-Site Editing project predates this release by at least a year. </p>\n\n\n\n<p>&ldquo;Full site editing is a very generic industry name and is a fundamental capability in website building tools, searched by many of our users,&rdquo; Pines said.</p>\n\n\n\n<p>When asked if Elementor is considering changing the name to avoid confusion with the core WordPress project, Pines said, &ldquo;We don&rsquo;t see any potential confusion. Elementor&rsquo;s capabilities and ads are clear.&rdquo;</p>\n\n\n\n<p>Others involved in the conversation on Post Status Slack said this type of advertising seems to be standard practice in the world of ad buying, since they are buying based on relevant keywords. Competitors also routinely purchase each other&rsquo;s keywords. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>&ldquo;Instead of supporting, it is undermining the project,&rdquo; Pauli-Haack said. </p>\n\n\n\n<p>She and other participants in the conversation about the ads found it hard to believe that the strategy is not intentional. Some were also irked by <a href=\"https://www.facebook.com/ads/library/?active_status=all&ad_type=political_and_issue_ads&country=US&id=471775237521825&view_all_page_id=1595730204071266\">other Elementor ads</a> running on Google and Facebook that attempt to capitalize on users&rsquo; frustration with WordPress.</p>\n\n\n\n<p>Elementor&rsquo;s advertising appears to be a self-preservation strategy, as Gutenberg&rsquo;s full site editing capabilities will inevitably ring the death knell for page builders that don&rsquo;t build on top of the core standard. Third-party page builders will need to overcome severe <a href=\"https://wptavern.com/gutenbergs-faster-performance-is-eroding-page-builders-dominance\">performance deficiencies</a> in order to remain competitive.</p>\n\n\n\n<p>Understanding where full-site editing is heading is critical for WordPress site owners who are adopting new tools and workflows that will be future-proof with core changes. During this transition many will likely be googling for solutions that will enable them to be on the ground running when core introduces its full-site editing MVP in WordPress 5.8.</p>\n\n\n\n<p>Participants in the conversation noted that the Elementor team is not very involved in contributing to the open source project. This may be why the team claims they cannot see any confusion in targeting Google ads at users searching &ldquo;full-site editing.&rdquo;  </p>\n\n\n\n<p>&ldquo;We actively contribute to WP and its ecosystem through sponsoring events, translations, accessibility tools and more,&rdquo; Pines said. &ldquo;We are looking to further our contribution even more this year and are on the look out for a dedicated team member.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 01 Mar 2021 21:06:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WPTavern: Chrome is Testing a Follow Button for Websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112943\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:157:\"https://wptavern.com/chrome-is-testing-a-follow-button-for-websites?utm_source=rss&utm_medium=rss&utm_campaign=chrome-is-testing-a-follow-button-for-websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2322:\"<p><a href=\"https://www.google.com/chrome/canary/\">Chrome Canary</a>, the browser&rsquo;s nightly build for developers, has been testing a new Follow button, as spotted on Android by the publishers of <a href=\"https://www.chromestory.com/2021/02/chrome-follow-button/\"><em>Chrome Story</em></a>. The button appears on the homepage of a site, as well as in the browser menu:</p>\n\n\n\n<ul><li class=\"blocks-gallery-item\"><img /></li><li class=\"blocks-gallery-item\"><img /></li></ul>\n\n\n\n<p>Chrome Story speculates that it may be integrated with Google&rsquo;s Discover feature, allowing sites to be easily added to that feed. Others speculated more broadly that Google may be building a replacement for Google Reader.</p>\n\n\n\n<p>Any whisper of Google Reader being resurrected always causes a bit of a stir, as many loyal users are still in mourning for the beloved RSS reader, which was discontinued in 2013. Linking this new Follow feature with Discover may be the closest Google gets to bringing it back. A full-featured RSS reader will likely still be a better option to have full control of your feeds and how they display. However, it may be possible for developers to build tools that fetch and aggregate feeds captured by the Follow button.</p>\n\n\n\n<p>Before the explosion of social media sites, RSS buttons were prominently featured on WordPress blogs. Having the ability to follow a site for new updates, without having to check back manually, was an important feature if you wanted to be found in the nascent blogosphere. RSS is still alive and well, even if following a curated list of sites isn&rsquo;t the primary way people get their news today. Many internet users don&rsquo;t know the first thing about subscribing to feeds but Google&rsquo;s new Follow feature might make the idea more approachable.</p>\n\n\n\n<p>Canary is unstable, but if want to check out features on the bleeding edge of Chrome development, you can install <a href=\"https://play.google.com/store/apps/details?id=com.chrome.canary&hl=en_GB&gl=US\">Canary for Android</a> alongside your regular browser and choose when you launch it. At the time of publishing, the Follow button was not in the latest build but Google sometimes puts features in and pulls them out while they are in development. We will be following to see how this takes shape.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 27 Feb 2021 02:40:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: Ask the Bartender: What Happens When Block Markup Changes?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112921\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:177:\"https://wptavern.com/ask-the-bartender-what-happens-when-block-markup-changes?utm_source=rss&utm_medium=rss&utm_campaign=ask-the-bartender-what-happens-when-block-markup-changes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6837:\"<blockquote class=\"wp-block-quote\"><p>I&rsquo;m a developer that has started developing with Gutenberg recently. There are a bunch of amazing benefits and features, but there are also a ton of drawbacks, inconsistencies, as well as absolutely awful and outdated documentation.</p><p>One of the worst aspects of Gutenberg from a developer perspective has been block validation. Consider the following scenario. I build a custom (non-dynamic) JavaScript-based block, and a CMS editor adds the block to thousands of pages. What happens when or if I need to update the markup of the block?</p><p>By default, all of the blocks will enter a state of invalidation and not reflect on the front-end of the site. The CMS editor would have to go into thousands of pages and manually click the button which allows the block to be recovered.</p><p>Block deprecations have been suggested as a way to resolve this, but the API is poorly documented, confusing, and seems like it would become unmaintainable in the long term with more than a few deprecations.</p><p>Shouldn&rsquo;t there either be a way for block developers to opt-out of the validation process or a global way to recover blocks?</p><cite>PJ</cite></blockquote>\n\n\n\n<p>You are certainly not holding anything back, PJ. While much of this is a bit more technical than I typically like to cover here at the Tavern, I decided to reach out to Riad Benguella, one of the lead Gutenberg developers, for more insight into the situation.</p>\n\n\n\n<p>Before diving into his response, I have given one aspect of your question some thought. There are times when developers need to deprecate old markup and move onto something new. However, this should not happen often. Generally, it is a sign of poor architecture if the HTML needs to be overhauled regularly. This also leads to other issues, such as a third party not being able to maintain stylistic changes.</p>\n\n\n\n<p>When developing blocks or any type of application that outputs front-end code, you need to think about what that should look like today and in 10 years. What happens if a user adds some custom CSS to style your block and the block&rsquo;s HTML structure has changed? From their perspective, your block update has broken their site. The same could be said for another plugin that extends your plugin in some way.</p>\n\n\n\n<p>Ask any theme author how frustrating it is any time Gutenberg/WordPress changes its block output. While it has improved in the last couple of years, styling blocks for the editor and front-end has often been a maintenance nightmare.</p>\n\n\n\n<p>As a developer, I have always tried to think through any real-world consequences of making these changes from a user&rsquo;s perspective. That should happen from Day #1, not after you have released your project.</p>\n\n\n\n<p>Doing this adds time to the early project when you are just trying to get it out the door and into users&rsquo; hands. This is where taking a pre-release step back helps. Get away from the computer. Go on a walk. Think about the architecture of your project and whether it is ideal for the long term.</p>\n\n\n\n<p>&ldquo;For the block versioning/updates, it&rsquo;s indeed one of the areas of the Gutenberg APIs where we needed to make architectural tradeoffs, and we decided to favor the user experience over the developer&rsquo;s,&rdquo; said Benguella.</p>\n\n\n\n<p>Regardless of your development method, following the project&rsquo;s approach of a user-first experience will help in the long term.</p>\n\n\n\n<p>&ldquo;To understand the problem properly, one needs to understand how blocks work and are edited,&rdquo; said Benguella. &ldquo;Block instances are a JSON object, and the editor UI manipulate that JSON, but in order to stay backward compatible, to ensure the preservation of user&rsquo;s content in the most readable format, and to embrace web standards as much as possible, the block editor doesn&rsquo;t store the JSON object but an HTML serialization of it in <code>post_content</code>.&rdquo;</p>\n\n\n\n<p>That serialization is parsed and converted to JSON when the editor reloads the content to edit again. In the final stages of parsing, it is up to the block author to decide how to save and parse the object.</p>\n\n\n\n<p>&ldquo;Now, imagine if a user altered the saved HTML (serialization) and just put any random content there,&rdquo; said Benguella. &ldquo;The block might not be able to parse the HTML properly because it doesn&rsquo;t match its expectations (what has been defined by the block author), which means recreating that JSON object in order to be manipulated won&rsquo;t be possible at this point.&rdquo;</p>\n\n\n\n<p>When this happens, the block editor provides the user with an interface to make an informed decision. They can attempt to &ldquo;force parse&rdquo; the block JSON or convert it to an HTML or Classic block.</p>\n\n\n\n<img />Invalid block after altering the markup.\n\n\n\n<p>This same type of invalidation can happen when a plugin developer updates their block. However, instead of the saved HTML changing, the developer changed the &ldquo;expectations&rdquo; of the block &mdash; altering how it gets saved and parsed.</p>\n\n\n\n<p>&ldquo;Which is why we ask block developers to provide block deprecations representing the old markup of the same block,&rdquo; said Benguella. &ldquo;Deprecations can also be thought of as valid, alternate sources for the same block. This allows the editor to parse the old markup when loaded and save the new markup back if an update is made to the block.&rdquo;</p>\n\n\n\n<p>WordPress has <a href=\"https://developer.wordpress.org/block-editor/developers/block-api/block-deprecation/\">block deprecation documentation</a>. However, it is not thorough. The best source of seeing real-world deprecations is looking through Gutenberg&rsquo;s <a href=\"https://github.com/WordPress/gutenberg/tree/HEAD/packages/block-library/src\">block library</a>. Deprecated blocks have a <code>deprecated.js</code> file.</p>\n\n\n\n<p>Benguella said that this system can be frustrating for block authors. This is especially evident in a development environment when making changes. This has lead developers to ask for a method of disabling the validation algorithm.</p>\n\n\n\n<p>&ldquo;It&rsquo;s something we don&rsquo;t want to provide at the moment because, as explained above, the validation is also important when markup changes for another reason (external edit, another editor, etc.),&rdquo; he said. &ldquo;So it may cause content loss for users without them being aware of anything. The preference right now is given to user awareness.&rdquo;</p>\n\n\n\n<p>The team has improved the validation system over time, allowing for small changes that do not break the block state. There is also an <a href=\"https://github.com/WordPress/gutenberg/issues/21703\">open ticket for improvements</a> in the future.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 26 Feb 2021 16:53:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: The Gutenberg WordPress Plugin To Introduce a Table of Contents Block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112826\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:203:\"https://wptavern.com/the-gutenberg-wordpress-plugin-to-introduce-a-table-of-contents-block?utm_source=rss&utm_medium=rss&utm_campaign=the-gutenberg-wordpress-plugin-to-introduce-a-table-of-contents-block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4589:\"<p class=\"has-drop-cap\">What was once likely viewed as plugin territory is now a reality as part of the Gutenberg project. Yesterday, the team <a href=\"https://github.com/WordPress/gutenberg/pull/21234\">merged a pull request for a Table of Contents</a> (TOC) block into the plugin&rsquo;s codebase. It was a contribution driven by developer Zebulan Stanphill, starting nearly a year ago.</p>\n\n\n\n<p>The TOC block may feel a bit niche. However, there is obviously a need for it. There are at least two standalone block plugins to handle the feature, and several block library plugins cover it. Last week, a <a href=\"https://wptavern.com/ask-the-bartender-frustrations-and-finding-the-right-wordpress-block-plugins\">reader asked about such a solution</a>. Soon, the Gutenberg plugin and, eventually, WordPress will have him and others covered.</p>\n\n\n\n<p>The block is not currently available in the plugin on WordPress.org. It has not officially shipped yet. To test it, users will either need to clone the <a href=\"https://github.com/WordPress/gutenberg\">Gutenberg GitHub repository</a> or grab a ZIP file of the <a href=\"https://gutenbergtimes.com/need-a-zip-from-master/\">nightly beta</a>. It should land in Gutenberg 10.1 in the coming weeks for those who want to wait.</p>\n\n\n\n<p>Including these more-niche blocks is a good direction for the project &mdash; a <a href=\"https://github.com/WordPress/gutenberg/pull/28261\">Footnotes block</a> is also a possibility. While it can feel like stepping on the toes of plugin developers, WordPress needs to branch out. There is plenty of room for third-party devs to build other blocks. The experience is degraded when users have to sift through multitudes of plugins to find something core to their writing process. There are limits on what blocks should ultimately be included in the platform. However, WordPress is publishing software. Advanced writing features, such as TOCs and footnotes, belong firmly in the default setup.</p>\n\n\n\n<h2>The Table of Contents Block</h2>\n\n\n\n<p class=\"has-drop-cap\">This block is a bit different than other blocks users are accustomed to. A TOC is a list of all the headings in a document. In the case of WordPress and webpages in general, a TOC links to those headings. This allows users to jump around the page. The block depends on other blocks in the content, a slightly new concept for the block editor.</p>\n\n\n\n<p>When first adding the block to an empty page, it will display a helper message.</p>\n\n\n\n<img />Initial TOC block when no Heading blocks are present.\n\n\n\n<p>Users must begin adding Heading blocks in their post to make use of the TOC block. Once they are added, each Heading is shown as a list item. The block also properly nests list items for sub-headings &mdash; an H3 goes into a sub-list under an H2, for example.</p>\n\n\n\n<img />Headings become list items in the TOC block.\n\n\n\n<p>This is the moment things become more complex. On the web, a TOC needs to link to those headings so that readers can jump to the section they want to view. Right now, this does not happen automatically. Perhaps it will do so in the future, but users must manually add HTML anchors to make the linking part work. <em>Ideally, the initial helper message would link to the <a href=\"https://wordpress.org/support/article/page-jumps/\">documentation page</a> on how to do this for new users.</em></p>\n\n\n\n<p>Adding HTML anchors is easy. However, it could be a ton of work for long posts with dozens of headings.</p>\n\n\n\n<p>To add the anchor, users must click on each Heading and navigate to the block options panel. Under the Advanced tab, enter a unique ID. It is easiest to name this after the text itself. A Heading block with &ldquo;A New World&rdquo; gets an anchor of <code>a-new-world</code>. This also helps when others are deep linking into posts, creating prettier URLs, such as <code>yoursite.com/blog/post-name/#a-new-world</code>.</p>\n\n\n\n<img />Adding anchors to Heading blocks.\n\n\n\n<p>The TOC block does not have any design settings. If users need to change the colors or other design-related elements, it is best to wrap it inside another block, such as Group or Cover.</p>\n\n\n\n<img />Wrapping the TOC into a Group block.\n\n\n\n<p>If adding a heading for the Group block or before the TOC block, it will be added to the list. It is best to use the Paragraph block as a <em>faux</em> heading and change the font size.</p>\n\n\n\n<p>Overall, the block works well. Except for the manual insertion of anchors, it is a welcome addition. Perhaps a plugin author will come along and write the code to make it automatic.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 25 Feb 2021 21:49:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"WPTavern: Bluehost Misuses WordPress Trademark, Reigniting Controversy Over Recommended Hosts Page\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112479\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:239:\"https://wptavern.com/bluehost-misuses-wordpress-trademark-reigniting-controversy-over-recommended-hosts-page?utm_source=rss&utm_medium=rss&utm_campaign=bluehost-misuses-wordpress-trademark-reigniting-controversy-over-recommended-hosts-page\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12680:\"<p><a href=\"https://www.bluehost.com/\">Bluehost</a> was called out this week for misusing WordPress&rsquo; trademark, as the WordPress Foundation prohibits its use in advertising. The company has been featured on <a href=\"https://wordpress.org/hosting/\">WordPress&rsquo; recommended hosting</a> page for the past 16 years, as one of a handful of hosts that have been arbitrarily selected based on an incomplete list of criteria.</p>\n\n\n\n<p>The wording of the ad in this instance,<em> &ldquo;There is a reason WordPress officially recommends Bluehost more than any other hosting service,&rdquo;</em> was a visceral reminder to the hosting community of being excluded from the benefits that listing confers. </p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">\"We do not allow the use of the trademark in advertising, including AdSense/AdWords.\"<br />&ndash; <a href=\"https://twitter.com/hashtag/WordPress?src=hash&ref_src=twsrc%5Etfw\">#WordPress</a> Foundation Trademark Policy <a href=\"https://t.co/0pO0z6uAdp\">https://t.co/0pO0z6uAdp</a> <a href=\"https://t.co/NTNShWI2yg\">pic.twitter.com/NTNShWI2yg</a></p>&mdash; Morten Wears a Mask (@mor10) <a href=\"https://twitter.com/mor10/status/1363967590733729793?ref_src=twsrc%5Etfw\">February 22, 2021</a></blockquote>\n</div>\n\n\n\n<p>In response to the issue, WordPress&rsquo; Executive Director, Josepha Haden Chomphosy <a href=\"https://twitter.com/JosephaHaden/status/1364308731991781376\">scheduled a call</a> with Bluehost to find a resolution. She provided the following statement after the call:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>This was flagged to me on Twitter, and I immediately reached out to learn more. Bluehost removed the ad proactively, and they scheduled a call with me and a representative of Automattic&nbsp;to understand the concerns being raised. As Matt <a href=\"https://robertjacobi.com/wordpress-org-hosting-and-trademark-rumors-answered.html\">mentioned</a>, commercial use of the WordPress trademark is permitted, and Automattic can sub-license that use.</p></blockquote>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>From a WordPress project standpoint, Bluehost was swift to respond to this issue, and took immediate steps to better understand how the trademark and logo are allowed to be used. When mistakes like this happen, we ask companies to keep us informed about how the issue is resolved, and Bluehost has agreed to do that.</p></blockquote>\n\n\n\n<p>Bluehost has not yet responded to our request for comment.</p>\n\n\n\n<p>In the meantime, the incident reignited the controversy that has plagued <a href=\"https://wordpress.org/hosting/\">WordPress&rsquo; recommended hosting page</a> for years. Continuing the conversation that started on Twitter, members of the <a href=\"https://poststatus.com/\">Post Status</a> community pressed for more clarification in the club&rsquo;s #hosting channel.</p>\n\n\n\n<p>In response to claims that inclusion on the page is a closed process, and that the selected hosts haven&rsquo;t changed in three years, Matt Mullenweg offered what is perhaps the most forthcoming response the community has seen on this topic: </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>When the list is open, anyone can apply. I take 100% responsibility for the editorial, though in the past and future will have people help with testing hosts, and collating all the threads in the forums. I also get a fair number of people emailing me directly feedback about the hosts listed, and how the host follows up is part of my evaluation.</p><p>It&rsquo;s true the list of hosts hasn&rsquo;t been changed in a while. The current list is all in good standing. I stand by the long-term behavior and service of every company linked on that page. It is past-due for open applications again, but I have prioritized other work on .org.</p><p>No one can pay to be on the page, and there are no affiliate payments made for customers sent from that page. It&rsquo;s free, opinionated, and editorially driven. I do believe it drives many millions of year in business, which is why the potential for things like bribery or conflict is high if it were open to a larger group deciding who&rsquo;s on there.</p></blockquote>\n\n\n\n<p>The hosting recommendations page exists to reduce barriers for new users looking to get started with WordPress without having to shop around among thousands of hosts. WordPress.org is not transparent about who makes the decisions regarding recommended hosts or what criteria is used. Because it benefits a select few very large companies who have dominated the recommendations for years with few changes, rumors abound. </p>\n\n\n\n<p>Mullenweg&rsquo;s response confirms that currently there is no &ldquo;pay-to-play&rdquo; type of arrangement, but he did not say if this has always been the case. In the beginning, this page was called &ldquo;<a href=\"https://web.archive.org/web/20050410080902/http://wordpress.org/hosting/\">WordPress Hosting Partners</a>&rdquo; and included the following text: <em>&ldquo;Signing up through this page will help us finance WordPress.org&rsquo;s operations through partner deals.</em>&rdquo; That wording was changed in April 2005 to remove the reference to partners. However, previous versions of the page from years ago include what appear to be tracking or affiliate links for the hosts listed. For example, <a href=\"https://web.archive.org/web/20070807011316/http://wordpress.org/hosting/\">a version of the page from 2007</a> includes the following links:   </p>\n\n\n\n<ul><li><a href=\"https://web.archive.org/web/20070807011316/http://www.bluehost.com/track/wp/one\">http://www.bluehost.com/track/wp/one</a></li><li><a href=\"https://web.archive.org/web/20070807011316/http://www.anhosting.com/wordPress.aff.redirect.trk\">http://www.anhosting.com/wordPress.aff.redirect.trk</a></li><li><a href=\"https://web.archive.org/web/20070807011316/http://secure.hostican.com/cgi-bin/affiliates/clickthru.cgi?id=wordpress&campaign=three\">http://secure.hostican.com/cgi-bin/affiliates/clickthru.cgi?id=wordpress&amp;campaign=three</a></li><li><a href=\"https://web.archive.org/web/20070807011316/http://www.dreamhost.com/r.cgi?automattic\">http://www.dreamhost.com/r.cgi?automattic</a></li></ul>\n\n\n\n<p>According to the Internet Archive, 2009 was the last year that tracking ID&rsquo;s were appended to the links on the recommended hosts page. A few <a href=\"https://web.archive.org/web/20090701093034/http://wordpress.org/hosting/\">examples from that year</a> include:</p>\n\n\n\n<ul><li><a href=\"https://web.archive.org/web/20090701093034/http://www.dreamhost.com/r.cgi?automattic\">http://www.dreamhost.com/r.cgi?automattic</a></li><li><a href=\"https://web.archive.org/web/20090701093034/http://mediatemple.net/go/ref/?affkey=YWZmaWxpYXRlPTIyUDNkSVFPeXU\">http://mediatemple.net/go/ref/?affkey=YWZmaWxpYXRlPTIyUDNkSVFPeXU</a></li><li><a href=\"https://www.godaddy.com/hosting/wordpress-hosting.aspx?isc=wordpress2\">https://www.godaddy.com/hosting/wordpress-hosting.aspx?isc=wordpress2</a></li></ul>\n\n\n\n<p>The copy on the page hasn&rsquo;t changed much over recent years. It currently gives the following criteria to be listed but it doesn&rsquo;t specify why only three companies meet these standards:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>We&rsquo;ll be looking at this list several times a year, so keep an eye out for us re-opening the survey for hosts to submit themselves for inclusion. Listing is completely arbitrary, but includes criteria like: contributions to WordPress.org, size of customer base, ease of WP auto-install and auto-upgrades, avoiding GPL violations, design, tone, historical perception, using the correct logo, capitalizing WordPress correctly, not blaming us if you have a security issue, and up-to-date system software. </p></blockquote>\n\n\n\n<p>With such a diverse hosting ecosystem supporting WordPress users around the world, it&rsquo;s difficult to understand why there aren&rsquo;t more companies included among these listings. The era when tracking links were included on this page was a different time before many things were formalized, but the community could stand to receive a transparent history of this page.  </p>\n\n\n\n<p>&ldquo;To my knowledge, no one has ever paid to be on that page, and certainly no one has ever approached me about doing so,&rdquo; Josepha Haden Chomphosy said when asked about the process for getting listed.</p>\n\n\n\n<p>Thousands of volunteer contributors are continually building and improving this software. It&rsquo;s only natural that the community is curious about who is benefiting from the project&rsquo;s hosting recommendations and the nature of those arrangements. Mullenweg estimates the impact of that page as &ldquo;many millions per year in business,&rdquo; but the process surrounding the selection of hosts is closed and not clearly outlined.</p>\n\n\n\n<p>Following the incident with Bluehost, Mullenweg briefly elaborated on why Bluehost retains its position on the page despite some people reporting poor service:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Regarding Bluehost or other large hosts, there is an aspect of&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://plato.stanford.edu/entries/utilitarianism-history/\">WordPress Utilitarianism</a>, any business will have some unhappy people, but a small % gets to a high absolute number at scale. I try to look at hosts that are doing the most good for the most number of people. Will definitely keep an eye on if anything with their approach to WP customers post-merger, but they also have a lot of good karma built up over a very long period of time. Bluehost, for example, does the best job I&rsquo;m aware of in keeping the largest number of WPs on the latest version, and deploying updates incredibly fast. (If another host does more, please let me know! GD I think has more sites, but fewer on latest version.)</p></blockquote>\n\n\n\n<p>Another point of contention that regularly pops up is Automattic&rsquo;s exclusive commercial license for using the WordPress trademark. Mullenweg clarified why the company is in possession of this exclusive right after <a href=\"https://ma.tt/2010/09/wordpress-trademark/\">Automattic donated it to the foundation</a>. He confirmed that Bluehost was not given permission to run the ad with the trademark:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>A common misunderstanding is that there is no commercial use of the WordPress trademark allowed. As some know, the trademark was originally held by Automattic, which donated it to the Foundation, and in return got an exclusive commercial license back. That commercial use can be sub-licensed by Automattic, and has been in the past. The ad that is bugging everyone was not approved, as far as I&rsquo;m aware, and that will resolve once everyone has had a chance to talk to each other. Automattic can lose its commercial license to the trademark if it is not a good steward. This license is a bit of an accident of history, but also an entirely fair criticism of Automattic having a special privilege to commercial use of the WordPress trademark (because it&rsquo;s true, vs most of what the company gets accused of). This&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://ma.tt/2010/09/wordpress-trademark/#comment-485223\">happened in 2010</a>, and the growth of WP and the WP ecosystem has been incredibly strong since then so I think the idea of a for-profit and non-profit complementing each other has proven successful, and I think better than either would have done on their own. </p></blockquote>\n\n\n\n<p>Mullenweg seems to recognize the friction that trademark matters can create in the community and said that he would change the naming of WordPress.com if he could go back in time.</p>\n\n\n\n<p>&ldquo;If I could wave a magic wand and go back to 2004, though, it would be nice if .com and .org had distinct names &lsquo;before the dot,&rsquo; as it can be a source of confusion,&rdquo; he said.</p>\n\n\n\n<p>These things can certainly be changed in the present but not without a severe blow to the benefits of Automattic&rsquo;s special privilege of commercial use. It would also impact the company&rsquo;s millions of users who call WordPress.com their home on the web. </p>\n\n\n\n<p>In the interest of eliminating some of the confusion regarding conflicts of interest and commercial use of the trademark, a continual movement towards transparency will be required. WordPress.org&rsquo;s recommended hosts page is overdue for an update. Ideally, this page will provide clear guidelines about the process and criteria for inclusion before opening up applications again. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 25 Feb 2021 04:06:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: Build a Full WordPress Site via Block Patterns With the Hansen Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112498\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:201:\"https://wptavern.com/build-a-full-wordpress-site-via-block-patterns-with-the-hansen-theme?utm_source=rss&utm_medium=rss&utm_campaign=build-a-full-wordpress-site-via-block-patterns-with-the-hansen-theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5538:\"<img />\n\n\n\n<p class=\"has-drop-cap\">Earlier today, the WordPress theme directory welcomed its fourth block-based theme. Built by UXL Themes, <a href=\"https://wordpress.org/themes/hansen/\">Hansen</a> is one of the more stylish projects capable of working with the site editor in the Gutenberg plugin. The theme author also stepped it up a notch and included several block patterns.</p>\n\n\n\n<p>I have written about how <a href=\"https://wptavern.com/gutenberg-7-7-ships-refreshed-ui-and-first-iteration-of-block-patterns\">patterns will be a game-changer</a>. I have talked about the need for a <a href=\"https://wptavern.com/proposal-to-create-an-expanded-view-or-overlay-for-the-block-patterns-inserter\">UI overhaul</a> to better expose them to users. And I have proposed that theme authors use the <a href=\"https://wptavern.com/armando-wordpress-theme-provides-insight-into-the-current-state-of-full-site-editing\">pattern system instead of templates</a>, allowing users to build out full sections of their sites at the click of a button.</p>\n\n\n\n<p>UXL Themes has done just that. Most patterns that we have seen thus far have been built primarily for post or page content. The Hansen theme takes that idea a step further and creates patterns for different site sections.</p>\n\n\n\n<p><em>Want to try a different look for the header?</em> Just remove the old one and swap in another header pattern.</p>\n\n\n\n<img />Inserting the dark header pattern.\n\n\n\n<p><em>How about changing the look of your blog posts page?</em> The theme comes with two and three-column patterns for outputting the latest posts.</p>\n\n\n\n<img />Inserting a two-column blog posts pattern.\n\n\n\n<p>It also packages a Content and Sidebar pattern that is more suitable for single posts and pages.</p>\n\n\n\n<p>I am still undecided on whether the patterns or template parts system is the ideal solution for this. Right now, patterns have a cleaner UI overall and can be categorized. Template parts might be easier to switch, but there is no way to group them (e.g., header templates, footer templates, etc.). Regardless of what becomes the <em>de facto</em> standard in the long term, we need more theme authors like UXL Themes experimenting with these concepts, seeing what works, and gathering user feedback.</p>\n\n\n\n<p>The theme does not add much in the way of content patterns. However, it does include one named &ldquo;2 Columns of Text and a Full-Width Cover.&rdquo; While it is a bit of a mouthful, the name does fully describe what it does. This is also the pattern in use for the homepage in the <a href=\"https://uxlthemes.com/demo/hansen/\">theme&rsquo;s demo</a>. However, the demo has a slight modification, adding a custom latest posts section.</p>\n\n\n\n<img />Hansen content-related pattern.\n\n\n\n<p>Hansen is more than just its patterns. The theme generally looks pretty good too. It has a bit more pizazz than we have seen from some other block-based experiments. Like the <a href=\"https://wptavern.com/phoenix-a-block-based-wordpress-theme-with-a-sidebar\">recently-released Phoenix theme</a>, developers are becoming more comfortable moving beyond the bare-bones block-based designs from previous months.</p>\n\n\n\n<p>These themes are obviously not on par with what one could build on more mature systems. However, Gutenberg&rsquo;s FSE system is inching forward. The theme authors who are experimenting now are paving the way for the next generation of themes, which I am excited to see.</p>\n\n\n\n<p>The Hansen theme also includes several block styles. Most are geared toward blocks that users would typically use in the site editor. I have not seen such an approach in previous block-based themes.</p>\n\n\n\n<p>Two of the styles are for mobile navigation. The Mobile Friendly style displays a horizontal nav menu on desktop while switching to a hamburger-flydown on mobile devices. The Mobile Style alternative retains the mobile layout on all screen sizes.</p>\n\n\n\n<p>There is a Box Shadow style for the Query Loop block, which adds a shadow to each post. In the future, I hope to see WordPress provide box-shadow options for this instead of themes relying on block styles. Nevertheless, it is a welcome addition for the moment.</p>\n\n\n\n<img />Box Shadow style for the Query Loop block.\n\n\n\n<p>The No Bottom Margin style allows users to remove bottom margin from Columns. I assume the theme author used this to address the common issue of nested blocks and their bottom margins adding on top of each other. I do not like this as a style because it gives the user the responsibility of fixing a design issue that should be taken care of under the hood. Generally, the problem stems from tackling spacing in design using a bottom margin instead of a top margin. It can be corrected in either case, but going with a top-margin approach is easier.</p>\n\n\n\n<p>Outside of that one stylistic issue, the other downside to the theme is that it is not well-suited to long-form content out of the box. The content area stretches too wide for the default font size, making for uncomfortable reading. The theme includes a Narrow Width style for the Group block that corrects this. However, it would ideally be the reverse, with the content defaulting to a narrower width. Whenever a user wants to write a long-form blog post, they would need to wrap it in a Group block and apply the Narrow Width style. The more common use case should be the default.</p>\n\n\n\n<p>Overall, I love the experimentation. Hansen is one of the best themes for playing around with the site editor in Gutenberg right now.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 Feb 2021 22:21:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WordPress.org blog: Did You Know About Reusable Blocks?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9777\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://wordpress.org/news/2021/02/gutenberg-tutorial-reusable-blocks/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6430:\"<p><strong><em>Created by Joen Asmussen, <a href=\"https://profiles.wordpress.org/joen/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>joen</a></em></strong></p>\n\n\n\n<div class=\"wp-block-image\"><img src=\"https://i1.wp.com/wordpress.org/news/files/2021/02/Reusable-Blocks-featured.png?resize=585%2C329&ssl=1\" alt=\"\" class=\"wp-image-9803\" width=\"585\" height=\"329\" /></div>\n\n\n\n<p>The WordPress block editor (a.k.a. Gutenberg) comes with a feature called &#8220;reusable blocks.” They are blocks, saved for later, edited in one place.</p>\n\n\n\n<p>Have you ever wanted to:</p>\n\n\n\n<ul><li>Re-use the same snippet of text across posts and pages?</li><li>Save complex layouts to spare you having to copy/paste from one post to another?</li></ul>\n\n\n\n<p>Reusable blocks can do these things.</p>\n\n\n\n<h2>Like templates, you mean?</h2>\n\n\n\n<p>Not quite. Think of reusable blocks as snippets of globally synchronized content that are personal to you. You can edit all your reusable blocks in one place, and any post or page you inserted that block into, get the updated version as well.&nbsp;</p>\n\n\n\n<p>Where you might use templates to structure your website, you can use reusable blocks to structure your content. For example:</p>\n\n\n\n<ul><li>A testimonial on your homepage and your product page.</li><li>A &#8220;this post is part of a series&#8221; box that you insert part-way through your article.</li><li>A &#8220;Follow me on social media&#8221; section you can weave into the prose of your popular article.</li><li>Complex but static blocks, such as a &#8220;Subscribe to my newsletter&#8221; box, a contact form, a survey, quiz, or polls.</li></ul>\n\n\n\n<p>Key properties are that reusable blocks are unbeatable when you want to reuse a snippet of content, edit it in one place, and have the changes propagate to every instance.</p>\n\n\n\n<h2>Show me how</h2>\n\n\n\n<p>To create a reusable block, open the block editor and create the content you want to reuse:</p>\n\n\n\n\n\n\n\n<p>Now select the content you want to turn into a reusable block, then click the three-dot &#8220;More&#8221; menu and choose &#8220;Add to Reusable blocks.”</p>\n\n\n\n\n\n\n\n<p>Voilà, you’ve now created a reusable block. From now on, you can find this block, and any other you create, in the &#8220;Reusable blocks&#8221; tab in the block library:</p>\n\n\n\n\n\n\n\n<p>This is also where you can insert the newly created block on any of your posts or pages.</p>\n\n\n\n<h2>Where do I edit my existing reusable blocks?</h2>\n\n\n\n<p>To edit a reusable block, select it and make your edits. When you make an edit, the Publish button will have a little dot indicator:</p>\n\n\n\n\n\n\n\n<p>This dot indicates you’ve made a global change that potentially affects posts beyond just the one you’re editing, the same as when you’re editing templates. This lets you confirm the change was intentional.</p>\n\n\n\n<p><strong>Another way to edit your reusable blocks</strong> is to click the global three-dot &#8220;More&#8221; menu and selecting &#8220;Manage all reusable blocks&#8221;:</p>\n\n\n\n\n\n\n\n<p>This takes you to a section letting you edit, rename, export, or delete every reusable block you created.&nbsp;</p>\n\n\n\n<h2>What else can I do?</h2>\n\n\n\n<p>Here are a couple of tips and tricks you can leverage to get the most out of reusable blocks.</p>\n\n\n\n<h3>Give them a good name</h3>\n\n\n\n<p>When you name a reusable block, you are essentially choosing your search terms, as the name is what you search for in the block library (or when you use the &#8220;slash command,” typing / in an empty paragraph):</p>\n\n\n\n\n\n\n\n<p>Avoid names such as &#8220;Gallery&#8221; or &#8220;Image,” as that’ll be annoying when you just want to insert one of those. You can avoid that with a unique name, such as &#8220;My author biography.”</p>\n\n\n\n<h3>Insert in the best place of your content flow</h3>\n\n\n\n<p>One obvious benefit of reusable blocks is that they are just blocks, just like everything else in the block editor. That means you can insert it anywhere in your content. You might want your rich author biography to sit at the top or bottom of the post, but <em>This post is part of a series</em> box that might sit well two or three paragraphs not to disrupt the reading flow.</p>\n\n\n\n\n\n\n\n<h3>A design shortcut</h3>\n\n\n\n<p>Maybe you created a complex layout you&#8217;re happy with, a call to action with the right image and buttons, and it took a while to get it just right. Go on and save it as a reusable block: even if you mean to insert it only to convert it to a regular block, it might still save you a minute.&nbsp;</p>\n\n\n\n<p>To convert a reusable block to regular (blocks, select it and click the &#8220;Convert to regular blocks&#8221;:</p>\n\n\n\n<p></p>\n\n\n\n\n\n\n\n<p><em>Design by </em><a href=\"https://beatrizfialho.com/\"><em>Beatriz Fialho</em></a><em>.</em></p>\n\n\n\n<p><strong>Tip:</strong> You can also find some nice patterns on <a href=\"https://gutenberghub.com/\">Gutenberg Hub</a> or <a href=\"https://shareablock.com/\">ShareABlock</a>.</p>\n\n\n\n<h3>Take it with you</h3>\n\n\n\n<p>Need to move to another site? You can both export and import reusable blocks. Go to the <em>Manage all reusable blocks</em> section from the global three-dot &#8220;More&#8221; menu, hover over the block you want to export, and click &#8220;Export as JSON&#8221;:</p>\n\n\n\n\n\n\n\n<p>The downloaded file can be imported on any WordPress 5.0 or newer website.</p>\n\n\n\n<h2>Try it</h2>\n\n\n\n<p>Create a draft post and play around with Reusable Blocks to see how you might start using them. You can always delete them when you’re done playing.</p>\n\n\n\n<p>You can test importing and using a small reusable block I created as an example. It&#8217;s a &#8220;Further reading&#8221; block that shows the four latest posts from the category &#8220;Featured&#8221;:</p>\n\n\n\n<img src=\"https://lh6.googleusercontent.com/33_L1WQrTxNiidm8IKcSfn7_nYjcpq5zpSzycmKliDnGzFI_hLu7yLPV1vnqWgCS7H6JtFAGEXz-AVkNBLtQQEM80VA6KUfcmj1JAoVZ5ZNMavVzlGzBPEiqiD3-eUzZSvOTYm_E\" alt=\"\" />\n\n\n\n<p>It might work well as a highlight in an article, giving the reader something new to read or awareness of your other content.</p>\n\n\n\n<p><em><strong>The videos in this post show the reusable blocks flow in the upcoming WordPress 5.7.</strong></em></p>\n\n\n\n<p><a href=\"https://gist.github.com/jasmussen/53cb51dcd9a2bb561893aa7c5e126cdf\"><strong>Download the block from this gist</strong></a>, import it to your WordPress site, then customize to make it yours.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 24 Feb 2021 19:17:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Chloe Bringmann\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: WordPress 5.7 Lets Administrators Send Password Reset Links\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112409\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:183:\"https://wptavern.com/wordpress-5-7-lets-administrators-send-password-reset-links?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-5-7-lets-administrators-send-password-reset-links\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3479:\"<p>It&rsquo;s that time in the release cycle when all the dev notes are rolling out ahead of the next major update. These notes include technical summaries of all the goodies coming in the next release. If you haven&rsquo;t been paying close attention, there are always a few happy surprises in there that pop up as conclusions to tickets that contributors have been working on for years. </p>\n\n\n\n<p>The <a href=\"https://make.wordpress.org/core/2021/02/22/send-reset-password-links-in-wordpress-5-7/\">new password reset feature</a> coming in WordPress 5.7 allows administrators to manually send a password reset link to users, resolving a five-year old <a href=\"https://core.trac.wordpress.org/ticket/34281\">ticket</a>. Instead of having to instruct a user about where to go to click on the lost password link and follow the steps, this new feature lets administrators push a button in the admin to send the link. If you have ever had to support clients or a community of users who may not be very technically inclined, this new password reset feature will save lots of time in helping users regain access to their accounts.</p>\n\n\n\n<p>The &ldquo;Send password reset&rdquo; link is available in several places. Administrators can find the link on the Users screen, as well as in the bulk actions dropdown menu. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>It is also available on the individual user screen with a button and a note clarifying that this action will not change the user&rsquo;s password or force the user to change it.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>The password reset email notification includes the site name, username, a password reset link, and the IP address where the request originated: </p>\n\n\n\n<p><em>This password reset request originated from the IP address [IPADDRESS].</em></p>\n\n\n\n<p>There is an open discussion on the original <a href=\"https://core.trac.wordpress.org/ticket/34281\">ticket</a> regarding whether this email notification should include the administrator&rsquo;s IP address. </p>\n\n\n\n<p>&ldquo;The IP address (while fraught with privacy concerns) is the only thing validating that this email came from the website and is not a phishing email,&rdquo; contributor Gabriel Mariani said. &ldquo;Unless there is a better way to validate the authenticity of the email I&rsquo;d say it would be worthwhile to keep it.&rdquo;</p>\n\n\n\n<p>Others see the IP address as useful only if a user is attempting to verify that it is their own IP address or collecting the information to prevent a phishing attack. Giving out the administrator&rsquo;s IP address doesn&rsquo;t seem pertinent to either of those concerns.</p>\n\n\n\n<p>&ldquo;I could use my phone to send a reset, and I would have no idea what my IP was,&rdquo; Mika Epstein said. &ldquo;And that can easily be faked. Omitting the IP actually reduces the data being sent out that could be used by bad-actors.</p>\n\n\n\n<p>&ldquo;I think it&rsquo;s more likely we&rsquo;d have a savvy bad actor than end users who would need to ask for a password reset but also know what a valid IP is and how to ask about it.&rdquo;</p>\n\n\n\n<p>This part of the email text may be iterated on in subsequent patches or future releases of WordPress. Check out the <a href=\"https://make.wordpress.org/core/2021/02/22/send-reset-password-links-in-wordpress-5-7/\">dev note</a> for more discussion on this feature, along with information about further customizing the notification email.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Feb 2021 22:38:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"WordPress.org blog: WordPress 5.7 Release Candidate\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9773\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://wordpress.org/news/2021/02/wordpress-5-7-release-candidate/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3678:\"<p>The first release candidate for WordPress 5.7 is now available! <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f389.png\" alt=\"🎉\" class=\"wp-smiley\" /></p>\n\n\n\n<p>Please join us in celebrating this very important milestone in the community&#8217;s progress towards the final release!</p>\n\n\n\n<p>“Release Candidate” means that the new version is ready for release, but with millions of users and thousands of plugins and themes, it’s possible something was missed. WordPress 5.7 is slated for release&nbsp;on&nbsp;<strong>March 9, 2021</strong>, but <em>your</em>&nbsp;help is needed to get there—if you haven’t tried 5.7 yet,&nbsp;<strong>now is the time</strong>!</p>\n\n\n\n<p>You can test the WordPress 5.7 release candidate in two ways:</p>\n\n\n\n<ul><li>Try the&nbsp;<a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>&nbsp;plugin (choose the “Bleeding edge” channel and Beta/RC Only” stream options)</li><li>Or&nbsp;<a href=\"https://wordpress.org/wordpress-5.7-RC1.zip\">download the release candidate here (zip)</a>.</li></ul>\n\n\n\n<p>Thank you to all of the contributors who tested the&nbsp;Beta releases and gave feedback. Testing for bugs is a critical part of polishing every release and a great way to contribute to WordPress.</p>\n\n\n\n<h2>What’s in WordPress 5.7?</h2>\n\n\n\n<ul><li>Robots API and Media Search Engine Visibility</li><li>Detect HTTPS support</li><li>Lazy-load iframes</li><li>jQuery migrate-related Deprecation notice clean-up</li><li>Admin color palette standardization</li><li>The newest version of the Gutenberg plugin</li></ul>\n\n\n\n<h2>Plugin and Theme Developers</h2>\n\n\n\n<p>Please test your plugins and themes against WordPress 5.7 and update the&nbsp;<em>Tested up to</em>&nbsp;version in the readme file to 5.7. If you find compatibility problems, please be sure to post to the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta/\">support forums</a>,&nbsp;so those can be figured out before the final release.</p>\n\n\n\n<p>The&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://make.wordpress.org/core/2021/02/23/wordpress-5-7-field-guide\">WordPress 5.7 Field Guide</a>&nbsp;will give you a more detailed dive into the major changes.</p>\n\n\n\n<h2>How to Help</h2>\n\n\n\n<p>Do you speak a language other than English?&nbsp;<a href=\"https://translate.wordpress.org/projects/wp/dev\">Help us translate WordPress into more than 100 languages!</a>&nbsp;This release also marks the&nbsp;<a href=\"https://make.wordpress.org/polyglots/handbook/glossary/#hard-freeze\">hard string freeze</a>&nbsp;point of the 5.7 release schedule.</p>\n\n\n\n<p><em><strong>If you think you’ve found a bug</strong>, you can post to the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta\">Alpha/Beta area</a>&nbsp;in the support forums. We’d love to hear from you! If you’re comfortable writing a reproducible bug report,&nbsp;<a href=\"https://make.wordpress.org/core/reports/\">file one on WordPress Trac</a>, where you can also find&nbsp;<a href=\"https://core.trac.wordpress.org/tickets/major\">a list of known bugs</a>.</em></p>\n\n\n\n<p><em>Props to <a href=\"https://profiles.wordpress.org/audrasjb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>audrasjb</a> for copy suggestions and <a href=\"https://profiles.wordpress.org/davidbaumwald/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>davidbaumwald</a> for final review.</em></p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p><em>Test this test that <br />Catch everything that you can<br />Before it&#8217;s live&#8230;</em><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f92f.png\" alt=\"🤯\" class=\"wp-smiley\" /></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Feb 2021 21:07:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ebonie Butler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"WPTavern: FSE Outreach Round #2: Building a Custom Homepage With Gutenberg’s Site Editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112446\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:215:\"https://wptavern.com/fse-outreach-round-2-building-a-custom-homepage-with-gutenbergs-site-editor?utm_source=rss&utm_medium=rss&utm_campaign=fse-outreach-round-2-building-a-custom-homepage-with-gutenbergs-site-editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7876:\"<p class=\"has-drop-cap\">Anne McCarthy announced the <a href=\"https://make.wordpress.org/test/2021/02/18/fse-program-testing-call-2-build-a-homepage-with-site-editing-blocks/\">second round of testing</a> for the Full Site Editing (FSE) Outreach program. The call for testing asks that users build a homepage from the Gutenberg plugin&rsquo;s site editor. Feedback is open until March 5.</p>\n\n\n\n<p>The <a href=\"https://wptavern.com/help-steer-the-future-of-wordpress-via-the-fse-outreach-program\">first round of testing</a> began in December 2020 and ended last month. Testers were able to <a href=\"https://wptavern.com/first-round-of-the-fse-outreach-program-concludes-identifies-template-editing-mode-problems\">identify several pain points</a> with template-editing mode from the block editor. The program created actionable items that Gutenberg developers could work to improve.</p>\n\n\n\n<p>This second round is similar. However, testing covers a much larger and more complex area. Users will be leaving the familiar block editor and moving to the site editor, which is still months away from being a viable product.</p>\n\n\n\n<p>McCarthy listed a 22-step process for building out a homepage. While I followed it for the most part, I got bored before finishing. This is one of the reasons I make for a poor test subject. I like to explore and see what is possible on my own. If I have an idea, I want to attempt its execution. I primarily stuck to the overall script, even if it was a bit out of order.</p>\n\n\n\n<p>Eventually, I created a custom homepage for a restaurant called The Grilled Cheese &mdash; <em>I would definitely open this restaurant in the real world if I ever leave the WordPress community.</em></p>\n\n\n\n<img />Custom restaurant homepage with sidebar.\n\n\n\n<p>It is reasonably simple. All told, it took me around two hours of playing around with various concepts before arriving at this stage. To build something I would be happy with would have taken a few more hours.</p>\n\n\n\n<p>Overall, I felt limited in laying out my ideal homepage. Each step was an uphill battle against the tools. I could have built this in less than half the time with HTML and CSS. I could do the same and more with other modern page builder plugins for WordPress.</p>\n\n\n\n<p>Before diving into the results of my test, I have some brutal honesty. TT1 Blocks, which is the theme used for FSE Outreach testing, is not up to snuff. The theme does not reliably handle the multitude of possibilities the site editor sets in the hands of end-users. This entire experience could be made smoother with a better theme. However, the choices are limited, and I am not sure if there is a better block-based theme to work with at this point.</p>\n\n\n\n<p>There were so many inconsistencies between the site editor and the front end that there is little point in listing them all. Spacing was grossly off. I generally see that as a theme issue. I spent much of my time in trial-and-error mode, making an adjustment in the editor and refreshing to see the front-end result. Rinse. Repeat.</p>\n\n\n\n<h2>Identifying Pain Points</h2>\n\n\n\n<p class=\"has-drop-cap\">While this post is critical of the site editor, it does not mean the experience was altogether poor. Seeing the improvement every week gives me hope that WordPress will have a site editor that rivals anything on the market. Eventually. However, my goal here is to provide real feedback that the team can use.</p>\n\n\n\n<p>Outside of the general spacing issues mentioned earlier, I identified several stumbling blocks while building a custom homepage.</p>\n\n\n\n<h3>Maximum Widths</h3>\n\n\n\n<p>When designing a full-site page via the site editor, one problem stood out more than most. WordPress lacks a well-rounded &ldquo;max-width&rdquo; system. As a user, I was left with few choices in setting the width of the content area of my homepage. Currently, theme authors can set custom content, wide, and full widths. However, this system is horribly limiting. There is not much theme authors can do with this, and this problem directly limits what users can do in both the block and site editors.</p>\n\n\n\n<p>I have previously written about the <a href=\"https://wptavern.com/themes-of-the-future-a-design-framework-and-a-master-theme\">need for a design framework</a>, one that is customizable by theme authors. Tailwind CSS has a <a href=\"https://tailwindcss.com/docs/max-width\">max-width system</a> that offers a boatload of flexibility. WordPress needs to start borrowing ideas from these modern design frameworks.</p>\n\n\n\n<h3>Add Block Icon</h3>\n\n\n\n<p>Getting the &ldquo;Add Block&rdquo; icon to appear when hovering in between elements in the default content area was rough. I had to position my mouse in a perfect position for it to appear. It was an exercise in frustration where even the slightest movement caused the icon to once again disappear.</p>\n\n\n\n<img />Locating the &lsquo;Add Block&rsquo; icon.\n\n\n\n<p>Switching to Top Toolbar mode made this far easier. I am assuming the default block toolbar was hiding it to some degree. The problem with switching to this mode is that my toolbar-choice was not saved. Each time I returned to the site editor, I had to enable it once again.</p>\n\n\n\n<h3>Query Block</h3>\n\n\n\n<p>The most frustrating aspect of listing posts on a custom homepage was setting a limit. I wanted to set the number to three. However, the Query block has no option for doing this. Eventually, I created a <em>faux</em> limit using the category filter, choosing one that had just a couple of posts.</p>\n\n\n\n<p><strong>Update:</strong> It is possible to set a limit as noted by <a href=\"https://wptavern.com/fse-outreach-round-2-building-a-custom-homepage-with-gutenbergs-site-editor#comment-366562\">Nick in the comments</a>. There is a &ldquo;settings&rdquo; icon in the toolbar for setting the number of posts per page, an offset, and max number of pages. I am unsure why these particular query settings are separate from the others in the sidebar.  It makes more sense for them to be grouped together.</p>\n\n\n\n<img />Limiting posts by using the Query block&rsquo;s category filter.\n\n\n\n<p>Another confusing aspect of the Query block is the keyword filter. As far as I am aware, WordPress has never used the &ldquo;keyword&rdquo; terminology. Outside of SEO plugins, there does not seem to be any context for what this filter does. I am guessing it works like a search keyword.</p>\n\n\n\n<h3>Global Styles for All Blocks</h3>\n\n\n\n<p>When switching over to the Global Styles panel, I noticed that some blocks were missing when applying styles on the block level. In particular, I wanted to adjust styles for the Latest Comments block.</p>\n\n\n\n<p>I suppose that only blocks with typography, colors, and other design-related options appear in the list. This will likely confuse end-users when the site editor lands in WordPress. All blocks should have style options that users can customize.</p>\n\n\n\n<h3>No Full-Width Columns</h3>\n\n\n\n<p>For the content of my homepage, I attempted to create a full-width Columns block. However, the two individual columns were limited in size despite taking up 66.67% and 33.33%, respectively.</p>\n\n\n\n<img />Full-width columns not spanning the full area.\n\n\n\n<p>This seems like it is a theme issue. I would also argue that this is one of those times where having more direct control over the max-width would have helped. I really wanted something that was between the theme&rsquo;s full and wide widths.</p>\n\n\n\n<h3>Featured Images</h3>\n\n\n\n<p>There is no way to set the size of the image output by the Post Featured Image block. The only way to get a uniform size at the moment is to pre-crop the images before uploading them to WordPress.</p>\n\n\n\n<p>There is no reason this should not essentially be a variation of the Image block. The only thing featured images need that is different is the option to link to the post.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Feb 2021 20:47:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WordPress Foundation: The Basic principles of Open-source Software\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://wordpressfoundation.org/?p=181046\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://wordpressfoundation.org/2021/the-basic-principles-of-open-source-software/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4995:\"<p>The WordPress Foundation aims to educate the public about WordPress and related open-source software (OSS). Towards that end, the WordPress Foundation created the <a href=\"https://wordpressfoundation.org/tag/intro-to-open-source/\">Introduction to Open-source workshops</a>, which shed more light on the potential of open-source software, particularly in countries where there is less participation in OSS projects. Due to the COVID-19 pandemic, <a href=\"https://wordpressfoundation.org/2020/open-source-workshops-november-2020-report/\">these workshops have moved online</a>. The WordPress Foundation hopes to see more open-source workshops held online this year to help spread awareness about the importance of open-source software.</p>\n\n\n\n<p><strong>What are open-source software and Free Software?</strong></p>\n\n\n\n<p>Open-source software is software whose source code is available for anyone to view, modify and enhance. Free software refers to software that complies with “four essential freedoms” &#8211; to use, study, modify and distribute software for any purpose without legal restraint. Open-source software is characterized by the public accessibility of its code, while free software focuses on the capabilities for using and sharing the software.<br /></p>\n\n\n\n<p><strong>Advantages of Free and Open-source Software over Proprietary software</strong></p>\n\n\n\n<p>Proprietary software is distributed in executable files where the source code is encrypted and not available. Free and Open-source software enables users to read and modify the code, thus allowing a host of advantages such as little (or no) cost, faster distribution, greater customization, and easy availability of bugs and security patches, to name a few.&nbsp;</p>\n\n\n\n<p>The Introduction to Open-source workshops cover the difference between different software types, the history of open-source software, its advantages over proprietary software, and how this applies to WordPress. The workshop also explains the differences between free and Open-source software and highlights the different types of software licenses.&nbsp;</p>\n\n\n\n<h3>Want to learn more about Free and Open-source software? Participate in an Introduction to Open-source workshop!</h3>\n\n\n\n<p>There are four ways you can participate in an Introduction to Open-source workshop!&nbsp;</p>\n\n\n\n<ol><li>You can attend the Introduction to WordPress workshop from the comfort of your home! Learn WordPress now features an <a href=\"https://learn.wordpress.org/workshop/introduction-to-open-source/\">Introduction to Open-source video workshop</a> that you can watch at your convenience.&nbsp;</li><li>Community members can also now host or participate in <a href=\"https://learn.wordpress.org/workshop/introduction-to-open-source/\">Introduction to Open-source workshop</a> discussion groups in the <a href=\"https://www.meetup.com/learn-wordpress-discussions/\">Learn WordPress meetup group</a> for a global audience. Sign-ups are now open for the following two discussion groups:</li></ol>\n\n\n\n<ul><li><a href=\"https://www.meetup.com/learn-wordpress-discussions/events/276520738/\">Thursday, February 25, 2021, at 4:00 PM UTC</a></li><li><a href=\"https://www.meetup.com/learn-wordpress-discussions/events/276536997/\">Tuesday, March 2, 2021, at 10:00 AM UTC</a></li></ul>\n\n\n\n<p><em>If you would like to host an Introduction to Open-source discussion group for a global audience, please </em><a href=\"https://learn.wordpress.org/discussion-groups/\"><em>apply to become a discussion group </em></a><em>facilitator.</em>&nbsp;</p>\n\n\n\n<ol start=\"3\"><li>WordPress Meetup groups worldwide are also encouraged to<a href=\"https://make.wordpress.org/community/handbook/virtual-events/organize-learn-wordpress-discussion-groups-for-your-wordpress-meetup/\"> organize an Introduction to WordPress watch party + discussion group</a> (based on the Learn WordPress workshop on <a href=\"https://learn.wordpress.org/workshop/introduction-to-open-source/\">Introduction to Open-source</a>) as part of their meetup (it does not need any prior approval). </li><li><a href=\"https://learn.wordpress.org/lesson-plan/what-is-open-source/\">Lesson plans</a> for the Introduction to Open-source workshops are available! Meetup group organizers can plan their live open-source workshop based on the lesson plans. </li></ol>\n\n\n\n<p>The WordPress Foundation invites community members across the world to join these open-source workshops and to organize workshops and discussion groups in their communities to help spread <a href=\"https://wordpressfoundation.org/philosophy/\">our mission</a> of serving the public good with the help of Open-source software.</p>\n\n\n\n<p class=\"has-background\">Meetup groups organizing Introduction to Open-source workshops will be featured on this website. All you need to do is to <a href=\"https://make.wordpress.org/community/contact/\">reach out to us</a> with a brief write-up about your workshop along with pictures, and we&#8217;ll publish them here! </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Feb 2021 12:58:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Hari Shanker\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"Matt: Invest Like the Best and Building Worlds\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53759\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://ma.tt/2021/02/invest-like-the-best-and-building-worlds/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1736:\"<a href=\"https://www.joincolossus.com/episodes/6786509/mullenweg-the-past-present-and-future-of-the-internet\"><img /></a>\n\n\n\n<p><a href=\"https://www.joincolossus.com/episodes/6786509/mullenweg-the-past-present-and-future-of-the-internet\">On a Founder&#8217;s Field Guide episode with Patrick O&#8217;Shaughnessy</a> we had an interesting conversation that covered a lot new ground, including an idea I&#8217;ve been playing around with on, as Patrick <a href=\"https://twitter.com/patrick_oshag/status/1360338056809754630\">put it</a>:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>The idea from <a href=\"https://twitter.com/photomatt\">@photomatt</a> that the best companies are those that build intricate worlds (in the same way that J. R. R. Tolkien came up with the elvish language) will always stick with me. </p></blockquote>\n\n\n\n<p>We also covered the pendulum of centralization and decentralization, current challenges facing the internet, and being a connoisseur of things overlooked. You can check out the episode on <a href=\"https://podcasts.apple.com/us/podcast/matt-mullenweg-past-present-future-internet-founders/id1154105909?i=1000508583385\">Apple</a>, <a href=\"https://podcasts.google.com/feed/aHR0cHM6Ly9pbnZlc3RsaWtldGhlYmVzdC5saWJzeW4uY29tL3Jzcw/episode/ZGI0MjlkYjgtMDUwYy00NDIwLTkwODUtZjVlZTgwNTFkZDIx?hl=en&ved=2ahUKEwjj_KuQnf_uAhWbWM0KHYJUCW4QieUEegQICBAL&ep=6\">Google</a>, <a href=\"https://open.spotify.com/episode/7xwHc7ZUvwJmSUNUssRi2M?si=XSqGqlhjQcOZkL33b8QzpQ\">Spotify</a>, <a href=\"https://overcast.fm/+Lzu0ZSQ_M\">Overcast</a>, and <a href=\"https://pca.st/o8cpe4i8\">Pocket Casts</a>.</p>\n\n\n\n<p>I&#8217;ve been impressed by the audience of this podcast, a lot of people I admire reached out after this episode.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 23 Feb 2021 05:10:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Native Lazy Loading Support for iframes Coming To WordPress 5.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112383\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:191:\"https://wptavern.com/native-lazy-loading-support-for-iframes-coming-to-wordpress-5-7?utm_source=rss&utm_medium=rss&utm_campaign=native-lazy-loading-support-for-iframes-coming-to-wordpress-5-7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5031:\"<p class=\"has-drop-cap\">Felix Arntz, a WordPress core committer and developer programs engineer at Google, announced upcoming support for <a href=\"https://make.wordpress.org/core/2021/02/19/lazy-loading-iframes-in-5-7/\">lazy loading iframes</a>. The feature is included in the latest WordPress 5.7 beta and will officially ship next month to the larger community.</p>\n\n\n\n<p>WordPress has supported <a href=\"https://wptavern.com/native-lazy-loading-support-coming-to-wordpress\">lazy loading for images</a> since version 5.5. However, support for iframes was not included in the initial feature set. Browser support for iframes was widespread at the time. However, it had not yet been formalized as part of the HTML Living Standard. Soon thereafter, it was <a href=\"https://html.spec.whatwg.org/multipage/iframe-embed-object.html#attr-iframe-loading\">added to the HTML spec</a>, and discussion began anew for <a href=\"https://core.trac.wordpress.org/ticket/50756\">adding support</a> into WordPress.</p>\n\n\n\n<p>Unlike images, many users are likely unaware that they are using iframes. The primary use case for iframes is with embed blocks or the auto-embed system for users who are on the classic editor. For example, whenever a user adds a YouTube video to their blog post, the underlying code outputs an iframe.</p>\n\n\n\n<img />Source code of YouTube embed shows iframe.\n\n\n\n<p>These iframes add weight to the page size and hamper loading time.</p>\n\n\n\n<p>The opposite of lazy loading is eager loading. This is the default on the web, which loads all resources in bulk. This also often leads to slow-loading webpages when they contain many images or iframes. Lazy loading only loads the image and iframe sources when they appear in a site visitor&rsquo;s viewport. This speeds up the initial load time of pages.</p>\n\n\n\n<p>WordPress will only add the <code>loading=\"lazy\"</code> attribute if an explicit width and height are set for the iframe. This is to avoid the page-shifting effect that happens when the iframe comes into view. Arntz wrote about this effect extensively when he <a href=\"https://make.wordpress.org/core/2020/07/14/lazy-loading-images-in-5-5/\">announced support for image lazy loading</a>. The same issue applies to iframes.</p>\n\n\n\n<p>&ldquo;A common user experience problem in modern websites is so-called layout shifting, often caused by slow-loading media resources like images,&rdquo; he wrote. &ldquo;By default, only after an image is loaded, the browser can layout the page correctly, which results in the content e.g. below the image to shift. This issue can be easily resolved by providing <code>width</code> and <code>height</code> attributes on <code>img</code> tags, as the browser will use them to determine the aspect ratio of the image so that it can infer the page layout ahead of actually loading the image.&rdquo;</p>\n\n\n\n<p>There are cases where WordPress will not add the loading attribute, even for oEmbed providers that it supports. The iframe content is not supplied by WordPress. The third-party providers create the HTML and send it back to the individual WordPress site. It is up to those third parties to follow best practices for adding width and height attributes.</p>\n\n\n\n<p>&ldquo;Since WordPress cannot guess the dimensions of the embedded resource, the <code>loading=\"lazy\"</code> attribute will only be added if the oEmbed <code>iframe</code> tag comes with both dimension attributes present,&rdquo; wrote Arntz.</p>\n\n\n\n<p>Currently, the filter applies to the post content, excerpt, and text widgets. Perhaps WordPress will extend this to comment text one day.</p>\n\n\n\n<h2>Potential Problems With Ads</h2>\n\n\n\n<p class=\"has-drop-cap\">MaAnna Stephenson, the owner of BlogAid, <a href=\"https://make.wordpress.org/core/2021/02/19/lazy-loading-iframes-in-5-7/#comment-40740\">brought up a concern</a> for users who display ads on their site. There may be scenarios where lazy loading is banned in advertising terms or has a technical conflict.</p>\n\n\n\n<p>&ldquo;Has this been tested with folks who run ads on their site using an ad agency like Mediavine and AdThrive?&rdquo; she asked. &ldquo;They cannot have iframes lazy loaded, as the ads use iframes and they have their own lazy load mechanism for delivery.&rdquo;</p>\n\n\n\n<p>The problem is that there is no ideal way to exclude every advertising service and to distinguish them from other types of iframes. From a technical standpoint, it needs to be an all-or-nothing feature.</p>\n\n\n\n<p>Handling ads falls squarely into plugin territory. Arntz covered such use cases in the post. Developers can disable lazy loading for iframes wholesale or target specific iframes with basic PHP. It would only take a few lines of code to build a plugin for specific ad services.</p>\n\n\n\n<p>Jeff Starr also has a plugin for disabling lazy loading altogether named <a href=\"https://wordpress.org/plugins/disable-lazy-loading/\">Disable Lazy Load</a>. That could serve as a stopgap solution until something more specific to users&rsquo; needs comes along.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 22 Feb 2021 22:44:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WordPress.org blog: WordPress 5.6.2 Maintenance Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9764\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/news/2021/02/wordpress-5-6-2-maintenance-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5042:\"<p>WordPress 5.6.2 is now available!</p>\n\n\n\n<p>This maintenance release includes&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&milestone=5.6.2&group=component&col=id&col=summary&col=status&col=milestone&col=owner&col=type&col=priority&order=priority\">5 bug fixes</a>. These bugs affect WordPress version 5.6.1, so you’ll want to upgrade.</p>\n\n\n\n<p>You can&nbsp;<a href=\"https://wordpress.org/wordpress-5.6.2.zip\">download WordPress 5.6.2 directly</a>, or visit the<strong>&nbsp;Dashboard → Updates</strong>&nbsp;screen&nbsp;and click&nbsp;<strong>Update Now</strong>. If your sites support automatic background updates, they’ve already started the update process.</p>\n\n\n\n<p>WordPress 5.6.2 is a small maintenance release focused on fixing user-facing issues discovered in 5.6.1. The next major release will be&nbsp;<a href=\"https://make.wordpress.org/core/5-7/\">version 5.7</a>, currently scheduled for release on March 9, 2021.</p>\n\n\n\n<p>To see a full list of changes, you can browse the&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&milestone=5.6.2&group=component&col=id&col=summary&col=status&col=milestone&col=owner&col=type&col=priority&order=priority\">list on Trac</a>, read the&nbsp;<a href=\"https://make.wordpress.org/core/2021/02/17/wordpress-5-6-2-rc1/\">5.6.2 RC1</a>&nbsp;post, or visit the&nbsp;<a href=\"https://wordpress.org/support/wordpress-version/version-5-6-2/\">5.6.2 documentation page</a>.</p>\n\n\n\n<h2>Thanks and props!</h2>\n\n\n\n<p>The 5.6.2 release was led by <a href=\"https://profiles.wordpress.org/desrosj/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>desrosj</a>. Special props to <a href=\"https://profiles.wordpress.org/isabel_brison/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>isabel_brison</a> and <a href=\"https://profiles.wordpress.org/talldanwp/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>talldanwp</a> for helping to prepare the block editor related fixes, and <a href=\"https://profiles.wordpress.org/audrasjb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>audrasjb</a> and <a href=\"https://profiles.wordpress.org/sergeybiryukov/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>sergeybiryukov</a> for helping with other release related tasks.</p>\n\n\n\n<p>Props to everyone who helped make WordPress 5.6.2 happen:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">aaronrobertshaw</a>, <a href=\"https://profiles.wordpress.org/addiestavlo/\">Addie</a>, <a href=\"https://profiles.wordpress.org/nosolosw/\">André Maneiro</a>, <a href=\"https://profiles.wordpress.org/archon810/\">archon810</a>, <a href=\"https://profiles.wordpress.org/aristath/\">Ari Stathopoulos</a>, <a href=\"https://profiles.wordpress.org/bartosz777/\">bartosz777</a>, <a href=\"https://profiles.wordpress.org/bernhard-reiter/\">Bernhard Reiter</a>, <a href=\"https://profiles.wordpress.org/talldanwp/\">Daniel Richards</a>, <a href=\"https://profiles.wordpress.org/davidanderson/\">David Anderson</a>, <a href=\"https://profiles.wordpress.org/dbtedg/\">dbtedg</a>, <a href=\"https://profiles.wordpress.org/glendaviesnz/\">glendaviesnz</a>, <a href=\"https://profiles.wordpress.org/hmabpera/\">hmabpera</a>, <a href=\"https://profiles.wordpress.org/ibiza69/\">ibiza69</a>, <a href=\"https://profiles.wordpress.org/isabel_brison/\">Isabel Brison</a>, <a href=\"https://profiles.wordpress.org/viablethought/\">Jason Ryan</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/jrf/\">Juliette Reinders Folmer</a>, <a href=\"https://profiles.wordpress.org/kevin940726/\">Kai Hao</a>, <a href=\"https://profiles.wordpress.org/gwwar/\">Kerry Liu</a>, <a href=\"https://profiles.wordpress.org/hwk-fr/\">Konrad Chmielewski</a>, <a href=\"https://profiles.wordpress.org/jorgefilipecosta/\">Jorge Costa</a>, <a href=\"https://profiles.wordpress.org/magnuswebdesign/\">magnuswebdesign</a>, <a href=\"https://profiles.wordpress.org/clorith/\">Marius L. J.</a>, <a href=\"https://profiles.wordpress.org/mattwiebe/\">Matt Wiebe</a>, <a href=\"https://profiles.wordpress.org/mukesh27/\">Mukesh Panchal</a>, <a href=\"https://profiles.wordpress.org/paaljoachim/\">Paal Joachim Romdahl</a>, <a href=\"https://profiles.wordpress.org/freewebmentor/\">Prem Tiwari</a>, <a href=\"https://profiles.wordpress.org/itsjonq/\">Q</a>, <a href=\"https://profiles.wordpress.org/youknowriad/\">Riad Benguella</a>, <a href=\"https://profiles.wordpress.org/noisysocks/\">Robert Anderson</a>, <a href=\"https://profiles.wordpress.org/roger995/\">roger995</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov/\">Sergey Biryukov</a>, <a href=\"https://profiles.wordpress.org/yakimun/\">Sergey Yakimov</a>, <a href=\"https://profiles.wordpress.org/sterndata/\">Steven Stern (sterndata)</a>, <a href=\"https://profiles.wordpress.org/inc2734/\">Takashi Kitajima</a>, <a href=\"https://profiles.wordpress.org/tonysandwich/\">tonysandwich</a>, <a href=\"https://profiles.wordpress.org/worldedu/\">worldedu</a>, <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 22 Feb 2021 15:35:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Jonathan Desrosiers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WordPress.org blog: Reflecting on Gutenberg’s 100th Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9750\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://wordpress.org/news/2021/02/reflecting-on-gutenbergs-100th-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3693:\"<div class=\"juxtapose\"><img id=\"9751\" src=\"https://i2.wp.com/wordpress.org/news/files/2021/02/gutenberg_past_3.png?resize=632%2C336&ssl=1\" alt=\"\" width=\"632\" height=\"336\" class=\"image-compare__image-before\" /><img id=\"9752\" src=\"https://i1.wp.com/wordpress.org/news/files/2021/02/gutenberg_today_4.png?resize=632%2C336&ssl=1\" alt=\"\" width=\"632\" height=\"336\" class=\"image-compare__image-after\" /></div>1.0 to 10.0\n\n\n\n<p>Gutenberg 10.0 released this week, February 17, 2021, marking the 100th release of the Gutenberg plugin; the 100th release of a journey that started more than four years ago when Matt announced the project at WordCamp US 2016.&nbsp;</p>\n\n\n\n<h2>Where We Started</h2>\n\n\n\n<p>The past four years have not always been an easy journey. Shipping something this impactful is not easy, and there was precedent for keeping the editor as it was: WordPress had already tried to replace TinyMCE a couple of times already. What would be different this time around? The worry was “not much” and initially, very few people actively joined the project.</p>\n\n\n\n<p>Six months later came WordCamp Europe 2017 and the first release of the plugin. The editor was nowhere close to being usable, but it “clicked” for some. The reactions to <a href=\"https://wordpress.tv/2017/07/01/interview-and-qanda-with-matt-mullenweg/\">the presentation</a> were hopeful, but afterward, there was a lot of pushback.</p>\n\n\n\n<p>Gutenberg was (and is) an audacious project. With a project this big it attracted a lot of attention, and it became difficult to discern constructive debate from mere opposition. We each come with our context, and some people had a fixed idea about what they wanted for the project. Some wanted to reuse an existing page builder, others wanted to revive the Fields API project, some wanted it to be front-end-first, others wanted it just to replace the classic editor’s content area, some wanted it to be in Vue.JS, others wanted no change at all. With a product used by 40% of the web, you hope to find consensus, and when compromises have to be made, it can be difficult for those involved to avoid feeling that their voice is being ignored.</p>\n\n\n\n<p>We have also made quite a few mistakes: stability wasn’t great in some releases, performance suffered in others, and accessibility as well. But we kept pushing forward, using feedback to improve the editor and the project in all aspects until its first inclusion in WordPress 5.0, and we’re still working to improve it today.</p>\n\n\n\n<h2>Where We Are</h2>\n\n\n\n<p>It’s a delight to see some people who strongly disagreed with the initial vision or approach to Gutenberg gradually come to enjoy using the editor and join the project to carry on its vision. Others might still not like it; some won’t ever use it. One thing is certain; we’ll continue doing our best to push forward, improve what’s already shipped, and ship new exciting features. We’ll continue making mistakes and hopefully continue learning from them.</p>\n\n\n\n<p>Wednesday marked the 100th release of Gutenberg, and while that looks remarkable on the outside, the release itself holds what all the other releases did. It holds improvements to the existing features, it fixes bugs that users reported, adds new features, and it highlights experiments with new ideas.</p>\n\n\n\n<p>What is remarkable about the release is the people. The ones who were with us from the start, the ones who were with us but left, the ones who joined in our journey, everyone who helped along the way, everyone who provided feedback, everyone who got their hands dirty, and everyone who tried to use this editor, extend it and provide ideas.</p>\n\n\n\n<p>Thank you all.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 19 Feb 2021 18:34:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Riad Benguella\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"WPTavern: Taking on the Major Players, Plausible Analytics Offers an Alternative, Privacy-Conscious Stats Service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112168\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:267:\"https://wptavern.com/taking-on-the-major-players-plausible-analytics-offers-an-alternative-privacy-conscious-stats-service?utm_source=rss&utm_medium=rss&utm_campaign=taking-on-the-major-players-plausible-analytics-offers-an-alternative-privacy-conscious-stats-service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8061:\"<p class=\"has-drop-cap\">Plausible Analytics is not new on the scene. The two-person, EU-based team behind the company has been trying to carve its slice of the analytics pie against players like Google Analytics and WordPress.com Stats for nearly two years.</p>\n\n\n\n<p>The self-funded and bootstrapped company is starting to gain a small foothold. It has been an uphill climb to get to usage on over 10,000 websites. Now, it is reaching out directly to the WordPress community with its <a href=\"https://wordpress.org/plugins/plausible-analytics/\">Plausible Analytics plugin</a>.</p>\n\n\n\n<p>&ldquo;<a href=\"https://plausible.io/\">Plausible Analytics</a> is a simple, open-source, lightweight (&lt; 1 KB), and privacy-friendly alternative to Google Analytics,&rdquo; said co-founder Marko Saric. &ldquo;We don&rsquo;t use cookies or track any personal data, but we still aim to give you as a site owner interesting and useful insights so you can improve your efforts.&rdquo;</p>\n\n\n\n<p>The company&rsquo;s service is built on an open-source philosophy, possibly making it an ideal partner for WordPress. The source code for the analytics service is licensed under the AGPL version 3.0 and is <a href=\"https://github.com/plausible/analytics\">publicly available on GitHub</a>.</p>\n\n\n\n<p>Users have two options for running Plausible Analytics. The first route is to use the company&rsquo;s cloud-based service, similar to other stats-based services. The other is to self-host the code.</p>\n\n\n\n<p>For the cloud service, there is a monthly, tier-based fee. Up to 10,000 pageviews runs $6 per month. Each level increases based on the number of views a site &mdash; you can also hook up multiple sites &mdash; receives. Users can knock 33% off the price by paying yearly, which puts the starting tier at $4 per month. Plausible also offers a 30-day free trial.</p>\n\n\n\n<p>&ldquo;It&rsquo;s definitely a challenge to go against free products and a product as dominant as Google Analytics, but it does feel like the times are changing,&rdquo; said Saric. &ldquo;An increasing number of people are becoming aware that free means that you may be paying with something else such as the data of your visitors in the case of Google Analytics.</p>\n\n\n\n<p>&ldquo;With Plausible, you own your site data. We don&rsquo;t share it with any third parties, and we don&rsquo;t use it for any other purpose. As we don&rsquo;t make money by selling your data, we need to charge a subscription fee to pay our costs and salaries so we can continue working on the product. We have tried to keep the prices as fair and affordable as possible starting at $4/month. We do have a free as in beer self-hosted version too for those who like to manage their own server infrastructure.&rdquo;</p>\n\n\n\n<p>For the self-hosted version, which might appeal to the DIY crowd in the WordPress world, Plausible is designed to run via Docker. Saric said you should have a basic understanding of the command-line and networking. The server must have a CPU with x86_64 architecture and support for SSE 4.2 instructions.</p>\n\n\n\n<p>&ldquo;Everything else really depends on how popular your site is and how much traffic you get,&rdquo; said Saric. &ldquo;But you should be able to run Plausible for a site that gets tens of thousands of monthly visitors even on the lowest Digital Ocean droplet.&rdquo;</p>\n\n\n\n<p>As of the latest plugin release, self-hosted support is built directly into it too.</p>\n\n\n\n<h2>How Plausible Analytics Works</h2>\n\n\n\n<img />Realtime stats from Plausible Analytics.\n\n\n\n<p class=\"has-drop-cap\">The service is much like any other analytics product. You sign up. The site gives you a JavaScript snippet, which you place in your site&rsquo;s header. Of course, this is automatically taken care of via the plugin.</p>\n\n\n\n<p>The service feels much like a stepping stone between what you might get between WordPress.com Stats and Google Analytics. It is a middle ground that shows promise for a young product. However, the interface feels easier to navigate and make sense of than either service. Plausible has plenty of room for growth, which makes it promising to see what the team has accomplished at this stage.</p>\n\n\n\n<p>End-users can enjoy the typical stats they are accustomed to seeing and break them down by time frame. Referrer, page, country, and device data are all there. Users can also set up goals, get email reports, and hook up to the Google Search Console.</p>\n\n\n\n<p>The downside to the Plausible Analytics WordPress plugin is that it is a bit bare-bones at the moment. It is merely a settings screen and integration layer between the site and service.</p>\n\n\n\n<img />Plugin settings screen.\n\n\n\n<p>It is missing the make-or-break feature of a built-in analytics page. Many users are accustomed to accessing their stats directly from within WordPress.</p>\n\n\n\n<p>&ldquo;Yes, that&rsquo;s the main thing we want to fix with the WordPress plugin,&rdquo; said Saric. &ldquo;We&rsquo;ve introduced several features to make the plugin useful for WordPress sites, such as excluding admin users from being counted by default, the option to track 404 error pages, and clicks on external links. We also have an easy way to run our script as a first-party connection from your subdomain, so you get more accurate stats compared to Google Analytics which is blocked by many browsers and extensions.&rdquo;</p>\n\n\n\n<p>The team is currently working on an API for Plausible and on an embedded mode. Before introducing stats into the WordPress UI, they must complete these features.</p>\n\n\n\n<h2>Privacy-First Solution</h2>\n\n\n\n<p class=\"has-drop-cap\">Website owners and visitors are becoming much more privacy-conscious than in years past. In light of the GDPR and related legislation from around the world, companies like Plausible Analytics must navigate this new landscape while still providing the data that users need.</p>\n\n\n\n<p>&ldquo;Plausible was built as a response to GDPR, other privacy regulations, and cultural changes over the last few years,&rdquo; said Saric. &ldquo;Our mission is to reduce corporate surveillance by providing an alternative web analytics tool which doesn&rsquo;t come from the ad-tech world.&rdquo;</p>\n\n\n\n<p>Plausible Analytics does not track individuals, and its data is aggregate-only said Saric. The service also does not rely on cookies or local storage, and there is no cross-site or cross-device tracking.</p>\n\n\n\n<p>&ldquo;We minimize any data collection in general, and whatever we do track is kept fully secured, encrypted, and hosted on a server in the European Union to ensure it is being covered by the strict laws on data privacy,&rdquo; he said. &ldquo;We&rsquo;re very transparent in all the data we collect. We have an in-built feature that we recommend site owners use to open up their stats to the public and share it on their site to be fully transparent so their visitors and anyone else can view the data that they have access to.&rdquo;</p>\n\n\n\n<h2>The Future of Plausible Analytics</h2>\n\n\n\n<p class=\"has-drop-cap\">The team recently introduced UTM tag support and custom events, allowing users to track whatever they want. Saric said that it is now possible to follow the full journey from an ad-click all the way to conversion on users&rsquo; sites.</p>\n\n\n\n<p>&ldquo;The next step for the WordPress plugin is to add the default out-of-the-box integration with popular third-party plugins to support event tracking for things such as contact forms and eCommerce,&rdquo; he said. &ldquo;This will make it a more convenient experience for WordPress users so they can get started tracking custom events without any manual configuration being required.&rdquo;</p>\n\n\n\n<p>All other features are done in the open on the project&rsquo;s GitHub repository and its <a href=\"https://github.com/plausible/analytics/projects/1\">roadmap</a>. The plugin is also open to community involvement on a <a href=\"https://github.com/plausible/wordpress\">separate repo</a>. Saric credits community member and WordPress developer Mehul Gohil with help on the plugin.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 19 Feb 2021 17:03:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: WordPress.org Removes Fake Reviews for AccessiBe Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112241\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:173:\"https://wptavern.com/wordpress-org-removes-fake-reviews-for-acessibe-plugin?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-org-removes-fake-reviews-for-acessibe-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4672:\"<p>After noticing suspicious review activity for the <a href=\"https://wordpress.org/plugins/accessibe/\">AccessiBe</a> plugin, accessibility consultant Joe Dolson <a href=\"https://www.joedolson.com/2021/02/accessibe-the-fake-wordpress-plug-in-reviews/\">reported</a> the fake reviews to WordPress.org&rsquo;s plugin team. The reviews were removed in under 48 hours, thanks to Dolson&rsquo;s detailed research.</p>\n\n\n\n<p>At the time of reporting, Dolson found 31 five-star reviews, 2 four-star reviews, and 2 one-star reviews. After putting these into a spreadsheet, he found certain correlations among the first 11 five-star reviews:</p>\n\n\n\n<ol><li>&ldquo;<em>All eleven user accounts I viewed had a common pattern of registration and use: between zero and 3 support topics raised and 4-7 reviews over the last 18 months.</em></li><li>&ldquo;<em>Every one of these eleven accounts had at least one point of overlap with another user in that group. That is, for each plug-in or theme interacted with by one of the accounts, at least one of the other accounts also interacted with that plug-in or theme.</em></li><li>&ldquo;<em>Multiple accounts had submitted one-star reviews on another plug-in, and in a quick assessment of other one-star reviews on that plug-in, I quickly found another account that had also submitted a five-star review on AccessiBe.</em></li></ol>\n\n\n\n<p>Approximately 33 reviews were removed from the AccessiBe plugin&rsquo;s page after the report. Plugin team member Mika Epstein <a href=\"https://twitter.com/Ipstenu/status/1362218304262180868\">said</a> that the team &ldquo;passes the reports to a volunteer who is amazing at hunting down VPNs and IPs for that.&rdquo; She also recognized Dolson&rsquo;s legwork and reporting as being instrumental in this particular case.</p>\n\n\n\n<p>Dolson allowed me to view his spreadsheet, where he logged URLs for each suspected fake review, along with dates and reviews left on other plugins. These were not saved to the Internet Archive, but Dolson said they were all &ldquo;pretty generic,&rdquo; and that each one was a one-sentence review. The user profiles still appear to be there but do not have any activity listed.</p>\n\n\n\n<p>&ldquo;As a WordPress plugin author myself, I find the investment in falsifying positive reviews irritating,&rdquo; Dolson said. &ldquo;What some of us work for, they are simply buying &ndash; the appearance of a good product without the labor of winning customer opinion. </p>\n\n\n\n<p>&ldquo;I found the evidence of a hatchet job conducted systematically against another plugin chilling, however.&rdquo;</p>\n\n\n\n<p>The AccessiBe plugin is active on approximately 3,000 sites.  Accessibility advocates have long held a certain amount of animosity towards the way its creators market the plugin as a quick fix solution, claiming it helps &ldquo;mitigate the risk of lawsuits.&rdquo; AccessiBe also has a well-documented history of <a href=\"https://adrianroselli.com/2020/06/accessibe-will-get-you-sued.html#Paid\">paying for positive press</a>. Dolson and others deeply involved in WordPress accessibility keep tabs on the plugin, which is how he came across the suspicious activity. </p>\n\n\n\n<p>Soliciting paid or fake reviews is not a new infraction, and it has been explicitly forbidden in the directory&rsquo;s <a href=\"https://developer.wordpress.org/plugins/wordpress-org/detailed-plugin-guidelines/\">guidelines</a> for years. This falls under guideline #9<em>: Developers and their plugins must not do anything illegal, dishonest, or morally offensive</em>, which includes &ldquo;<em>Creating accounts to generate fake reviews or support tickets (i.e. sockpuppeting)</em>.&rdquo;</p>\n\n\n\n<p>Fake and paid reviews are a blight on any marketplace, and pop up now and then on the theme and plugin directories due to the power of WordPress.org as a distributions channel for freemium products. It makes it more difficult for the consumer to get an accurate understanding of the quality of the the product, but it&rsquo;s not always easy to identify who commissioned the fake reviews.</p>\n\n\n\n<p>Any user can help ensure the plugin directory has fair and honest reviews by flagging those that look suspicious. In the sidebar of individual review posts, logged-in users can flag a post for consideration. WordPress.org doesn&rsquo;t often announce when it takes action to remove reviews but should confirm having received the report. In a rare case like this, Dolson&rsquo;s <a href=\"https://www.joedolson.com/2021/02/accessibe-the-fake-wordpress-plug-in-reviews/\">writeup</a> gives the wider community a glimpse into what it takes to track down fake reviews and get them cleaned up.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 18 Feb 2021 23:10:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"WPTavern: GermanThemes Releases Block-Ready GT Basic WordPress Theme With Custom Patterns\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112276\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:223:\"https://wptavern.com/germanthemes-releases-block-ready-gt-basic-wordpress-theme-with-custom-patterns?utm_source=rss&utm_medium=rss&utm_campaign=germanthemes-releases-block-ready-gt-basic-wordpress-theme-with-custom-patterns\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5100:\"<img />\n\n\n\n<p class=\"has-drop-cap\">Today, <a href=\"https://wordpress.org/themes/gt-basic/\">GT Basic</a> became the second theme from GermanThemes to go live in the WordPress theme directory. Like the company&rsquo;s previous theme, <a href=\"https://wordpress.org/themes/gt-ambition/\">GT Ambition</a>, it is built around the block editor. It also introduces several custom block patterns.</p>\n\n\n\n<p>The theme will not knock anyone&rsquo;s socks off with its artistic merit. GT Basic is very much <em>business in the front and business in the back</em>, so it will not immediately appeal to everyone. However, it has everything you need and none of the things you don&rsquo;t for setting up a WordPress website.</p>\n\n\n\n<p>Out of the box, it is an architecturally-sound business theme. Its layout, structure, and typography make for a well-rounded design applicable to nearly any site. With a few modifications via the customizer, users can personalize it.</p>\n\n\n\n<p>Its open-canvas feel gives ample room for using the entire content area for building custom page layouts, which is what business site owners should be looking for. The theme&rsquo;s typography is on-point, creating a comfortable reading atmosphere for long-form content. It could serve well for a general blogging theme.</p>\n\n\n\n<p>The theme is ripe for the possibility of child themes. These types of well-designed themes from a purely structural standpoint leave plenty of room for customization. GT Basic has just the right amount of visual options for users to put their unique spins on it. However, there is a lot of room for design-savvy people to do more.</p>\n\n\n\n<h2>About the Theme</h2>\n\n\n\n<p class=\"has-drop-cap\">GT Basic is, well, a <em>basic</em> theme. It is kind of there in the name. However, it includes enough options to make it more visually palatable. A few color and font changes could spice things up &mdash; the theme offers a range of system and Google font-family choices.</p>\n\n\n\n<img />Modifying the theme&rsquo;s typography and colors.\n\n\n\n<p>The theme also manages to not make a complete and utter mess of the customizer. GT Basic neatly tucks all of its options under a custom panel named Theme Options. Even its &ldquo;theme links&rdquo; section is in there. It is refreshing to see a theme not regurgitate pro links and single-use sections across the entire customizer controls frame. You will rarely see me use emoji, but the theme author deserves one on this point alone: &#128079;.</p>\n\n\n\n<p>Where the theme gets things right is its support of the block editor. It does not try to do too much, relying on the core block styles as a foundation. It then tacks on a mere 46kb of additional CSS, unminifed, which is almost unheard of in today&rsquo;s theme market.</p>\n\n\n\n<img />Block design in the <a href=\"https://demo.germanthemes.de/?demo=gt-basic-bakery\">cafe demo</a> for the theme.\n\n\n\n<p>GT Basic is one of the few themes I have seen that adds a custom block editor sidebar panel. Instead of going the page template route, it adds a full-width option, a method I have preferred over the years. It also has settings for users to disable the title and remove white space at the end of the content area.</p>\n\n\n\n<p>The biggest downside to the theme is that the blog/posts page and archives display the full post instead of excerpts. It is one of my pet-peeves with theme design. Users should at least have the option to switch to an excerpt view.</p>\n\n\n\n<p>The other cringe-worthy feature is the automatic output of the featured image alongside the full post content. This creates the dreaded double featured-image effect if the user also uses the same image within their post content. Again, a simple option to disable this would suffice.</p>\n\n\n\n<h2>Block Patterns</h2>\n\n\n\n<img />Inserting GT Basic&rsquo;s portfolio block pattern.\n\n\n\n<p class=\"has-drop-cap\">I am a sucker for block patterns. Throw a few in any theme, and I will install it and see what I can build. The pattern system remains one of my favorite features of WordPress. It is also one of the areas where business themes can make their mark.</p>\n\n\n\n<p>GT Basic includes four patterns for users:</p>\n\n\n\n<ul><li>Hero Section</li><li>Services</li><li>Call to Action</li><li>Portfolio</li></ul>\n\n\n\n<p>It does not take much to create unique layouts by mixing and matching two or more of them.</p>\n\n\n\n<p>Thomas Weichselbaumer, the founder of GermanThemes, <a href=\"https://germanthemes.de/en/2020/08/28/introducing-block-patterns-in-our-themes/\">announced the adoption of block patterns</a> in August 2020. He introduced block patterns across GermanThemes&rsquo; product line shortly after WordPress 5.5 introduced the feature.</p>\n\n\n\n<p>GT Basic&rsquo;s patterns would be more appealing if they included imagery and a spectrum of colors. The pattern layouts are designed well, but they lack the visual <em>umph</em> that inspires users. This is a missed opportunity to showcase how useful the patterns are. However, the theme author has <a href=\"https://germanthemes.de/themes/gt-basic/\">built a few demos</a> that could serve as inspiration.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 18 Feb 2021 22:52:15 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"WPTavern: Ask the Bartender: Frustrations and Finding the Right WordPress Block Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112071\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:217:\"https://wptavern.com/ask-the-bartender-frustrations-and-finding-the-right-wordpress-block-plugins?utm_source=rss&utm_medium=rss&utm_campaign=ask-the-bartender-frustrations-and-finding-the-right-wordpress-block-plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9141:\"<blockquote class=\"wp-block-quote\"><p>Hello. I always supported the idea of a WordPress block editor as a whole, but lately, I&rsquo;m a bit frustrated in that there are some blocks I need with urgency to work on a (non-visitor editable) wiki-like site (mostly a Tabs block, a Countdown block, an Accordion/Toggle block, a Table of contents block and a Footnotes block) and have not had luck finding appropriate plugins. I can name a long list of the specific problems I have with the ones available right now&hellip;</p><p>Andr&eacute;s</p></blockquote>\n\n\n\n<p class=\"has-drop-cap\">Andr&eacute;s&rsquo; question spanned another 400 words or so. The following summarizes the problems he has run into:</p>\n\n\n\n<ul><li>Block collection plugins cover some but not all use cases.</li><li>Seemingly suitable blocks have too few or too many options.</li><li>Few blocks can be converted to other block types.</li><li>Many block plugins have not been updated in a while, causing fear of abandonment.</li><li>No way to batch convert blocks if a better plugin is found.</li><li>Need a footnotes block.</li></ul>\n\n\n\n<p>I do not necessarily see most of these as block-related problems. It can be tough to find that sweet spot, fine-tuning your WordPress site with <em>just</em> the right tools.</p>\n\n\n\n<p>When I first began using WordPress in 2005, I hit these same sorts of problems. And they were problems throughout my career as a developer. I would find a plugin that would do almost what I wanted. I would find another that would add way too many unnecessary features. Often, nothing seemed to exist that was perfect for my needs. This was the sole reason I jumped into development &mdash; <em>if you want something done right, do it yourself</em>. I wanted my WordPress site to work according to my own strict specifications. No one else would do it for me, and I was a starving college student who could not afford to hire a developer. It left me little choice other than putting in the time and effort to make it happen.</p>\n\n\n\n<p>While I am not suggesting that you must go down the path that I once did, it is always an option worth exploring. Many great developers began with this same type of frustration. They had a problem and needed a fix for it.</p>\n\n\n\n<p>Open-source is about giving and taking. When you cannot pay it forward in terms of code, feedback is always welcome. That is one reason I like to highlight these questions. Even when I do not have the answer, maybe someone else will. Perhaps your requests will spark an idea for one of the many developers who read WP Tavern.</p>\n\n\n\n<p>I definitely do not have all the answers to this laundry-list of questions. It is a broad subject that will take a community to solve.</p>\n\n\n\n<p>Many of your issues might be handled by nothing more than having a conversation with the developers behind the block collection plugins you are using. Step one is to start a dialogue with them. I bet most are willing to listen to your ideas on how they can improve their products as long as you address them constructively.</p>\n\n\n\n<h2>Try One-Off Block plugins</h2>\n\n\n\n<img />Installing a single-use block from the editor.\n\n\n\n<p class=\"has-drop-cap\">The future of using blocks is going to be far more about finding and installing individual blocks rather than collections. WordPress has done its users a disservice by not actively promoting these one-off block plugins. We are over two years into the block editor and still do not have a <a href=\"https://wptavern.com/version-1-prototype-of-the-wordpress-admin-block-directory-announced\">block directory and management screen</a> built directly into the software. Sure, users can search via the block inserter directly from the editor, but it does not replace a full management experience.</p>\n\n\n\n<p>This missing feature has helped spur massive library plugins, which have become the <em>de facto</em> method that most users find new blocks. Far too many plugin developers are following the Jetpack model of packaging them all together. Without full block management baked into core, this trend will only continue. At this point, it may be hard to break from the mold.</p>\n\n\n\n<p>However, you can still find a listing of available single-use blocks from the <a href=\"https://wordpress.org/plugins/browse/block/\">block directory on WordPress.org</a>, at least the ones that plugin authors have appropriately tagged.</p>\n\n\n\n<img />WordPress block directory.\n\n\n\n<p>I recommend testing these blocks before diving into a library-type plugin. There is always the risk of developer abandonment &mdash; there is nothing you can really do about that when it comes to any type of plugin other than supporting the authors.</p>\n\n\n\n<p>The block directory&rsquo;s problem is that it has only a little over 120 blocks &mdash; <em>like I said, WordPress has not done enough to promote it</em>. This means there is not enough competition to drive innovation and bring clear winners to the forefront. Some of the blocks are hit-or-miss projects. I know this does not breed confidence, but I can say from experience that I always loved user feedback as a developer. It is the lifeblood of any project. Give the plugins a test. Even if you do not like or use them, send your feedback over to the developers.</p>\n\n\n\n<p>The following is a short, not comprehensive, list of some single-use blocks that may be appropriate for you:</p>\n\n\n\n<ul><li><strong>Table of Contents:</strong><br />&ndash; <a href=\"https://wordpress.org/plugins/table-of-contents-block/\">Table of Contents Block</a> by WPDeveloper<br />&ndash; <a href=\"https://wordpress.org/plugins/table-of-contents/\">Table of Contents</a> by Achal Jain</li><li><strong>Countdown:</strong><br />&ndash; <a href=\"https://wordpress.org/plugins/wp-countdown-block/\">WP Countdown Block</a> by Achal Jain<br />&ndash; <a href=\"https://wordpress.org/plugins/countdown-block/\">Countdown Block</a> by WPDeveloper</li><li><strong>Accordion/Toggle:</strong><br />&ndash; <a href=\"https://wordpress.org/plugins/accordion-blocks/\">Accordion Blocks</a> by Phil Buchanan<br />&ndash; <a href=\"https://wordpress.org/plugins/accordion-toggle/\">Accordion Toggle</a> by WPDeveloper<br />&ndash; <a href=\"https://wordpress.org/plugins/details-summary-block\">Details Summary Block</a> by Denis &#381;oljom<br />&ndash; <a href=\"https://wordpress.org/plugins/hot-accordion/\">Hot Accordion</a> by HotThemes</li></ul>\n\n\n\n<h2>Footnotes Block Plugin</h2>\n\n\n\n<img />\n\n\n\n<p class=\"has-drop-cap\">I feel your frustration about footnotes. WordPress lacks this feature that any decent desktop-level writing software has. From past experience earning my B.A. in English, footnotes were a core part of the experience. It baffles me that the most-used CMS in the world has yet to add even a basic version of footnotes to its toolset.</p>\n\n\n\n<p>Fortunately, other like-minded people want to see footnotes in WordPress. Ella van Durpe has a <a href=\"https://github.com/WordPress/gutenberg/pull/28261\">draft of a footnotes feature</a> on the Gutenberg repository. This is an ongoing, <a href=\"https://github.com/WordPress/gutenberg/issues/1890\">three-year discussion</a>. There is no reason to believe it will be baked into core soon, but it is reason enough to be hopeful.</p>\n\n\n\n<p>The <a href=\"https://wordpress.org/plugins/academic-bloggers-toolkit/\">Academic Blogger&rsquo;s Toolkit</a> plugin supports footnotes. It has not been updated in a year and could be overkill for what you need. However, it would not hurt to give it a test run.</p>\n\n\n\n<p>Several <a href=\"https://wordpress.org/plugins/search/footnotes/\">footnote plugins in the directory</a> should work fine with the block editor. The standard method employed by many of them uses a <code>((double-parentheses))</code> to add footnotes from within the editor. Those notes are then parsed before being displayed on the front end.</p>\n\n\n\n<p>That is not my style. I prefer the visual separation of the references and the footnotes in both the editor and the front end. The great thing about the block editor is that you can manually build footnotes without a plugin. Or, at least you can create <em>almost-footnotes</em>.</p>\n\n\n\n<p>Cathy Meder-Dempsey, a genealogist and blogger for Opening Doors in Brick Walls, has an <a href=\"https://openingdoorsinbrickwalls.wordpress.com/2020/10/23/adding-footnotes-to-your-wordpress-posts-using-block-editor/\">exhaustive tutorial</a> on manually adding references and a footnotes section with the block editor. It is not a perfect solution and works best when you have only a few footnotes. This is because the reference links jump to the overall footnotes section rather than the individual notes. It is a quick solution in a pinch.</p>\n\n\n\n<p class=\"is-style-highlight has-white-color has-blue-700-background-color has-text-color has-background text-white bg-blue-700\">This post is a part of the <a href=\"https://wptavern.com/tag/ask-the-bartender\">Ask the Bartender</a> series.  If you have a question about WordPress, feel free to <a href=\"https://wptavern.com/contact-me/ask-the-bartender\">shoot it over.</a>  Your question could be featured next.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Feb 2021 22:34:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WPTavern: Gutenberg Plugin Marks 100th Release with 10.0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112179\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:157:\"https://wptavern.com/gutenberg-plugin-marks-100th-release-with-10-0?utm_source=rss&utm_medium=rss&utm_campaign=gutenberg-plugin-marks-100th-release-with-10-0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5374:\"<p><a href=\"https://make.wordpress.org/core/2021/02/17/whats-new-in-gutenberg-10-0-february/\">Gutenberg 10.0</a> was released today as the 100th iteration of the block editor since the project began four years ago. Although 10.0 may seem like a big number, it&rsquo;s just another incremental step forward in terms of new features, improvements, and bug fixes. </p>\n\n\n\n<p>Version 10.0 introduces a new dynamic <a href=\"https://github.com/WordPress/gutenberg/pull/28265\">pages block</a> for building navigation menus. It can be added inside a Navigation block or used on its own.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Sometimes when you&rsquo;re clicking around inside block editor content, it&rsquo;s hard to select the parent block with nested blocks. This release makes the <a href=\"https://github.com/WordPress/gutenberg/pull/28598\">parent block selector visible</a> and offset in the block toolbar. An easier way to select the parent block will become even more important as the quote block is on track to <a href=\"https://github.com/WordPress/gutenberg/pull/25892\">get nesting support</a> with paragraph, heading, list, and code blocks allowed as children.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Version 10.0 adds a darker social links state for dark themes, brings block patterns to the inserter for template parts and other non-root level positions, and improves keyboard navigation in the block patterns inserter. The plugin also introduced dozens of improvements and new features to the experiments in progress for the site editor, full-site editing architecture and blocks, as well as the navigation and block-based widgets screens. </p>\n\n\n\n<p>Riad Benguella marked the 100th release milestone with a few reflections from his unique vantage point as a technical lead on the project. He commented on the friction and pushback that contributors had to navigate in Gutenberg&rsquo;s earlier days:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>With all the attention that the project received, it became difficult to discern constructive debate from mere opposition. We each come with our own context, and some people had a fixed idea about what they wanted for the project. Some wanted to just reuse an existing page builder, others wanted to revive the Fields&nbsp;API&nbsp;project, some wanted it to be front-end-first, others wanted it to just replace the content area of the classic editor, some wanted it to be in Vue.JS, others wanted no change at all. With a product used by 40% of the web, we need to find consensus, and when we make compromises it can be so difficult for those involved to avoid the feeling that their voice is being ignored.</p></blockquote>\n\n\n\n<p>He admits that the project made a few mistakes along the way with sub-par stability on some releases, and performance and accessibility issues. In spite of all the difficulties contributors encountered, they have been able to win over many users who were initially not excited about the block editor.</p>\n\n\n\n<p>&ldquo;It&rsquo;s a delight to see some people who had very strongly disagreed with the initial vision or approach to Gutenberg gradually come to enjoy using the editor and join the project to carry on its vision,&rdquo; Benguella said. &ldquo;Others might still not like it, some won&rsquo;t ever use it. One thing is certain though, we&rsquo;ll continue doing our best to push forward, improve what&rsquo;s already shipped and ship new exciting features; we&rsquo;ll continue making mistakes and hopefully continue learning from them.&rdquo;</p>\n\n\n\n<p>The block editor has opened up a whole new category of tools for people building WordPress sites, even before full-site editing makes its debut. In the comments of the release post, Gutenberg users mentioned the themes and plugins that have helped them ramp up into delivering sites built 100% with the block editor.</p>\n\n\n\n<p>&ldquo;When I first looked at&nbsp;Gutenberg&nbsp;I hated it,&rdquo; web developer John Brown said. &ldquo;Now, two years on, do a mix of Gutenberg and Kadence Theme and blocks and you can build virtually anything.</p>\n\n\n\n<p>&ldquo;The sites we have converted from other page builders to Gutenberg work just fine and we get great statistics on GTMetrix, Pingdom and Google Page Speeds.</p>\n\n\n\n<p>&ldquo;I will say, you need to learn how to use it, but when you get your head around it, you can make anything that a client needs.&rdquo;</p>\n\n\n\n<p>Another user who adopted the editor in the early stages said he has reached the point where he can build sites without having to use a lot of extra tools.</p>\n\n\n\n<p>&ldquo;I started using&nbsp;Gutenberg&nbsp;at 2.0 and never looked back since then,&rdquo; software engineer Orlando Alonzo said. &ldquo;Now I&rsquo;m starting to produce full sites with nothing more than GeneratePress Premium and Gutenberg.&rdquo; </p>\n\n\n\n<p>Version 10.0 marches forward with the same pioneering experimentation in the full-site editing (FSE) project that has brought the editor to the stable state it&rsquo;s in today. Contributors are aiming for an MVP for FSE in April, with version 1 in core in WordPress 5.8, expected June 2021. Check out the <a href=\"https://make.wordpress.org/core/2021/02/17/whats-new-in-gutenberg-10-0-february/\">10.0 release post</a> for the full details on FSE progress and other improvements to the editor.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Feb 2021 21:43:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"BuddyPress: BuddyPress 7.2.0 Maintenance Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=317263\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://buddypress.org/2021/02/buddypress-7-2-0-maintenance-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:921:\"<p>Immediately available is <a href=\"https://downloads.wordpress.org/plugin/buddypress.7.2.0.zip\">BuddyPress 7.2.0</a>. This maintenance release fixes six bugs mainly related to issues when the BP Nouveau Template Pack is used with the Twenty Twenty-One WordPress theme. For details on the changes, please read the <a href=\"https://codex.buddypress.org/releases/version-7-2-0/\">7.2.0 release notes</a>.</p>\n\n\n\n<p>Update to BuddyPress 7.2.0 today in your WordPress Dashboard, or by&nbsp;<a href=\"https://wordpress.org/plugins/buddypress/\">downloading from the WordPress.org plugin repository</a>.</p>\n\n\n\n<h2>Many thanks to 7.2.0 contributors&nbsp;<span class=\"dashicons dashicons-heart\"></span></h2>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/iamthewebb\">iamthewebb</a>,&nbsp;<a href=\"https://profiles.wordpress.org/vapvarun/\">vapvarun</a>&nbsp;&amp;&nbsp;<a href=\"https://profiles.wordpress.org/imath/\">imath</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 17 Feb 2021 20:01:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WPTavern: Phoenix, a Block-Based WordPress Theme With a Sidebar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112133\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:169:\"https://wptavern.com/phoenix-a-block-based-wordpress-theme-with-a-sidebar?utm_source=rss&utm_medium=rss&utm_campaign=phoenix-a-block-based-wordpress-theme-with-a-sidebar\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5013:\"<p class=\"has-drop-cap\">Earlier today, the <a href=\"https://github.com/WordPress/theme-experiments/pull/155\">Phoenix theme was merged</a> into the WordPress Theme Experiments repository on GitHub. Like all themes in the repo, it is not meant for use on a live site. It is a project to test new ideas for the upcoming Full Site Editing (FSE) system.</p>\n\n\n\n<p>Imran Sayed of Codeytek Academy created the theme and is hosting a <a href=\"https://phoenix.codeytek.com/\">live demo</a>.  Those who want to give it a test drive can grab the <a href=\"https://github.com/WordPress/theme-experiments/tree/master/phoenix\">code from GitHub</a>.</p>\n\n\n\n<p>Until now, every block-based theme I have seen has been missing a left or right sidebar. I am a fan of the open-canvas format that focuses on content, hiding the often-frivolous widgets that only detract from the important bits. However, sidebars are sometimes useful and even necessary.</p>\n\n\n\n<p>When I refer to a &ldquo;sidebar,&rdquo; I am not talking about the dynamic sidebar system of widgets that we have all come to love or hate since WordPress 2.2. That system <a href=\"https://wptavern.com/gutenberg-9-3-provides-indicator-of-where-full-site-editing-is-going-a-future-without-widgets-and-customizer-screens\">no longer exists in the world of FSE</a>. The site editor merely has a concept of templates and template parts, which are containers for blocks. It is up to the theme author to give some default structure, even building template parts that work like sidebars.</p>\n\n\n\n<p>A sidebar in the Phoenix theme literally means a block area on the side of the page.</p>\n\n\n\n<p>It is such a simple idea, one that is nearly as old as blogs. It hardly seems something worth getting excited about, but I have been waiting a while to see a block-based theme with a sidebar. The feature further legitimatizes the path that WordPress is heading down. The greater theme development community needs to see these simple architectural ideas put into action. They need to see someone saying, &ldquo;Hey, here&rsquo;s how you do this simple thing you&rsquo;ve been doing for a decade in this new system.&rdquo;</p>\n\n\n\n<p>Phoenix only adds a sidebar on the front page, but this is a start.</p>\n\n\n\n<p>The theme is also more ambitious than some previous attempts by mixing static and dynamic features on the front page. Phoenix includes a header area with the standard site title and a nav menu. Below that, it adds a static hero section that users can customize.</p>\n\n\n\n<img />Front page hero section.\n\n\n\n<p>It then uses the Columns block to split the content and sidebar. On the left, the theme uses the Query block to list the latest posts. On the right, it adds a sidebar template part.</p>\n\n\n\n<img />Latest blog posts section next to sidebar.\n\n\n\n<p>The footer design is also bold in comparison to some other block-based themes so far. It has a full-width Cover block, which is followed by a group of columns, which is basically what a footer <em>sidebar</em> is.</p>\n\n\n\n<img />Large footer area with columns.\n\n\n\n<p>Again, these are basic concepts that theme authors have been doing for ages. The idea behind many of these experimental themes is to start testing how to make them a reality using blocks. By the time the site editor lands in WordPress, theme authors can build upon these initial techniques and create more complex layouts.</p>\n\n\n\n<p>This is especially the case with front-page design. If there is one area that has created roadblock upon roadblock when developing traditional themes, it has been the front page. Whether through custom options pages, the theme customizer, widgets, or a host of other solutions, nothing has stuck for well over a decade now. While the single post template is arguably the most important view on a WordPress website, it is the front page design that draws in the average user. It is also one of the biggest points of failure after users install a theme. That carefully-crafted front page in the demo looks nothing like what the users see on their own sites.</p>\n\n\n\n<p>Phoenix is a step in the right direction because it shows how to mix these basic elements. Because it is a block-based theme, end-users have instant visual feedback in the site editor if they want to customize it.</p>\n\n\n\n<p>The next step is for more themers to get involved in the Theme Experiments project. Start exploring more complex ideas and layouts. Use this moment to share knowledge and build upon the work that so few others are doing right now.</p>\n\n\n\n<p>Phoenix is by no means a perfect theme. The front end and the site editor are not a one-to-one match at this point. Everything that looks wrong with it in the editor highlights just how far we have left to go.</p>\n\n\n\n<p>I am carefully maintaining hope while being a realist about where FSE will be in 2021. This is a year for exploration. Perhaps we will have a few breakout themes that push the envelope toward the end of the year, but it all starts with experimental projects like Phoenix.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Feb 2021 23:07:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WPTavern: Easy Digital Downloads 3.0 Now in Public Beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112130\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:155:\"https://wptavern.com/easy-digital-downloads-3-0-now-in-public-beta?utm_source=rss&utm_medium=rss&utm_campaign=easy-digital-downloads-3-0-now-in-public-beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2646:\"<p><a href=\"https://easydigitaldownloads.com/\">Easy Digital Downloads</a> (EDD) is coming up on a major milestone with version 3.0 in active development, a huge undertaking spanning nearly three years. The <a href=\"https://easydigitaldownloads.com/development/2021/02/16/edd-3-0-beta1/\">first beta</a> was released today with one of the most extensive and technically detailed beta testing guides I&rsquo;ve seen for a major plugin update. </p>\n\n\n\n<p>Version 3.0 will migrate the bulk of EDD data out of WordPress core tables to custom database tables. During the lifespan of this nearly 10-year old plugin, practices have changed regarding the use of custom tables and the coming update will bring improvements to performance and data structures. Testers can <a href=\"https://github.com/easydigitaldownloads/easy-digital-downloads/releases/download/3.0-beta1/easy-digital-downloads.zip\">download it from GitHub</a> and go through the data migration process. The beta testing guide specifies a list of seven tables to check after migration to ensure there are no issues with data transfer or backwards compatibility.</p>\n\n\n\n<p>The release post noted that the order refund functionality is still in development and will not yet be ready for testing until the beta 2 release.</p>\n\n\n\n<p>EDD first came on the scene in 2012. Inspired by Jigoshop and WooCommerce&rsquo;s successes with the &ldquo;extensions marketplace&rdquo; business model, EDD creator Pippin Williamson has <a href=\"https://wptavern.com/pippin-williamson-on-building-a-community-around-your-open-source-project\">prioritized extensibility</a> from the beginning. There are now more than 102 official extensions and themes, and hundreds more <a href=\"https://easydigitaldownloads.com/3rd-party-extensions/\">third-party extensions</a>. Anytime EDD core moves forward with major changes, the wide community of extensions is a critical consideration.</p>\n\n\n\n<p>For this reason, EDD is pursuing a strategy of releasing a series of updates to as many extensions as possible that contain compatibility with 3.0. The announcement lists eight extensions, including Stripe Gateway, Software Licensing, PDF Invoices, Commissions, and others which have been updated and can be used in testing.</p>\n\n\n\n<p>EDD is also encouraging third-party developers to check out the 3.0 code base and ensure compatibility ahead of the official release.  WordPress freelancers and agencies who have clients using EDD will want to test out the 3.0 beta 1 ahead of time to find any concerns with data migration that would prevent their clients from having a smooth transition when the official release drops.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Feb 2021 23:03:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WordPress.org blog: WordPress 5.7 Beta 3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9727\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4753:\"<p>WordPress 5.7 Beta 3 is now available for testing! <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" /></p>\n\n\n\n<p><strong>This software is still in development,</strong>&nbsp;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with it.</p>\n\n\n\n<p>You can test the WordPress 5.7 Beta 3 in two ways:</p>\n\n\n\n<ul><li>Install/activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (select the&nbsp;<code>Bleeding edge</code>&nbsp;channel and the&nbsp;<code>Beta/RC Only</code> stream)</li><li>Direct download the beta version here (<a href=\"https://wordpress.org/wordpress-5.7-beta3.zip\">zip</a>).</li></ul>\n\n\n\n<p>The current target for final release is March 9, 2021. That’s just <strong>three weeks away</strong>, so your help is vital to making sure that the final release is as good as it can be.</p>\n\n\n\n<h2><strong>Some Highlights</strong></h2>\n\n\n\n<p>Since <a href=\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-2/\">Beta 2</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&changetime=02%2F10%2F2021..02%2F17%2F2021&milestone=5.7&group=component&max=500&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">27</a> bugs have been fixed. Here is a summary of some of the included changes:</p>\n\n\n\n<ul><li>Adjusted color contrast on various admin buttons to improve accessibility and readability (<a href=\"https://core.trac.wordpress.org/ticket/52402\">#52402</a>)</li><li>Several fixes for the Twenty Twenty-One theme (<a href=\"https://core.trac.wordpress.org/ticket/52287\">#52287</a>, <a href=\"https://core.trac.wordpress.org/ticket/52377\">#52377</a>, <a href=\"https://core.trac.wordpress.org/ticket/52431\">#52431</a>, <a href=\"https://core.trac.wordpress.org/ticket/52500\">#52500</a>, <a href=\"https://wordpress.org/news/feed/#52502\">#5</a><a href=\"https://core.trac.wordpress.org/ticket/52502\">2</a><a href=\"https://wordpress.org/news/feed/#52502\">502</a>, <a href=\"https://core.trac.wordpress.org/ticket/52412\">#52412</a>)</li><li>Replaced editor typeface with system fonts to improve privacy and performance (<a href=\"https://wordpress.org/news/feed/#46169\">#46169</a>)</li><li>Added i18n support to <code>register_block_type_from_metadata</code> function (<a href=\"https://core.trac.wordpress.org/ticket/52301\">#52301</a>)</li><li>Media upload errors are now more accessible (<a href=\"https://core.trac.wordpress.org/ticket/47120\">#47120</a>)</li><li>New filter to modify how pagination links are rendered when using <code>paginate_links</code> function (<a href=\"https://core.trac.wordpress.org/ticket/44018\">#44018</a>)</li></ul>\n\n\n\n<h2><strong>How You Can Help</strong></h2>\n\n\n\n<p>Watch the Make WordPress Core blog for 5.7-related developer notes in the coming weeks, which will break down these and other changes in greater detail.</p>\n\n\n\n<p>So far, contributors have fixed <a href=\"https://core.trac.wordpress.org/query?status=closed&changetime=..02%2F16%2F2021&milestone=5.7&group=component&max=500&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">171 tickets in WordPress 5.7</a>, including <a href=\"https://core.trac.wordpress.org/query?status=closed&status=reopened&changetime=..02%2F16%2F2021&type=enhancement&type=feature+request&milestone=5.7&group=component&col=id&col=summary&col=type&col=status&col=milestone&col=changetime&col=owner&col=priority&col=keywords&order=changetime\">64 new features and enhancements</a>, and more bug fixes are on the way.</p>\n\n\n\n<p><strong>Do some testing!</strong></p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/handbook/testing/beta-testing/\">Testing for bugs</a> is a vital part of polishing the release during the beta stage and a great way to contribute. <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" /></p>\n\n\n\n<p>If you think you’ve found a bug, please post to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta</a> area in the support forums. We would love to hear from you! If you’re comfortable writing a reproducible bug report, file one on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. That’s also where you can find a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p><em>Props to <a href=\"https://profiles.wordpress.org/audrasjb/\">@audrasjb</a> and <a href=\"https://profiles.wordpress.org/lukecarbis/\">@lukecarbis</a> for your peer revisions.</em></p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p><em>Finish line ahead<br />Defects in focus<br />We are almost there&#8230;</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Feb 2021 21:25:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ebonie Butler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WPTavern: Video: Matt Mullenweg and Josepha Haden Chomphosy Join WordCamp India for Fireside Chat\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112036\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:237:\"https://wptavern.com/video-matt-mullenweg-and-josepha-haden-chomphosy-join-wordcamp-india-for-fireside-chat?utm_source=rss&utm_medium=rss&utm_campaign=video-matt-mullenweg-and-josepha-haden-chomphosy-join-wordcamp-india-for-fireside-chat\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4002:\"<p>If you are living in part of the world where the polar vortex has plunged the weather into record-cold temperatures, you might enjoy this fireside chat from <a href=\"https://india.wordcamp.org/2021/\">WordCamp India 2021</a>. The event was held online over the span of three weekends from Jan 30 to Feb 14. Matt Mullenweg and Josepha Haden Chomphosy joined organizers over the weekend for an invigorating conversation about India and the global WordPress community. </p>\n\n\n\n<p>One of the opening questions from the audience was about the growth of newsletter services like <a href=\"https://substack.com/\">Substack</a>, which seem no different from a WordPress-powered blog with emailing features. The audience asked how WordPress can help people who want to start their own newsletter service. </p>\n\n\n\n<p>Mullenweg said that although &ldquo;pretty much everything is possible in WordPress,&rdquo; some things require putting together many different plugins and might have a higher barrier to entry:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>I think there&rsquo;s two ways we can address that. One is by education. People can actually get through a lot steps if there is a good guide. A great guide around how to build something just like Substack on your WordPress blog where you own everything would be really valuable and popular. Second, when we make that guide we will probably see some steps that we could eliminate or smooth, friction points which we could make easier for people to get through. Whenever we see something like a Substack pop up on the market, I think it&rsquo;s a great moment for reflection to see where can that educate us to where we can improve our own product, plugins, and educational material.</p></blockquote>\n\n\n\n<p>Mullenweg also shared that Automattic has just made &ldquo;a pretty large investment&rdquo; in <a href=\"https://titan.email/\">Titan</a>, a company based in India, which he said will be a big part of how WordPress.com offers email going forward.</p>\n\n\n\n<p>Josepha Haden Chomphosy gave an update on what&rsquo;s next for in-person events, which may resume later in 2021 if things go well:  </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>In the short term, the future of WordCamps is very careful. There&rsquo;s an ongoing conversation about how we can bring everybody back together in a way that keeps us connected and provides all of that normal WordPress feeling but also is incredibly safe. It&rsquo;s hard. There&rsquo;s a lot of unknown stuff, but the success with the vaccinations we have seen so far is really heartening. Fingers crossed we can start allowing quite small in-person events starting in Q3 of 2021. </p></blockquote>\n\n\n\n<p>Haden Chomphosy also indicated that hybrid events may be here to stay, streaming to an online audience with captioning and translation available when possible, to make in-person events more accessible:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>We can, with a little bit of pre-planning and with a little bit of intention, make sure that our events, even if they are in person, have an online component that helps to make sure the education that we&rsquo;re trying to provide there gets to as many people as possible without having that barrier to entry of having to physically go to a place and pay your time to get there and pay your money to get there. I&rsquo;m hoping that we see a little more consistent planning about that in our in person events so we can keep offering a more global mindset to our events overall.</p></blockquote>\n\n\n\n<p>She touched on the topic of training and education, noting that WordPress&rsquo; 0-101 level content is somewhat lacking. This critical &ldquo;make or break&rdquo; onboarding stage could be improved for many users.</p>\n\n\n\n<p>They also discussed the need for attracting a younger generation of contributors that WordPress veterans can mentor to infuse new life into the project. Check out the recording below.</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Feb 2021 03:11:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Newspack Newsletters Now Live in the WordPress Plugin Directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=112065\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:191:\"https://wptavern.com/newspack-newsletters-now-live-in-the-wordpress-plugin-directory?utm_source=rss&utm_medium=rss&utm_campaign=newspack-newsletters-now-live-in-the-wordpress-plugin-directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6576:\"<p class=\"has-drop-cap\">Automattic released its <a href=\"https://wordpress.org/plugins/newspack-newsletters/\">Newspack Newsletters</a> project to the WordPress plugin directory earlier today. It is the first Newspack-related plugin the company has made available outside of GitHub or its custom platform.</p>\n\n\n\n<p><a href=\"https://newspack.pub/\">Newspack</a> is primarily a service geared toward small and medium-sized publications. Its goal is to work with news industry leaders to create a platform for bringing WordPress to more newsrooms worldwide. El Soberano, a Chilean news publication, became the <a href=\"https://wptavern.com/chilean-news-publication-el-soberano-first-to-launch-on-newspack\">first site to launch</a> on the service in October 2019. Earlier this month, Newspack <a href=\"https://wptavern.com/newspack-publishes-showcase-with-60-newsrooms-launched\">showcased 60 sites</a> running on the platform.</p>\n\n\n\n<p>The platform is more than one theme, plugin, or service. The code is open-source, <a href=\"https://github.com/Automattic?q=newspack\">available on GitHub</a>, and free for anyone to use via self-hosted WordPress. Each plugin is built based on feedback between publishers and the Newspack development team to solve real-world problems for publications.</p>\n\n\n\n<p><em>The downside?</em> Until now, the various Newspack plugins have all been hosted on GitHub, which is a developer-centric platform.</p>\n\n\n\n<p>Small newsrooms may not have an onboard developer or IT team. The discoverability of necessary plugins will often happen through WordPress.org. With Newspack Newsletters landing in the plugin directory, it could be an indication of things to come.</p>\n\n\n\n<p>The Newspack team should not stop with their first plugin. The entire suite of tools should be available through the plugin directory. The <a href=\"https://github.com/Automattic/newspack-blocks\">Newspack Blocks</a> plugin could have uses outside of news sites. Many users might find value in its Post Carousel block or various patterns. The <a href=\"https://github.com/Automattic/newspack-content-converter\">Newspack Content Converter</a> bulk-converts classic WordPress posts to the block system. Even the <a href=\"https://github.com/Automattic/newspack-theme\">Newspack theme</a> and its child themes should have a home on the official WordPress theme directory.</p>\n\n\n\n<p>&ldquo;We are planning to release the Newspack Content Converter on WordPress.org next, which is expected to happen in the next two months,&rdquo; said Newspack lead Jeff Rabb. &ldquo;Newspack has used this plugin on nearly every site we&rsquo;ve launched to convert massive archives to Gutenberg, and we suspect this functionality will be very useful to the community. Several of Newspack&rsquo;s blocks are already available on WordPress.org through the WordPress.com Editing Toolkit. The toolkit plugin includes the Blog Posts and Post Carousel blocks, both of which originate from the Newspack Blocks plugin. We&rsquo;ll continue to examine whether other products our team is developing may be of wider use to the community, and release on WordPress.org as appropriate.&rdquo;</p>\n\n\n\n<h2>How the Plugin Works</h2>\n\n\n\n<p class=\"has-drop-cap\">Newspack Newsletters <a href=\"https://newspack.pub/2020/07/14/newspack-offers-free-plugin-that-builds-a-mailchimp-newsletter-without-leaving-wordpress/\">launched in July 2020</a>. The plugin initially integrated with Mailchimp. However, the team has since added Constant Contact support. It also requires integration with <a href=\"https://mjml.io/\">Mailjet Markup Language (MJML)</a> for transforming the HTML from WordPress into responsive markup for email clients.</p>\n\n\n\n<p>After installing the plugin, users must set up the API keys from the third-party services they are using. Steve Beatty has a complete walkthrough of the process in the following YouTube video:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\n\n\n\n<p>The plugin adds a new post type for managing newsletters. It works much the same way as any other post or page. When adding a newsletter, users are initially presented with four layout options:</p>\n\n\n\n<ul><li><strong>Breaking News:</strong> Displays the latest blog post and a message afterward.</li><li><strong>Daily/Weekly:</strong> Lists the latest posts from the blog and a section for sharing curated links from around the web.</li><li><strong>Daily/Weekly (No Images):</strong> An alternate version of the Daily/Weekly layout without post featured images.</li><li><strong>Support:</strong> A template for asking readers to support the publication.</li></ul>\n\n\n\n<p>Of course, these are only starting points. Users can begin from any of these four templates or wholly from scratch. The plugin also provides an option for saving newsletters as custom layouts.</p>\n\n\n\n<img />Selecting a layout from the newsletter screen.\n\n\n\n<p>While the plugin works similarly to posts and pages, it does limit the available blocks to those more suitable for emails. This subset includes text-based blocks like Paragraph, Heading, Quote, and List. It also supports few design-type blocks, images, and the plugin&rsquo;s Post Inserter block.</p>\n\n\n\n<p>The user experience is straightforward. Newsletter-specific settings are in the sidebar panel. One of the simple-but-useful features is a &ldquo;Styling&rdquo; tab that allows users to make wholesale font and color changes for a single newsletter.</p>\n\n\n\n<img />Creating and sending a test newsletter.\n\n\n\n<p>Users can even send a test email before publishing to make sure everything is in order. This feature also makes it easy to test on a local machine before deciding if the plugin is worth using in production.</p>\n\n\n\n<img />Newsletter viewed via Gmail.\n\n\n\n<p>Usage of the ads system was not immediately apparent. It was not until I ran a test email from the Edit Newsletter screen that I realized that the ad I had created was attached to the end of the email. Even after figuring this out, I still felt a disconnect between how ads worked for newsletters. There is a sidebar setting for disabling ads on the Edit Newsletter screen. Perhaps I am missing something, but ad placements should be a block the user can insert into the content canvas.</p>\n\n\n\n<p>Despite feeling at odds with the ads system in the plugin, the overall experience was mostly smooth. The plugin is not overly complex, which can sometimes be the case when a developer attempts to add too many features. Newspack Newsletters has managed to hit that Goldilocks zone that should go over well with the average end-user.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 15 Feb 2021 23:17:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:115:\"WPTavern: WordPress Contributors Discuss Scaling Back Releases: “4 Major Releases Is Not a Viable Plan in 2021”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111915\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:261:\"https://wptavern.com/wordpress-contributors-discuss-scaling-back-releases-4-major-releases-is-not-a-viable-plan-in-2021?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-contributors-discuss-scaling-back-releases-4-major-releases-is-not-a-viable-plan-in-2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4763:\"<p>WordPress contributors are considering scaling back the planned number of releases in 2021. In a post titled &ldquo;<a href=\"https://make.wordpress.org/core/2021/02/11/making-wordpress-releases-easier/\">Making WordPress Releases Easier</a>,&rdquo; WordPress&rsquo; Executive Director, Josepha Haden Chomphosy summarized three years of research on reducing the effort required to have a successful WordPress release:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>From my research, the work to automate what we can (and potentially get the project ready for more releases per year) would take 3-4 dedicated developers who are proficient in our backend tools/infrastructure, at least a project manager, 1-2 internal communications people, and probably a year or more of work (if we had all the resources, and they were working at full capacity). <strong>This means that 4 major releases is not a viable plan in 2021.</strong></p></blockquote>\n\n\n\n<p>Haden Chomphosy cited a number of challenges, including update fatigue, risk of contributor burnout, a lengthy onboarding process for contributors skilled at doing the administrative work required during a release, and a lack of seasoned core developers to keep the process moving efficiently. She identified a few improvements that could be made in the short-term to improve the experience (mentorship, triage, feature proposals, and better product/processes) but other necessary updates to automation and scaling contributors could take a year or more of work. </p>\n\n\n\n<p>The post is open for feedback but the decision to scale back the releases seems to have already been made. Ryan McCue, Director of Product at Human Made, <a href=\"https://make.wordpress.org/core/2021/02/11/making-wordpress-releases-easier/#comment-40660\">commented</a> with concerns about altering the predictability of WordPress releases and introducing what seems like a last minute change:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>The predictability of the release calendar was a major step forward for the project, and for companies and teams (including mine) building on top of&nbsp;core. We have intentionally planned and structured our year ahead with this calendar in mind. Obviously, due to the tentative nature, we weren&rsquo;t expecting dates to be final, but the overall picture seemed to be fairly clear with smaller shifts expected.</p><p>Whether WordPress does one release or twelve a year doesn&rsquo;t matter hugely to me, but ensuring it&rsquo;s predictable matters hugely for our planning, communication with clients, and for our day-to-day processes. Seeing this change pretty last moment is not encouraging, and is going to have real repercussions for us.</p><p>I sympathise with and understand the limitations of capacity and overhead of releasing more often, but changing this plan needs to be clearly communicated upfront, and with a clear plan that isn&rsquo;t going to change again.</p></blockquote>\n\n\n\n<p>Haden Chomphosy responded with clarification on the conclusion communicated in her post. Without in-person events, contributors have struggled to keep the project moving at the same pace as before. She said the previous schedule had been made without much input from the contributors who are the most impacted. </p>\n\n\n\n<p>&ldquo;Perhaps the more appropriate way to have stated my conclusion would have been: &lsquo;Barring any major changes to the available contributors and global circumstances, I don&rsquo;t see how we can ship four releases this year without creating undue strain on the team who currently runs those processes,\'&rdquo; Haden Chomphosy said.</p>\n\n\n\n<p>Component maintainers and theme/plugin developers participating in the conversation also confirmed that WordPress&rsquo; frequent updates have posed a challenge and that the risk of burnout is real. Entering into year two of a global pandemic has undeniably impacted contributors&rsquo; availability and momentum, and Haden Chomphosy&rsquo;s post seeks feedback on a way forward that will avoid putting WordPress&rsquo; dedicated contributors under additional strain.</p>\n\n\n\n<p>After this post was published, the <a href=\"https://make.wordpress.org/core/2019/11/21/tentative-release-calendar-2020-2021/\">release schedule for 2020/2021</a> was updated to show that release dates for WordPress 5.8 and beyond are yet to be confirmed.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Some stakeholders will undoubtedly be disappointed with the current lack of certainty on release dates for the upcoming year, but the <a href=\"https://make.wordpress.org/core/2021/02/11/making-wordpress-releases-easier/\">conversation</a> is still open and changes will be communicated as soon as contributors find an acceptable way forward.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Feb 2021 23:09:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: Design Lab Releases Artpop, a Block-Ready WordPress Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111904\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:177:\"https://wptavern.com/design-lab-releases-artpop-a-block-ready-wordpress-theme?utm_source=rss&utm_medium=rss&utm_campaign=design-lab-releases-artpop-a-block-ready-wordpress-theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4950:\"<p class=\"has-drop-cap\">Perhaps the fates have stepped in to prove a point. After I wrote a 2,000-word piece on the <a href=\"https://wptavern.com/upsells-barriers-and-the-end-beginning-of-the-quality-free-themes-era\">lack of quality themes</a> in the theme directory, they decided to send a message. Not once, but twice this week, a new WordPress theme has managed to catch my eye. My rational mind knows that it was just a weird twist of timing, but I am not discounting the supernatural.</p>\n\n\n\n<p>Design Lab&rsquo;s sixth theme, <a href=\"https://wordpress.org/themes/artpop/\">Artpop</a>, went live in the theme directory this week. It is marketed as a block-ready WordPress theme for blogs, portfolios, businesses, and WooCommerce shops. For the most part, it has a clean and open design that provides users a lot of wiggle room to build out pages with the block editor.</p>\n\n\n\n<p>Simplicity is the name of the game, and Artpop has it in spades. It adds just enough small touches to make some elements pop. Of course, I am a fan of the blockquote style, which is one area that theme authors can leave their signature:</p>\n\n\n\n<img />Blockquote design.\n\n\n\n<p>The theme is not without a few design issues. The typography does not lend itself well to long-form content, despite being pushed as a blogging theme. With a 760px-wide content area and 16px font-size, comfortable reading is thrown out the window. Sure, it looks good in <a href=\"https://www.designlabthemes.com/preview/artpop/\">the demo</a>, but it is not practical in the real world.</p>\n\n\n\n<p>Where the theme gets things right is its coverage of block styles. End-users can put together custom layouts that do not look broken. After two years of the block editor being in core, this should be the <em>standard</em> experience with all themes, but I cannot stress how much it isn&rsquo;t.</p>\n\n\n\n<p>I even recreated the <a href=\"https://demo.designlabthemes.com/artpop-pro/homepage-creative/\">&ldquo;creative&rdquo; homepage design</a> that ships with the pro version of the theme to see how easy it was. If you would rather work with premade layouts, the <a href=\"https://www.designlabthemes.com/artpop-pro-wordpress-theme/\">upgrade</a> is a mere $30. However, if you know your way around the block editor, you can definitely build the layouts yourself.</p>\n\n\n\n<img />Editing creative-style Artpop Pro homepage design.\n\n\n\n<p>This is the direction that theme design should be going. Provide all the capabilities in the free product. Upsell the added value of having all these extra layouts/patterns premade and available at the click of the button.</p>\n\n\n\n<p>By default, the homepage displays a five-post grid. A large featured post sits in the middle while the others are aligned on either side of it. This unique layout was what immediately drew me into the theme.</p>\n\n\n\n<img />Grid-style featured posts.\n\n\n\n<p>Users can also choose a carousel of featured posts instead of the grid via the customizer. I am typically not a fan of slider-like sections. However, carousels, where it is clear there are extra posts to view, are sometimes an exception to the rule.</p>\n\n\n\n<img />Carousel-style featured posts.\n\n\n\n<p>After working with block-based themes and the site editor so much over the past few months, these customizer settings feel ancient &mdash; both from a developer and end-user viewpoint. It reminds me to applaud theme authors for the years of work they have put into non-optimal systems. There will be a day when adding these types of layouts do not require nearly as much effort.</p>\n\n\n\n<p>The one annoyance with the homepage options is that the theme author created a separate &ldquo;Homepage&rdquo; panel, which can easily be confused with the existing core &ldquo;Homepage Settings&rdquo; section. There is no good reason to not combine these two and free up some room in the customizer.</p>\n\n\n\n<p>I would also like to see just a general cleanup of the theme&rsquo;s customizer integration. The theme does not have many options, but it has nearly a dozen top-level sections, consuming precious real estate in the customizer.</p>\n\n\n\n<p>The biggest downside to the theme is that it adds a customizer control that prints &ldquo;Try Artpop Pro / Need more options?&rdquo; to every section it adds. This is in addition to its two top-level upsell sections. The thing that makes it worse, however, is that it is broken. The &ldquo;Try Artpop Pro&rdquo; text is meant to be linked, but the theme has a bug that outputs the text followed by a broken link tag, which is only visible in the source code.</p>\n\n\n\n<p>There really is no need for 10 upsell links in the customizer, even if eight of them are broken. The theme is nice enough on its own. The links just degrade it.</p>\n\n\n\n<p>Aside from a few annoyances, the theme is worth exploring for those in the market for something new. While it is a freemium product, users can get a lot of mileage out of it without upgrading.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Feb 2021 18:49:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: Elementor to Roll Out Significant Pricing Hike for New Customers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111909\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:193:\"https://wptavern.com/elementor-to-roll-out-significant-pricing-hike-for-new-customers?utm_source=rss&utm_medium=rss&utm_campaign=elementor-to-roll-out-significant-pricing-hike-for-new-customers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5799:\"<p>Earlier this week, Elementor <a href=\"https://elementor.com/blog/announcing-new-pro-plans/\">announced</a> a significant pricing hike coming in March 2021 for new customers:  </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>On March 9th, 2021, Elementor will be adding new Studio and Agency Pro subscription plans and adapting the Expert plan, to best accommodate users&rsquo; growing needs. These changes will only apply to new purchases.&nbsp;<strong>If you&rsquo;re on an existing active subscription plan, nothing changes for you.</strong></p></blockquote>\n\n\n\n<p>The most radical change is coming to the Expert plan, which previously offered 1,000 sites for $199/year. The plan has been pared back to support 25 sites. Users who need support for 1,000 websites will need to purchase the Agency plan at $999/year, a 400% increase on the price for what was previously offered under the Expert plan.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Elementor emphasized that customers with an existing active subscription will not be affected by the pricing changes. The company is also giving customers a chance to purchase the current Expert plan ($199/year for 1,000 sites) before it is discontinued before March 9, 2021. Existing customers on the Expert plan have the option to upgrade to the Agency plan at a 50% discount (valid from March 9, 2021 until June 9, 2021).</p>\n\n\n\n<p>Over the past 48 hours, Elementor&rsquo;s announcement has received 270 comments primarily from disgruntled customers. Some of them are opposed to the pricing hikes and others are unclear about what it means for their subscriptions long term. Elementor representatives&rsquo; responses to questions on renewal have been studiously unclear.</p>\n\n\n\n<p>One customer points out that the announcement does not explicitly say that existing subscriptions will retain the legacy pricing past the end of the billing period for this year. It does not state that existing active subscriptions will remain at the same price indefinitely, nor does it specify a term after which the pricing will go up. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Elementor Evangelist Ben Pines, head of the company&rsquo;s web creator program, has left the question regarding renewals open, saying he &ldquo;cannot see into the future.&rdquo; Customers were left wondering whether the lack of clarity on the future of renewals is a foreshadowing of prices going up after the current billing year. </p>\n\n\n\n<p>&ldquo;No one can predict the future, and offering a lifetime price guarantee is irresponsible for any future-facing company,&rdquo; Pines told the Tavern. &ldquo;What we can guarantee for sure is the extent to which we value user loyalty. This is why they have never experienced any price change in 4.5 years. We value our users&rsquo; trust, and have taken every step to ensure that our loyal users&rsquo; active subscriptions are not affected.&rdquo;</p>\n\n\n\n<p>The company has not confirmed whether existing active subscriptions will be guaranteed the lower pricing forever and reserves the right to eliminate legacy pricing at any point in the future. </p>\n\n\n\n<p>In the announcement, Pines said the pricing model for Elementor Pro has hardly changed since it was introduced in 2016 and that it is time to update it to best accommodate customers&rsquo; evolving needs. Elementor is now installed on more than 7 million websites and caters to a wide community of users with varying levels of expertise. The new plans have access to 24/7 live chat support and a handful of other benefits, but many customers participating in the comments said they do not require chat support.</p>\n\n\n\n<p>The upcoming pricing hike has heightened tensions for customers who feel the dramatic increase is unjustified for the software in its current state. They cited usability issues, persistent bugs, and performance problems that remain unfixed. Additional support features do not make the higher prices more compelling for this segment of the company&rsquo;s customers.</p>\n\n\n\n<p>Some who were disturbed by the radical price increase called for the company to consider creating a middle ground offering for the updated Expert tier.</p>\n\n\n\n<p>&ldquo;I agree that 1,000 websites for $199 is low,&rdquo; one customer commented. &ldquo;Many small people will never create 1,000 websites. What bothers me is $199 for 25. Would it be more reasonable if it was $199 for 50, to have some middle ground? Or maybe you do not want the little people around any more.&rdquo;</p>\n\n\n\n<p>A handful of customers commenting were unfazed, noting that anyone who builds 1,000 websites using Elementor and cannot afford $1 per work order should reconsider their business model.</p>\n\n\n\n<p>Pricing changes can be a major source of friction for existing customers, as GitLab recently discovered when <a href=\"https://wptavern.com/gitlab-drops-bronze-starter-tier-in-pricing-update\">dropping its Bronze/Starter Tier</a> and imposing a 5x price increase on those features in a higher tier. Although the immediate impact of pricing increases will primarily hit new customers, it&rsquo;s the existing customers who have been paying for subscriptions for years who have the strongest opinions on the changes. </p>\n\n\n\n<p>Raising prices to introduce more value for customers or to account for the increased support burden is a natural evolution for companies that experience rapid growth over a short period of time. Getting existing customers to lock in their auto-renewals by offering legacy pricing is also a strategy for ensuring a more predictable financial future for the company. But Elementor&rsquo;s lack of clarity regarding term length for the discounted renewal pricing is the primary reason for all the agitation in the comments on the announcement.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Feb 2021 04:58:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: WP Feedback Rebrands To Atarim, Moves To a Full SaaS Model\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=110579\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:179:\"https://wptavern.com/wp-feedback-rebrands-to-atarim-moves-to-a-full-saas-model?utm_source=rss&utm_medium=rss&utm_campaign=wp-feedback-rebrands-to-atarim-moves-to-a-full-saas-model\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5872:\"<p class=\"has-drop-cap\">Earlier this week, WP Feedback founder Vito Peleg announced the company was <a href=\"https://atarim.io/blog/introducing-atarim/\">changing its brand to Atarim</a>. After 18 months since its launch, it would also be moving toward a complete Saas (Software as a Service) model.</p>\n\n\n\n<p>WP Feedback was created as a standalone plugin. The goal was to provide a visual feedback tool that agencies and developers could use to communicate with clients rather than spending time deciphering unclear emails, chat messages, and phone calls.</p>\n\n\n\n<p>&ldquo;Starting as a freelancer and then an agency owner myself, it was always a huge pain to get clients to provide me with the content and design feedback I needed,&rdquo; said Peleg. &ldquo;And this led to us building a tool for us that worked extremely well with our workflow, which led to the decision to take this to the market.&rdquo;</p>\n\n\n\n<p>However, over time, the product evolved into something bigger.</p>\n\n\n\n<p>&ldquo;As we started gaining traction, I always kept a pulse on our users (now with over 5,000 freelancers and agencies), and it became clear that a standalone plugin, while it did do the trick, was simply not enough &mdash; especially for those that manage multiple websites and clients at the same time,&rdquo; said Peleg. &ldquo;It solved a huge part of the problem, but not the workflow in its entirety. There was a clear demand for us to build a centralized area to gather all feedback so we then created our Agency Dashboard &mdash; a cloud-based application that allowed our users to gather all the requests from different clients and websites to manage them in a single place.&rdquo;</p>\n\n\n\n<p>Peleg said the Agency Dashboard revealed a more complex problem in the industry. Agencies were patching together several different tools to provide various aspects of their services. These tools were leading to unnecessary friction and slowing down jobs, often adding weeks of additional time.</p>\n\n\n\n<p>The team tackled more than they had initially bargained for. In 18 months, they added over 150 features to the WP Feedback platform. Peleg said the project has helped agencies and developers reduce between 50% and 80% of the previous time delivering projects and supporting clients.</p>\n\n\n\n<p>In 2020, the WP Feedback&rsquo;s users marked over 100,000 tasks as complete. Peleg calculates this has saved the industry over five years of unnecessary back and forth.</p>\n\n\n\n<p>&ldquo;The name WP FeedBack continued to position us as what version 1.0 was &mdash; a basic visual feedback plugin,&rdquo; he said. &ldquo;So along with version 2.0 that is releasing this week, I decided it&rsquo;s a great opportunity to revamp the whole experience with a rebrand, repositioning, and a whole bunch of new ways that users can use our software to improve their lives.&rdquo;</p>\n\n\n\n<p>Peleg said that nothing is really changing for existing customers other than having access to more tools. It should be a smooth transition for them. The goal now is to attract new customers.</p>\n\n\n\n<p>&ldquo;I also hope that this transition will allow our industry to see the new reality we&rsquo;re creating for delivering website projects and why it&rsquo;s insane that a 5-6 days project still takes 6-8 weeks to complete,&rdquo; he said.</p>\n\n\n\n<h2>How the Service Works</h2>\n\n\n\n<img />Atarim Agency Dashboard.\n\n\n\n<p class=\"has-drop-cap\">There are two sides to Atarim. One is a client-interface plugin installed on each project website; the other is the Agency Dashboard.</p>\n\n\n\n<p>&ldquo;The plugin&rsquo;s role is to provide a simple experience for clients to provide the content you need, approve the designs and request ongoing support,&rdquo; said Peleg. &ldquo;Allowing to visually click any part of the website (including in the wp-admin screens) and just leave a comment. The agency will get an automated screenshot, the screen size, browser version, and a button that will take them directly to the request, logged in, with one click.&rdquo;</p>\n\n\n\n<p>Freelancers or agencies work from within the Agency Dashboard. This serves as a central location for all of the work that happens around client websites.</p>\n\n\n\n<p>Technically, WP Feedback has already been a SaaS product with an accompanying plugin since launching its central dashboard early in the product&rsquo;s history. Version 2.0 completes the transition from a plugin to a full-on SaaS. Feedback and other data are no longer saved to the client websites. Instead, they are hosted via Atarim.</p>\n\n\n\n<p>&ldquo;Over time, we noticed that it created unwanted bloat to the websites that were using our tools extensively, so off-loading all the data and loading it from our side, was the natural route,&rdquo; said Peleg. &ldquo;But since this is how the platform was initially built, this was a massive undertaking that I&rsquo;m very happy that we finally completed.&rdquo;</p>\n\n\n\n<p>The client-interface plugin is built for WordPress. However, the technology stack behind the new Atarim Agency Dashboard is on Laravel and React. The team thought it would be the best framework for speed and to work with as the company continues to scale.</p>\n\n\n\n<p>&ldquo;I&rsquo;ve been using WordPress myself for more than a decade &mdash; so it really comes naturally to me by now,&rdquo; said Peleg. &ldquo;The SaaS world is a different animal.&rdquo;</p>\n\n\n\n<p>&ldquo;One of the biggest challenges was transitioning everything we have built, to be pulled from the cloud as opposed to being stored locally on the client&rsquo;s site. The &lsquo;cloud migration&rsquo; project, as we called it internally, has been a year-long endeavor that, whilst it was developed constantly, was pushed back by our need to support our existing users, our growth, COVID-19, and all the other fires that happen when you&rsquo;re running a startup.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Feb 2021 21:54:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WordPress.org blog: People of WordPress: Pooja Derashri\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9652\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://wordpress.org/news/2021/02/people-of-wordpress-pooja-derashri/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9544:\"<p><em>WordPress is open source software, maintained by a global network of contributors. There are many examples of how WordPress has changed people’s lives for the better. In this monthly series, we share some of the amazing stories that are lesser-known.</em></p>\n\n\n\n<img width=\"632\" height=\"331\" src=\"https://i0.wp.com/wordpress.org/news/files/2021/02/pic1.jpg?resize=632%2C331&ssl=1\" alt=\"Pooja standing in a banner \" />\n\n\n\n<p>Pooja Derashri shares the story of how she went from being an introvert from a small village in India to becoming a developer and working on international projects, thanks to the WordPress community. </p>\n\n\n\n<p>As her interest grew, Pooja started following some WordPress-based groups on Facebook, where she first heard about conference-style WordPress events known as WordCamps. She later joined her first WordCamp in Ahmedabad, India. This three day event in 2017 opened up a new world—the WordPress community—and what would become a life changing moment. “WordCamp Ahmedabad has one of the best WordPress communities in India,&#8221; she said, &#8220;and everyone, including organizers and attendees were so humble and welcoming.”</p>\n\n\n\n<img src=\"https://i0.wp.com/wordpress.org/news/files/2021/02/pooja600x600.jpg?w=500&ssl=1\" alt=\"\" class=\"wp-image-9654\" />\n\n\n\n<h2><strong>The thirst for learning</strong></h2>\n\n\n\n<p>A fascination with how things worked and a desire never stop learning were traits that shone through in Pooja from a young age. She moved from Banera, a rural village in India, to a nearby city, where she lived with her uncle while completing her higher education. With her enthusiasm for learning, she decided to become an engineer. When thinking back on that time she says, “Being from a rural background, people in my village tended not to be keen on the idea of sending their girl child to another city for further studies. Fortunately, that was not the case for me because my parents were immensely supportive of me and my interests. They’ve always encouraged me to believe in myself and fulfill my dreams. With their support, I pursued my engineering in electronics and communication.”</p>\n\n\n\n<h2><strong>Discovering the opportunities in web development&nbsp;</strong></h2>\n\n\n\n<p>On completing her engineering training, Pooja was not sure what to do next. One of her friends suggested that she should explore web development. The idea intrigued her, and she sought out learning resources to study. She also secured an internship as a PHP Developer to give herself the chance to learn alongside professionals in the field.</p>\n\n\n\n<h2><strong>Getting started with WordPress</strong></h2>\n\n\n\n<blockquote class=\"wp-block-quote has-text-align-center\"><p><strong>“I found WordPress surpassed other platforms. The vast knowledge base made it easy for me to learn.” &#8211; Pooja</strong></p></blockquote>\n\n\n\n<p>This internship led Pooja to her first job where she discovered a range of content management systems. Her view of the opportunities offered by these systems changed when the manager assigned her a small project using the WordPress platform.&nbsp;</p>\n\n\n\n<p>She recalls: “I found WordPress surpassed other platforms I had worked on earlier. The vast knowledge base made it easy for me to learn.” She soon became comfortable managing WordPress, working with plugins and themes, and wanted to learn it more in-depth.</p>\n\n\n\n<p>Pooja soon joined WPVibes as its first team member. Being part of a new startup gave her a lot of experience and a chance to be involved in new processes. As the company expanded they started providing custom plugin development services per the client’s requirement and created some free and paid plugins. Pooja said, &#8220;We found it very exciting and productive. Today, we are a team of 10.”</p>\n\n\n\n<h2><strong>Encouragement from the WordPress community</strong></h2>\n\n\n\n<blockquote class=\"wp-block-quote has-text-align-center\"><p><strong>Contributing to WordPress increases your knowledge</strong></p></blockquote>\n\n\n\n<p>At the event, she was able to listen to speakers from India and abroad, many of whom shared their journey with WordPress and how it had changed their lives. “One of the most inspiring sessions was by Rahul Bansal,&#8221; she said. &#8220;He talked about contributing to WordPress and giving back to the community. He also explained how contributing to WordPress can help you to enhance your knowledge. It inspired me to contribute to WordPress.”</p>\n\n\n\n<p>The WordPress community of Ahmedabad continued to inspire Pooja and her husband Anand Upadhyay, and they later started a Meetup group in their home city of Ajmer as part of their contribution to the community. They continue to be involved in supporting local users through the <a href=\"https://www.meetup.com/ajmer-wordpress-meetup/\">Ajmer Meetup</a>.</p>\n\n\n\n<img src=\"https://lh5.googleusercontent.com/KmA8iDgGrRar_cgD2jp2ThrzPxuzGTSI7SWkxDdHKyN4p2iNoj0e-VdOxO0xa1TtH56Uci9wEfYYfnW8DYji8c1HuaI7L-xhNqXyXt_kdchWtVxe_PnSea2knlWhP_O7qqG0Quju\" alt=\"Pooja with a WordCamp Ahmedabad badge\" width=\"500\" />\n\n\n\n<p>At the next WordCamp Pooja attended, she joined its contributor day, which brings users together to give back to the open source platform and global community. Most of the contributors she met were interested in giving time to the WordPress CMS. She decided to venture into a different path and took her first steps by joining the WordPress TV group, where you can explore videos from WordPress events across the world. She also discovered the joy of translating into her local language, and is a <a href=\"https://make.wordpress.org/polyglots/\">Polyglot</a> contributor for the Hindi language.</p>\n\n\n\n<p>In 2019, she was selected as a volunteer for WordCamp Asia in Bangkok, Thailand, and it became an impetus to become even more involved with the community. She was very excited about this role, and to be part of her first WordCamp outside India. Sadly, due to the global COVID pandemic, the event had to be cancelled. Her enthusiasm has not diminished and she is eagerly waiting to support in-person WordCamps in the future and meet even more members of the global community.</p>\n\n\n\n<p>Her determination to be part of making WordPress and sharing skills has only increased, which has led to contribute to the WordPress Training team. This team manages lesson plans and prepares content to support people who are training others to use WordPress. The team recently joined a few other teams to <a href=\"https://wordpress.org/news/2020/12/introducing-learn-wordpress/\">launch Learn WordPress</a>, which brings learning materials together for users of all levels, and Pooja contributed to two different teams during the project.</p>\n\n\n\n<h2><strong>Message to the WordPress Community</strong></h2>\n\n\n\n<p>Pooja is eager to share her belief in the power for good in the WordPress community. “There is a huge community to help you with your learning, so start learning and try to give back to the community. It doesn’t matter if you are not comfortable with programming, there are many different ways in which you can contribute.”&nbsp;</p>\n\n\n\n<p>“What I have learned in my life is that it doesn’t matter from where you came and what background you have. All that matters is your hard work and positive attitude towards life.”</p>\n\n\n\n<p>Read more stories in the <a href=\"https://wordpress.org/news/category/heropress/\">People of WordPress series</a>.</p>\n\n\n\n<h2>Contributors</h2>\n\n\n\n<p><em>Thanks to Abha Thakor (<a href=\"https://profiles.wordpress.org/webcommsat/\">@webcommsat</a>) and Nalini Thakor (<a href=\"https://profiles.wordpress.org/nalininonstopnewsuk/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>nalininonstopnewsuk</a>) for writing this story, and to Surendra Thakor (<a href=\"https://profiles.wordpress.org/sthakor/\">@sthakor</a>), Josepha Haden (<a href=\"https://profiles.wordpress.org/chanthaboune/\">@chanthaboune</a>), Meher Bala (<a href=\"https://profiles.wordpress.org/meher/\">@meher</a>), Chloé Bringmann (<a href=\"https://profiles.wordpress.org/cbringmann/\">@cbringmann</a>), Olga Glekler (<a href=\"https://profiles.wordpress.org/oglekler/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>oglekler</a>), Christopher Churchill (<a href=\"https://profiles.wordpress.org/vimes1984/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>vimes1984</a>), Larissa Murillo (<a href=\"https://profiles.wordpress.org/lmurillom/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>lmurillom</a>), and Yvette Sonneveld (<a href=\"https://profiles.wordpress.org/yvettesonneveld/\">@yvettesonneveld</a>) for work on the series this month. Thank you also to Pooja Derashri (<a href=\"https://profiles.wordpress.org/webtechpooja/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>webtechpooja</a>) for sharing her #ContributorStory.</em></p>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\">\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><img src=\"https://lh4.googleusercontent.com/E9y8t1dTqeOylNc4mkC0KeQfmCisFLy4790Idt2DYwWdKSEwCh7RlsAmTcnRYuTb7jqXzwtYVjPRsXDVTh_HREDUWAbB-sOOXuC7HEZR-uEeV046dl8X3eU9kG6fpIXkRn0SbDcT\" alt=\"HeroPress logo\" /><div class=\"wp-block-media-text__content\">\n<p><em>This post is based on an article originally published on HeroPress.com, an initiative focused around people in the WordPress community created by </em><a href=\"https://profiles.wordpress.org/topher1kenobe/\"><em>Topher DeRosia</em></a><em>.</em></p>\n</div></div>\n</div>\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Feb 2021 21:30:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"webcommsat AbhaNonStopNewsUK\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: WordPress Passes 40% Market Share of Alexa Top 10 Million Websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111831\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:195:\"https://wptavern.com/wordpress-passes-40-market-share-of-alexa-top-10-million-websites?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-passes-40-market-share-of-alexa-top-10-million-websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3647:\"<p>WordPress has passed 40% market share of all websites, up from 35.4% in January 2020, as measured by <a href=\"https://w3techs.com/technologies/details/cm-wordpress\">W3Techs</a>. These numbers are derived from  the&nbsp;<a href=\"https://www.alexa.com/\">Alexa</a>&nbsp;top 10 million websites, along with the&nbsp;<a href=\"https://tranco-list.eu/\">Tranco</a>&nbsp;top 1 million list. By W3Techs&rsquo; estimates, every two minutes, another top 10m site starts using WordPress. </p>\n\n\n\n<p>Among&nbsp;the&nbsp;<a href=\"https://w3techs.com/technologies/breakdown/cm-wordpress/ranking\">top 1,000 sites</a>, WordPress&rsquo; market share is even higher at 51.8%, and captures a staggering 66.2% for new sites. In tracking the growth rate over the past 10 years, W3Techs shows WordPress sloping steadily upwards.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p> Matthias Gelbmann, CEO of W3Techs parent company&nbsp;Q-Success, <a href=\"https://w3techs.com/blog/entry/40_percent_of_the_web_uses_wordpress\">explained</a> the reasons behind this methodology:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>The reason why we don&rsquo;t count all the websites, is because there are so many domains that are unused or used for dubious purposes. We want to exclude the many millions of parked domains, spam sites and sites that simply have no real content. We are convinced that including all trash domains would make our statistics a lot less useful, as millions of them just run some software stack that auto-generates useless content.</p></blockquote>\n\n\n\n<p>In order to measure the &ldquo;meaningful web,&rdquo; W3Techs&rsquo; methodology excludes sites with default content pages displayed by Apache, Plesk, and cPanel, expired domains, and account suspended pages. It also excludes sites with the default WordPress message (<em>&ldquo;Hello world! Welcome to WordPress. This is your first post. Edit or delete it, then start writing!&rdquo;</em>).</p>\n\n\n\n<p>In January, <a href=\"https://w3techs.com/technologies/comparison/cm-drupal,cm-squarespace,cm-wix\">Squarespace overtook Drupal and Wix</a> to become the 4th most popular CMS with 2.5% market share, trailing Joomla (3.4%), Shopify (5.3%), and WordPress (64.3%). Although most open source CMS&rsquo;s are now in a gradual decline with proprietary competitors rising, WordPress remains a beacon of free software that continues to sustain its incredible growth. </p>\n\n\n\n<p>In a time when some projects are abandoning open source principles when convenient for their business models, WordPress&rsquo; success has proven that an unwavering commitment to user freedoms does not have to be at odds with a thriving commercial ecosystem. These user freedoms are fiercely protected by the project&rsquo;s leadership and passionate community of contributors. As a result, WordPress&rsquo; GPL licensing now underpins a multi-billion dollar economy of services, hosting companies, and entrepreneurs who have built their livelihoods using WordPress. </p>\n\n\n\n<p>Every year I wonder when the project&rsquo;s growth might slow down, but end up refreshing W3Techs&rsquo; site obsessively for a week in anticipation of another major milestone, as WordPress hovered at 39.9%. Naysayers love to claim that hordes of people will stop using WordPress when major, ambitious changes are proposed. But if W3Techs&rsquo; growth tracking is any indication, new website creators and those climbing the ranks to the Alexa top 10 million have not yet gotten tired of being greeted by the message: <em>&ldquo;Hello world! Welcome to WordPress. This is your first post. Edit or delete it, then start writing!&rdquo;</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 11 Feb 2021 04:38:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"WPTavern: GoDaddy Launches the Hub, a New Site, Project, and Client Management Experience for Web Professionals\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111717\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:261:\"https://wptavern.com/godaddy-launches-the-hub-a-new-site-project-and-client-management-experience-for-web-professionals?utm_source=rss&utm_medium=rss&utm_campaign=godaddy-launches-the-hub-a-new-site-project-and-client-management-experience-for-web-professionals\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5308:\"<img />\n\n\n\n<p class=\"has-drop-cap\">On Monday, GoDaddy officially <a href=\"https://www.godaddy.com/garage/what-is-new-godaddy-pro/\">launched the Hub by GoDaddy Pro</a>, a dashboard that brings together all of its products, pro-specific tools, and solutions. The experience is geared toward website developers and designers, creating a central location to manage their client work.</p>\n\n\n\n<p>GoDaddy Pro is not a new service by GoDaddy. The hosting company launched its <a href=\"https://www.godaddy.com/garage/introducing-the-godaddy-pro-beta/\">initial beta in 2015</a>. However, GoDaddy Pro is now offering a fresh experience powered by the Hub. According to Adam Warner, the Global Field Marketing Sr. Manager at GoDaddy, the Hub is being built in collaboration with real-world web designers and developers from their Customer Advisory Board.</p>\n\n\n\n<p>The Hub is at <a href=\"https://hub.godaddy.com\">hub.godaddy.com</a>. Existing GoDaddy Pro users can opt-in to the new Hub experience. However, they may continue using the legacy experience at <a href=\"https://pro.godaddy.com\">pro.godaddy.com</a>. They can also jump between both as needed. Eventually, the Hub will completely replace the legacy experience.</p>\n\n\n\n<img />The Hub home screen.\n\n\n\n<p>&ldquo;You can manage all your client projects, sites, and GoDaddy products from within the Hub,&rdquo; said Warner. &ldquo;Your clients&rsquo; WordPress sites don&rsquo;t have to be hosted at GoDaddy. The Hub works with all web hosts. You can run one-click WordPress updates, security checks, backups, and other bulk site maintenance work within the Hub. We&rsquo;ve seen users save an average of three hours per month, per site.&rdquo;</p>\n\n\n\n<p>The Hub allows web developers to access their clients&rsquo; GoDaddy products without needing to pass around credentials. Developers can also send a pre-loaded shopping cart or purchase products on their clients&rsquo; behalf.</p>\n\n\n\n<p>&ldquo;This makes it easier, and faster, to get a new project up and running,&rdquo; said Warner. &ldquo;You don&rsquo;t have to worry about your client buying the wrong hosting plan or domain. Project management is integrated into the Hub, so you can keep track of client communications and ensure you&rsquo;re delivering projects on time.&rdquo;</p>\n\n\n\n<p>Part of this journey began when GoDaddy acquired ManageWP and brought its team over in 2016. The <a href=\"https://wptavern.com/godaddy-acquires-wordpress-site-management-service-managewp\">acquisition was anything but popular</a> at the time.</p>\n\n\n\n<p>&ldquo;We built the first version of our GoDaddy Pro site management tools on top of ManageWP Orion,&rdquo; said Warner. &ldquo;We added new GoDaddy-specific features, like allowing clients to grant delegated access to manage their GoDaddy products. We also included some premium addons for free on GoDaddy-hosted websites. Just like with ManageWP, sites managed in the Hub can be hosted anywhere, not just at GoDaddy.&rdquo;</p>\n\n\n\n<p>The Hub has an interface that feels more Average Joe than tech savant. I half expected to see call-to-action buttons littering the screen, funneling users to every conceivable GoDaddy product, but none were found. Expectations from the GoDaddy of 10 years ago still linger and die hard. However, the company continues to move beyond its old reputation with its free tools and more recent willingness to give back to the open-source community, including its contribution to <a href=\"https://wordpress.org/five-for-the-future/pledge/godaddy/\">Five for the Future</a>.</p>\n\n\n\n<img />Running a site security check.\n\n\n\n<p>&ldquo;My goal in joining GoDaddy in 2018 was, and still is, to continue my participation in the WordPress and wider web designer and developer (WD&amp;D) communities in order to listen and return feedback internally on how we can best support freelancers in starting, growing, and streamlining their businesses,&rdquo; said Warner. &ldquo;GoDaddy Pro (the legacy tool) already existed when I joined GoDaddy, and my mission was to spread the word and offer suggested enhancements based on real-world conversations with freelancers and their specific needs.&rdquo;</p>\n\n\n\n<p>Creating clients, projects, and sites from within the interface is simple. Performance and security checks went well for the one site I have connected. The tests seemed to be spot on in comparison to other tools I have used.</p>\n\n\n\n<img />Site performance check.\n\n\n\n<p>GoDaddy Pro membership is free. However, the Hub will have premium site <a href=\"https://www.godaddy.com/help/premium-site-maintenance-tools-in-the-hub-40384\">maintenance tools in the future</a>. Automated security checks, performance checks, backups, and uptime monitoring are currently free. There is no timetable on when they will be behind a paywall. Some of the premium features will have a downgraded free option when the switch is flipped.</p>\n\n\n\n<p>&ldquo;While some adjacent programs (e.g. GoDaddy Reseller program, Pro subscription) may have associated costs or fees, GoDaddy Pro&rsquo;s integrated project management, site management, and client management tools are free,&rdquo; said Warner.</p>\n\n\n\n<p>The commitment to offering the management tools for free is undoubtedly a good thing. Thus far, I like what I am seeing with the new Hub experience.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 10 Feb 2021 22:31:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"WPTavern: Gatsby Launches New WordPress Integration, Expanding Support for Headless Architecture\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111778\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:235:\"https://wptavern.com/gatsby-launches-new-wordpress-integration-expanding-support-for-headless-architecture?utm_source=rss&utm_medium=rss&utm_campaign=gatsby-launches-new-wordpress-integration-expanding-support-for-headless-architecture\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4035:\"<p>The <a href=\"https://www.gatsbyjs.com/plugins/gatsby-source-wordpress/\">Gatsby source WordPress plugin</a>, Gatsby Cloud&rsquo;s official WordPress integration, has been marked stable as of v4 and has been released to the public. The plugin sources data from WordPress for headless setups that use Gatsby on the frontend. It is a complete rewrite of Gatsby&rsquo;s previous source plugin and works in combination with the <a href=\"https://wordpress.org/plugins/wp-gatsby/\">WPGatsby</a>&nbsp;plugin to integrate content preview and incremental builds from Gatsby Cloud.&nbsp;</p>\n\n\n\n<p>After going into public beta last year, the new source plugin was updated to enable the following: </p>\n\n\n\n<ul><li>Users add a WPGraphQL-enabled endpoint to gain access to WordPress content in Gatsby&rsquo;s data layer for use in React templates</li><li>Optimizes links and images within the content HTML with gatsby-image and gatsby-link</li><li>Restricts image processing and optimization to images referenced in published content, so large media libraries don&rsquo;t slow down build times</li><li>Automatically enables access to data from&nbsp;<a href=\"https://www.wpgraphql.com/extensions\">any WPGraphQL extension</a>, integrating the site with other WordPress plugins</li></ul>\n\n\n\n<p>WPGraphQL is required as part of the setup. It turns any site into a GraphQL server, making the content easier to fetch. For the past 18 months, Gatsby has supported the development and maintenance of WPGraphQL to a stable 1.0 release. WP Engine recently hired its maintainer, Jason Bahl, to continue funding the project and <a href=\"https://wptavern.com/wp-engine-invests-in-headless-wordpress-hires-wpgraphql-maintainer\">expand on its own headless WordPress initiatives</a>. This ensures that WPGraphQL will continue to have a strong future for use in decoupled projects. </p>\n\n\n\n<p>&ldquo;During the beta period, we were excited to see developer teams we admire adopt the Gatsby WordPress integration for their projects,&rdquo; Gatsby marketing manager Hashim Warren said. &ldquo;Teams from Facebook, Bluehost, and Apollo used Gatsby&rsquo;s WordPress integration to create accessible, scalable, and easy-to-update web experiences.&rdquo; All of these sites and more were using Gatsby + WPGraphQL in production before the new Gatsby Source WordPress plugin was officially stable, so it has been tested extensively during the beta period.</p>\n\n\n\n<p>The rewritten plugin is better at bridging the gap to make Gatsby frontends less of a trade-off for developers who are working with editorial teams. It <a href=\"https://twitter.com/tylbar/status/1359228717533302790\">improves build times</a> to be <a href=\"https://willit.build/details/type/blog/source/wordpress/page-count/4096\">under 10 seconds</a> for medium-sized sites. </p>\n\n\n\n<p>The complexity of editing and rebuilding Gatsby sites has been one of the chief deterrents for content creators adopting headless architecture. It imposes a more complicated workflow that the Gatsby Cloud product is designed to fix. This is how Gatsby monetizes its WordPress integration &ndash; by making the workflow more like what traditional WordPress provides out of the box.</p>\n\n\n\n<p>In recruiting potential headless customers, Gatsby emphasized the lower hosting costs of its stack. <a href=\"https://gatsbyjs.com/pricing/\">Gatsby Cloud</a> is free for small, personal sites but limits users to 100 Real-Time Edits/month. In fact, all of the commercial plans have upper limits on the number of editors and how many times users can perform real-time edits. </p>\n\n\n\n<p>Decoupled architecture still falls squarely within the realm of developers. Gatsby&rsquo;s Cloud product is one way that developers who choose Gatsby for the frontend can make their sites more user-friendly for editorial teams. Developers who are interested in exploring the new integration can get a quick start by checking out <a href=\"https://github.com/gatsbyjs/gatsby-starter-wordpress-blog\">Gatsby&rsquo;s official WordPress starter</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 09 Feb 2021 23:52:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: Embed Any URL Into WordPress With the Bookmark Card Block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111798\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:179:\"https://wptavern.com/embed-any-url-into-wordpress-with-the-bookmark-card-block?utm_source=rss&utm_medium=rss&utm_campaign=embed-any-url-into-wordpress-with-the-bookmark-card-block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4117:\"<p class=\"has-drop-cap\">George Mamadashvili&rsquo;s <a href=\"https://wordpress.org/plugins/bookmark-card/\">Bookmark Card</a> block is the sort of simple plugin that is easy to overlook. It is one of those plugins that suffers from the lack of block discoverability in WordPress at the moment. Like many other one-off blocks, you don&rsquo;t know you need it until you need it.</p>\n\n\n\n<p>The plugin is essentially an embed block, but it is not specific to one website or service like Twitter and YouTube. Instead, it allows users to add a &ldquo;card&rdquo; for any URL in their content.</p>\n\n\n\n<p>Mamadashvili has previously worked as a developer on several blocks for the Sorta Brilliant brand, which sported some of my <a href=\"https://wptavern.com/the-wacky-world-of-sorta-brilliants-sorta-fun-block-plugins\">favorite block-related plugins</a>, such as <a href=\"https://wptavern.com/emoji-conbini-and-the-case-for-a-block-enhancements-directory\">Emoji Conbini</a>. Unfortunately, those plugins are no longer in the WordPress directory at the request of the owner, Nick Hamze.</p>\n\n\n\n<p>However, Mamadashvili has continued building separately. Yesterday, he launched <a href=\"https://wordpress.org/plugins/toggles/\">Toggles</a>, a block for creating FAQs, hiding spoilers, and adding simple accordion elements..</p>\n\n\n\n<p>I have had his Bookmark Card block literally <em>bookmarked</em> for a few months, just now finally giving it the overdue trial run that it deserves.</p>\n\n\n\n<p>The name of the plugin brings me back a few years. There was once a time when bookmarks were a common feature of the web. Entire sites were dedicated to managing them, and some people created their own bookmark pages on their WordPress sites. Some were mere blogrolls. Others were more advanced galleries with images. Even the &ldquo;link&rdquo; post format archive in WordPress has served as a bookmark system.</p>\n\n\n\n<p>The idea of bookmarks is about preserving pieces of the web that interests us. So, I opened my dusty old recipe folder in Chrome and started putting together a recipes page for fun, hoping for some inspiration in my culinary pursuits.</p>\n\n\n\n<img />Horizontal-style Bookmark Card blocks.\n\n\n\n<p>I enjoy this recipe page a lot more than the plain links hidden away in my Google bookmarks. I suppose I could get even more creative and break everything down by category on different pages.</p>\n\n\n\n<p>The Bookmark Card block currently ships with two styles. The horizontal style, shown above, places the image to the right of the card content. The default style, shown below, adds the image at the top. Users can also try combinations with other blocks for unique looks, such as adding cards to the Columns block.</p>\n\n\n\n<img />Columns of Bookmark Card blocks.\n\n\n\n<p>The plugin can be useful in many contexts. Users can add URLs that are not supported via the regular embed blocks.  They may also enjoy the shared card style for all of their embedded links.</p>\n\n\n\n<h2>Future Ideas for the Plugin</h2>\n\n\n\n<p class=\"has-drop-cap\">The simplicity of Bookmark Card is part of its allure. However, it is also overly simple in some respects. The only option it provides is the choice between a vertical and horizontal card style. This limits its potential, especially if the default design does not match the user&rsquo;s theme.</p>\n\n\n\n<p>The plugin does not need a plethora of options. However, it could use some basics. Text and background colors are a must. Base typography options, such as selecting the font size, would be nice-to-have features. Integration with the Gutenberg plugin&rsquo;s newer border-radius component would work well with this type of block. Like all blocks I test or use, I also ask that plugin developers add support for wide and full-width alignments.</p>\n\n\n\n<p>A few additional styles or layout options would help. For example, a horizontal style that moves the image to the left of the card content would be a good option.</p>\n\n\n\n<p>The plugin, which is currently at version 1.0, is a good starting point. However, it could be much better with just a handful of extras in future updates.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 09 Feb 2021 22:50:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WordPress.org blog: WordPress 5.7 Beta 2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9688\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5026:\"<p>WordPress 5.7 Beta 2 is now available for testing! <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f5e3.png\" alt=\"🗣\" class=\"wp-smiley\" /></p>\n\n\n\n<p><strong>This software is still in development,</strong>&nbsp;so it’s not recommended to run this version on a production site. Consider setting up a test site to play with it.</p>\n\n\n\n<p>You can test the WordPress 5.7 Beta 2 in two ways:</p>\n\n\n\n<ul><li>Install/activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin (select the&nbsp;<code>Bleeding edge</code>&nbsp;channel and the&nbsp;<code>Beta/RC Only</code> stream)</li><li>Direct download the beta version here (<a href=\"https://wordpress.org/wordpress-5.7-beta2.zip\">zip</a>).</li></ul>\n\n\n\n<p>The current target for final release is March 9, 2021. That’s just <strong>four weeks away</strong>, so your help is vital to making sure that the final release is as good as it can be.</p>\n\n\n\n<h2><strong>Some Highlights</strong></h2>\n\n\n\n<p>Since <a href=\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-1/\">Beta 1</a>, <a href=\"https://core.trac.wordpress.org/query?status=closed&changetime=02%2F03%2F2021..02%2F10%2F2021&milestone=5.7&group=component&max=500&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">38</a> bugs have been fixed. Here is a summary of some of the included changes:</p>\n\n\n\n<ul><li>Italicized text has been removed to improve accessibility and readability (<a href=\"https://core.trac.wordpress.org/ticket/47327\">#47326</a>)</li><li>Pause any playing media when closing the the media modal (<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/48562\">#48562</a>)</li><li>Add Content-Security-Policy script loaders (<a rel=\"noreferrer noopener\" href=\"https://core.trac.wordpress.org/ticket/39941\" target=\"_blank\">#39941</a>)</li><li>Several fixes for the Twenty Twenty-One theme (<a rel=\"noreferrer noopener\" href=\"https://core.trac.wordpress.org/ticket/50454\" target=\"_blank\">#50454</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52432\">#52432</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52433\">#52433</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52473\">#52473</a>,&nbsp;<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://core.trac.wordpress.org/ticket/52477\">#52477</a>, <a href=\"https://core.trac.wordpress.org/ticket/52374\">#52374</a>)</li><li>Gutenberg editor support for custom spacing (<a href=\"https://core.trac.wordpress.org/ticket/51760\">#51760</a>)</li><li>Resolved Menu UI issues on medium-large screen sizes (<a href=\"https://core.trac.wordpress.org/ticket/49576\">#49576</a>)</li><li>Admin UI color palette: ensure that all interactive elements have an appropriate contrast ratio (<a href=\"https://core.trac.wordpress.org/ticket/52402\">#52402</a>)</li></ul>\n\n\n\n<h2><strong>How You Can Help</strong></h2>\n\n\n\n<p>Watch the Make WordPress Core blog for 5.7-related developer notes in the coming weeks, which will break down these and other changes in greater detail.</p>\n\n\n\n<p>So far, contributors have fixed <a href=\"https://core.trac.wordpress.org/query?status=closed&changetime=..02%2F09%2F2021&milestone=5.7&group=component&max=500&col=id&col=summary&col=owner&col=type&col=priority&col=component&col=version&order=priority\">157 tickets in WordPress 5.7</a>, including <a href=\"https://core.trac.wordpress.org/query?status=closed&status=reopened&changetime=..02%2F03%2F2021&type=enhancement&type=feature+request&milestone=5.7&group=component&col=id&col=summary&col=type&col=status&col=milestone&col=changetime&col=owner&col=priority&col=keywords&order=changetime\">68 new features and enhancements</a>, and more bug fixes are on the way.</p>\n\n\n\n<p><strong>Do some testing!</strong></p>\n\n\n\n<p><a href=\"https://make.wordpress.org/core/handbook/testing/beta-testing/\">Testing for bugs</a> is a vital part of polishing the release during the beta stage and a great way to contribute. <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" /></p>\n\n\n\n<p>If you think you’ve found a bug, please post to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta</a> area in the support forums. We would love to hear from you! If you’re comfortable writing a reproducible bug report, file one on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. That’s also where you can find a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p><em>Props to <a href=\"https://profiles.wordpress.org/audrasjb/\">@audrasjb</a>, <a href=\"https://profiles.wordpress.org/hellofromtonya/\">@hellofromtonya</a>, <a href=\"https://profiles.wordpress.org/francina/\">@francina</a> and <a href=\"https://profiles.wordpress.org/desrosj/\">@desrosj</a> for your peer revisions!</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 09 Feb 2021 20:42:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ebonie Butler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: WP Engine Invests in Headless WordPress, Hires WPGraphQL Maintainer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111362\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:197:\"https://wptavern.com/wp-engine-invests-in-headless-wordpress-hires-wpgraphql-maintainer?utm_source=rss&utm_medium=rss&utm_campaign=wp-engine-invests-in-headless-wordpress-hires-wpgraphql-maintainer\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4404:\"<p>WP Engine is deepening its investment in headless WordPress with the creation of a new team dedicated to furthering the technology developers rely on when opting for this architecture. The company has <a href=\"https://www.wpgraphql.com/2021/02/07/whats-next-for-wpgraphql/\">hired WPGraphQL creator and maintainer Jason Bahl</a> as part of this new team and will be investing in more engineers and other roles to support decoupled setups.</p>\n\n\n\n<p>For the past 18 months, Gatsby has funded Bahl&rsquo;s time on WPGraphQL&rsquo;s maintenance and development. During that time, the project had <a href=\"https://github.com/wp-graphql/wp-graphql/releases\">53 releases</a>, went from ~15,000 installs reported on Packagist.org to <a href=\"https://packagist.org/packages/wp-graphql/wp-graphql\">more than 85,000</a>, and launched the <a href=\"https://wordpress.org/plugins/wp-graphql/\">plugin</a> on WordPress.org with more than 8,000 installs active today and a 5-star average rating. The community around the project is also growing and has contributed more than 30 plugins to the library of <a href=\"https://wpgraphql.com/extensions/\">WPGraphQL extensions</a>.</p>\n\n\n\n<p>&ldquo;Gatsby&rsquo;s investment in WPGraphQL signaled that it wasn&rsquo;t just a hobby project, but was solving real problems for real users, and users should have confidence using it in their projects,&rdquo; Bahl said.</p>\n\n\n\n<p>After Gatsby started transitioning Bahl to work more on other Gatsby integrations, such as Contentful and Shopify, it translated into less time to work on WordPress and WPGraphQL. This prompted him to seek out another employer where he could prioritize working on headless WordPress.</p>\n\n\n\n<p>&ldquo;I feel right now is a unique time in history where more investment in WordPress as a headless CMS can change the future of WordPress,&rdquo; Bahl said. &ldquo;I believe WordPress is now more respected as a viable option for a headless CMS and that with the momentum of WPGraphQL, technologies like Gatsby, NextJS, and others, I need to spend&nbsp;<em>more</em>&nbsp;time focusing on WPGraphQL and headless WordPress, and not less time.&rdquo;</p>\n\n\n\n<p>Bahl found WP Engine at the right time and will be focusing on maintaining WPGraphQL and working on wider headless WordPress initiatives.</p>\n\n\n\n<p>&ldquo;We&rsquo;re going to be investing in headless WordPress, both in expanding our existing business as well as giving back to the community, as we have done for the past eleven years,&rdquo; WP Engine founder and CTO Jason Cohen said.</p>\n\n\n\n<p>&ldquo;We&rsquo;re already seeing some customers moving to headless.&nbsp; While we don&rsquo;t see the majority of WordPress sites doing that anytime soon, we do want to invest in those who are.&rdquo;</p>\n\n\n\n<p>In the meantime, WP Engine is creating a <a href=\"https://github.com/wpengine/headless-framework\">Headless WordPress Framework</a> that is in the early stages of development. The framework uses WPGraphQL and provides a plugin, a set of npm packages, and guides for creating headless WordPress sites using <a href=\"https://nextjs.org/\">Next.js</a>.</p>\n\n\n\n<p>&ldquo;GraphQL as a protocol offers a lot of advantages over REST, which is why it is being used so much, even by players outside of WordPress, like Gatsby,&rdquo; Cohen said. &ldquo;GraphQL includes type-safe schemas, is more discoverable, is easier to federate, and because it allows the clients so much flexibility in what data it wants (and does not want), it often results in fewer back-and-forth calls between client and server, while reducing the data being transferred to only that which the client actually needs. Because of the advantages of GraphQL, we believe a mature GraphQL API for WordPress will empower developers and site owners to move faster and with more confidence when they choose to go headless with WordPress.&rdquo;</p>\n\n\n\n<p>Bahl said WP Engine&rsquo;s investment in headless WordPress isn&rsquo;t limited to him continuing work on WPGraphQL. The company plans to hire more engineers for projects aimed at reducing the friction that developers and businesses experience when using WordPress as a headless CMS.</p>\n\n\n\n<p>&ldquo;I believe that WP Engine&rsquo;s investment in this space will allow WPGraphQL to grow and mature faster than ever before, as I will be part of a larger team working to make WordPress the best it can be,&rdquo; Bahl said.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 08 Feb 2021 23:22:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"WPTavern: Rough Pixels Releases Empt Lite, a Block-Supported Freemium WordPress Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111721\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:213:\"https://wptavern.com/rough-pixels-releases-empt-lite-a-block-supported-freemium-wordpress-theme?utm_source=rss&utm_medium=rss&utm_campaign=rough-pixels-releases-empt-lite-a-block-supported-freemium-wordpress-theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6419:\"<img />Single post view.\n\n\n\n<p class=\"has-drop-cap\">Empt Lite, the latest theme by Rough Pixels, <a href=\"https://wordpress.org/themes/empt-lite/\">landed in the WordPress theme directory</a> today. Like most of the company&rsquo;s prior work, the design is on par with the best free themes currently available.</p>\n\n\n\n<p>I have come to disregard that <em>icky</em> feeling whenever I see &ldquo;Lite&rdquo; attached to a theme name, at least when it falls under the Rough Pixels brand. The company does not deal in the <a href=\"https://wptavern.com/upsells-barriers-and-the-end-beginning-of-the-quality-free-themes-era\">stripped-down lite themes</a> I wrote about a couple of weeks ago. Empt Lite is one of those rare themes that does not downgrade the experience with the free version. Most additional features in the <a href=\"https://www.roughpixels.com/wordpress-themes/empt/\">pro version</a> seem to be value-adds for users who need something extra. There is almost an honesty to it. Users can get a feel for the theme quality before deciding to hand over money for the commercial version.</p>\n\n\n\n<p>Some pro features probably do not make sense as an upsell in the long run. WordPress&rsquo;s upcoming Full Site Editing (FSE) could make them obsolete. For example, an option for customizing archive titles will be easy to accomplish in the site editor. An &ldquo;about me&rdquo; widget will not be a great upsell a year from now. However, custom patterns for an &ldquo;about me&rdquo; section might make more sense.</p>\n\n\n\n<p>This is assuming the theme developer goes down the block-based theme path in the months to come. Looking at theme releases in 2021 needs to be done with an eye toward how they might function in an FSE world. This includes what freemium-based theme companies are upselling. Some will likely need to change tactics in time.</p>\n\n\n\n<p>The one missing feature that I would like to see Rough Pixels include in this theme and others is custom block patterns. They are already covering all of their bases with block editor styles. Now that patterns have been in WordPress since version 5.5, it is time to keep building on the work already in place. This is also an opportunity to transition toward <a href=\"https://wptavern.com/block-system-will-create-more-commercial-opportunities-for-wordpress-theme-authors\">selling design-based upgrades</a>. Put together some custom pattern packages and see what type of feedback customers provide.</p>\n\n\n\n<h2>Theme Features</h2>\n\n\n\n<p class=\"has-drop-cap\">In essence, Empt Lite is mostly a standard blogging theme. Where it shines is its support of the block editor.</p>\n\n\n\n<img />Wide-aligned Cover block.\n\n\n\n<p>One of the surest signs of a theme author doing their due diligence with block styles is to test a full-aligned Cover block with text afterward. If the text butts against the Cover, the theme probably has numerous other issues. If there is spacing between the two, the theme author likely took the time to test almost all WordPress blocks in various scenarios. <em>I promise you this test works 90% of the time.</em> Empt Lite passed this test and my entire block-testing suite with ease.</p>\n\n\n\n<p>The feature that immediately caught my eye was the gallery-style blog layout. Rather than the typical top-aligned or masonry-type grids, the theme employs an offset style reminiscent of the Twenty Twenty-One theme&rsquo;s image and gallery patterns.  The effect is achieved by using varying featured image orientations, which the theme aligns to the middle. It is a break from the monotony of typical layouts.</p>\n\n\n\n<img />Offset, gallery-style layout.\n\n\n\n<p>This gallery style does require that every post have a featured image. Posts without them simply disappear from the blog and archive pages, but not completely. These posts leave empty gaps, throwing off the layout. Their titles appear when hovering over seemingly-random spots on the page. There is also an empty <code>&lt;figure&gt;</code> tag in the source code. These are obviously bugs. If the theme author wants to support posts without featured images, the easiest solution would be to add a fallback.</p>\n\n\n\n<p>Users who love to customize their theme and make it their own will find enough theme options to whet their appetites. Whether it is colors and typography or post meta and the nine sidebars, the theme has settings to cover it.  Outside of the gallery blog layout, none of the customizer options seemed groundbreaking.</p>\n\n\n\n<p>If anything, I look forward to the day when theme authors do not have to build all of these options and relegate them to the site editor. Rough Pixels and others put so much custom code behind the customizer that it feels like a waste of development hours in the long term. FSE cannot get here soon enough.</p>\n\n\n\n<p>The theme has a few noticeable issues, but they are relatively trivial.</p>\n\n\n\n<p>The mouse cursor is set to &ldquo;pointer&rdquo; when hovering a post featured image, even when that image is not linked. <em>Yes, I unsuccessfully attempted to click a featured image multiple times, wondering why it was doing nothing.</em></p>\n\n\n\n<p>The wide-layout for single posts provides plenty of breathing room for custom layouts. However, the default font-size, set to 17px, is too small for comfortable long-form reading. There is an option to customize the size, but it applies to the text across the entire site and not just the post content on single views. Making it larger creates the opposite problem on non-single pages. When a project is billed as a blog theme, words-per-line matter. Nailing the typography is a must, even when it is on an alternative layout option. Outside of this one case, the theme gets the defaults right.</p>\n\n\n\n<p>The default quote style can make the text tough to read. The quote icon in the background bleeds too much into the foreground. I love the style; the color just needs to be dialed back while letting the text take center stage. The theme provides an option for changing the blockquote icon&rsquo;s color. I suggest tinkering with it.</p>\n\n\n\n<img />Blockquote style.\n\n\n\n<p>Overall, this is one of the better themes to land in the WordPress theme directory in the past few months. Recreating the <a href=\"https://demos.roughpixels.com/empt-lite/\">theme&rsquo;s demo</a> requires almost no fuss. The typography is on-point for a blogging theme, and it works well with the block editor.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 08 Feb 2021 22:47:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Matt: Parse.ly &amp; Automattic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53692\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"https://ma.tt/2021/02/parse-ly-automattic/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2030:\"<p>Excited to <a href=\"https://blog.parse.ly/post/9995/wpvip-acquisition/\">welcome Parse.ly</a> to the <a href=\"https://automattic.com/\">Automattic</a> family, in an acquisition that&#8217;s closing today. They&#8217;ll be <a href=\"https://wpvip.com/2021/02/08/parsely-acquisition/\">joining our enterprise group, WPVIP</a>. The deal has been nicely covered in <a href=\"https://www.wsj.com/articles/wordpress-vip-buying-content-analytics-firm-parse-ly-11612788609\">the Wall Street Journal</a> and <a href=\"https://www.axios.com/wordpress-vip-acquiring-content-analytics-company-parsely-f4b9cc5f-55a9-49db-a8c5-dd3759b7e8e9.html\">Axios</a>. As a bonus, here&#8217;s Parse.ly co-founder Andrew Montalenti&#8217;s <a href=\"https://ma.tt/2012/09/future-of-work/#comment-568316\">first comment on this blog</a>, in 2012.</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Great article, Matt. I wrote about this on my blog &#8212; Fully Distributed Teams: Are They Viable?</p><p><a href=\"http://www.pixelmonkey.org/2012/05/14/distributed-teams\">http://www.pixelmonkey.org/2012/05/14/distributed-teams</a></p><p>In it, I drew the distinction between &#8220;horizontally scaled&#8221; teams, in which physical offices are connected to remote workers via satellite (home or commercial) offices, and &#8220;fully distributed&#8221; teams where, as you said, &#8220;the creative center and soul of the organization on the internet, and not in an office.&#8221;</p><p>At Parse.ly, we&#8217;re only a couple years old but have been operating on the distributed team model, with ~13 fully distributed employees, and it&#8217;s working well. Always glad to hear stories about how Automattic has scaled it to 10X our size.</p><p>And, likewise, we blow some of our office space savings on camaraderie-building retreats; our most recent one was in New York, see [<a href=\"http://www.flickr.com/photos/amontalenti/sets/72157629938809778/\">here</a>] and [<a href=\"http://www.flickr.com/photos/amontalenti/sets/72157630060466656/\">here</a>.]</p></blockquote>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 08 Feb 2021 17:58:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:131:\"WPTavern: Gutenberg 9.9 Adds Color Options for Social Icons, Includes Rounded Borders for Images, and Changes the Theme JSON Format\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111628\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:303:\"https://wptavern.com/gutenberg-9-9-adds-color-options-for-social-icons-includes-rounded-borders-for-images-and-changes-the-theme-json-format?utm_source=rss&utm_medium=rss&utm_campaign=gutenberg-9-9-adds-color-options-for-social-icons-includes-rounded-borders-for-images-and-changes-the-theme-json-format\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7460:\"<p class=\"has-drop-cap\">Version 9.9 of the <a href=\"https://wordpress.org/plugins/gutenberg/\">Gutenberg plugin</a> landed earlier today. While it includes several minor UI improvements, the biggest user-facing change is the inclusion of icon and background color options for the Social Links block. Theme authors can now add support for rounded image borders. They are also faced with a breaking change to their theme JSON files.</p>\n\n\n\n<p><a href=\"https://wptavern.com/wordpress-5-7-beta-1-is-ready-for-testing\">WordPress 5.7 Beta 1 </a>was released earlier this week. The final 5.7 release will include features from Gutenberg 9.9 back down to 9.3. Only bug fixes from upcoming plugin updates should be ported into WordPress during the rest of the development cycle.</p>\n\n\n\n<p>The development team squashed over 30 bugs in the latest plugin update. It also includes several enhancements and API updates. Plugin developers can now <a href=\"https://github.com/WordPress/gutenberg/pull/28482\">override the block category</a> when registering variations, which should help with discoverability.</p>\n\n\n\n<p>Full Site Editing and other experimental work continued as usual. One item that theme authors should keep an eye on is the initial groundwork for additional <a href=\"https://github.com/WordPress/gutenberg/pull/28049\">border options</a>. The experimental feature for adding border colors, styles, and widths for blocks has long been on the wish list of many. I expect that the team will start slowly rolling out block support and a UI in coming versions.</p>\n\n\n\n<h2>Color Options for Social Links</h2>\n\n\n\n<img />Icon and background colors for Social Links.\n\n\n\n<p class=\"has-drop-cap\">Users can now <a href=\"https://github.com/WordPress/gutenberg/issues/21605\">change the icon color and background</a> in the Social Links block. This change allows the user to customize the colors for all icons in the links list. The &ldquo;logos only&rdquo; block style does not support a background color.</p>\n\n\n\n<p>The missing piece is the ability to set individual icon colors and their hover colors. One of the use cases in theme design is to provide a solid-colored group of icons that change to the brand colors on hover or focus. The only way to do this from the user&rsquo;s end is via individual icon color options. Even the ability to set the icon hover color for the entire block is still unavailable.</p>\n\n\n\n<p>Branding guidelines were <a href=\"https://github.com/WordPress/gutenberg/issues/21605#issuecomment-629318653\">mentioned as a concern</a> with the current color options, but that concern is outside the scope of WordPress&rsquo;s responsibility (see <a href=\"https://github.com/WordPress/gutenberg/pull/21900#issuecomment-624307120\">longer analysis regarding logos</a>). Many brands also have alternate colors they allow, which are not possible to use without icon-specific colors.</p>\n\n\n\n<p>Setting the background and text color for all icons at once is a step in the right direction, but the block editor is still not matching what theme authors are doing in traditional theme design. These missing features are blockers for the eventual adoption of Full Site Editing.</p>\n\n\n\n<h2>Rounded Border Support for Themes</h2>\n\n\n\n<img />Border radius setting for the Image block.\n\n\n\n<p class=\"has-drop-cap\">Theme authors can now <a href=\"https://github.com/WordPress/gutenberg/pull/27667\">opt into border-radius support</a> for images. Support comes in two forms. One is a setting to allow end-users to customize the border-radius via the block options sidebar. The second is setting a default border-radius value for all images.</p>\n\n\n\n<p>The Gutenberg team first added border-radius support to the Group block in <a href=\"https://wptavern.com/gutenberg-9-8-brings-rounded-borders-to-the-group-block-and-moves-the-site-editor-canvas-into-an-inline-frame\">version 9.8</a>. Currently, only the Group and Image blocks support the feature.</p>\n\n\n\n<p>The following theme JSON code will add settings and styles support. Note the new format change, which is covered in the next section.</p>\n\n\n\n<pre class=\"wp-block-code\"><code>{\n    \"settings\": {\n        \"core/image\": {\n            \"border\": {\n                \"customRadius\": true\n            }\n        }\n    },\n    \"styles\": {\n        \"core/image\": {\n            \"border\" : {\n                \"radius\": \"10px\"\n            }\n        }\n    }\n}</code></pre>\n\n\n\n<h2>New Theme JSON File Format</h2>\n\n\n\n<p class=\"has-drop-cap\">Gutenberg 9.9 introduces two breaking changes to the <code>experimental-theme.json</code> file, which will eventually be renamed to <code>theme.json</code> once it is out of the experimental stage. This file allows theme authors to configure custom styles and settings for the block system. Any themes currently using the pre-9.9 format will need to be updated.</p>\n\n\n\n<p>The first change makes <code>settings</code> and <code>styles</code> <a href=\"https://github.com/WordPress/gutenberg/pull/28110\">top-level keys in the file</a>. The second change <a href=\"https://github.com/WordPress/gutenberg/pull/28533\">renames and splits</a> the <code>global</code> key to <code>defaults</code> and <code>root</code>. <code>defaults</code> deal with default values and styles while <code>root</code> handles the site root block.</p>\n\n\n\n<p>Ari Stathopoulos wrote a <a href=\"https://make.wordpress.org/themes/2021/02/04/gutenberg-9-9-new-json-structure-for-theme-json-files/\">tutorial for theme authors</a> to update their themes on the Make Themes blog.</p>\n\n\n\n<p>&ldquo;The rationale for this change is that the use cases for theme.json have grown beyond initially considered, and the vision is now being able to absorb a lot of things that themes declare at the moment via other means,&rdquo; wrote Andr&eacute;s Maneiro, the creator of both tickets. &ldquo;Some examples are registering (and translate?) custom templates, declare theme metadata that is currently stored in the stylesheet, declare stylesheet paths, etc.&rdquo;</p>\n\n\n\n<p>He also shared a vision of what the format might look like:</p>\n\n\n\n<pre class=\"wp-block-code\"><code>{\n    \"name\": \"TwentyTwentyOne\",\n    \"description\": \"...\",\n    \"customTemplates\": ...,\n    \"textDomain\": ...,\n    \"version\": 1,\n    \"settings\": {\n            \"global\": { ... },\n            \"core/paragraph\": { ... }\n    },\n    \"styles\": {\n            \"global\": { ... },\n            \"core/paragraph\": { ... }\n    }\n}</code></pre>\n\n\n\n<p>For users, this data might not make much sense. However, any theme author should be able to recognize the significance of potentially moving metadata that is currently stored in their theme&rsquo;s <code>style.css</code> through a non-standard system that WordPress has used for ages. Eventually moving that data to a standard format, JSON, would give WordPress flexibility to shed some of its legacy baggage.</p>\n\n\n\n<p>WordPress themes currently have a hard requirement of including a <code>style.css</code> file. We could well be on our way to building WordPress themes that have no need for a stylesheet at all. The future of FSE is likely one in which CSS is all handled through the Global Styles system with the theme&rsquo;s default values set via the <code>theme.json</code> file. If a theme has no styles, it does not make sense to hold onto the <code>style.css</code> file.</p>\n\n\n\n<p>However, this change is not merely limited to that possibility. The new format is cleaner and better prepared for future additions.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 05 Feb 2021 21:53:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: Newspack Publishes Showcase with 60 Newsrooms Launched\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111568\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:173:\"https://wptavern.com/newspack-publishes-showcase-with-60-newsrooms-launched?utm_source=rss&utm_medium=rss&utm_campaign=newspack-publishes-showcase-with-60-newsrooms-launched\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4464:\"<p><a href=\"https://newspack.pub/\">Newspack</a>, a project funded by the Google News initiative and WordPress.com, has published a <a href=\"https://raindrop.io/collection/11158847\">showcase</a> of 60 news sites running on the platform. WordPress.com <a href=\"https://wptavern.com/wordpress-com-secures-2-4-million-in-funding-from-google-and-partners-to-build-a-publishing-platform-for-news-organizations\">announced</a> its plans to build the Newspack CMS two years ago and successfully signed on more than 50 sites in the first year. The cloud-based platform is open source and highly customized to generate revenue for small to medium-sized publications.</p>\n\n\n\n<p>Early adopters include the <a href=\"https://austinweeklynews.com/\">Austin Weekly News</a>, <a href=\"https://mississippitoday.org/\">Mississippi Today</a>, <a href=\"https://hongkongfp.com/\">Hong Kong Free Press</a>, <a href=\"https://oklahomawatch.org/\">Oklahoma Watch</a>, <a rel=\"noreferrer noopener\" href=\"https://bangordailynews.com/\" target=\"_blank\">Bangor Daily News</a>,&nbsp;<a rel=\"noreferrer noopener\" href=\"https://oaklandside.org/\" target=\"_blank\">The Oaklandside</a>, and many other watchdog publications serving their communities with vital local news coverage. </p>\n\n\n\n<p>The <a href=\"https://raindrop.io/collection/11158847\">showcase</a> was created using the Raindrop bookmark manager, which allows viewers to search for a specific site and see all the various homepages at a glance. The diversity of the publications is striking, but clicking through to their websites it&rsquo;s clear that most of them share an intimate connection with their communities that might otherwise have evaporated in the <a href=\"https://wptavern.com/finding-wordpress-in-the-post-print-news-era\">post-print news era</a>. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Newspack stands out as an affordable, open source alternative to proprietary systems. Publishers generally pay <a href=\"https://newspack.pub/pricing/\">$500-$2,000/month</a> using a sliding scale based on their annual revenue. The <a href=\"https://newspack.pub/2019/08/12/see-the-revenue-generation-features-of-newspack-in-action/\">tools</a> they are given are open and designed to help create economically sustainable journalism. It&rsquo;s not surprising that a community has sprung up around the product, as small publishers share many of the same issues.  A dedicated Slack workspace. facilitates conversation and collaboration for more than 150 editors, designers, product and business people who are all using the same building blocks to run their publications.</p>\n\n\n\n<p>In 2020, thirteen Newspack publications were awarded <a href=\"https://newspack.pub/2020/05/07/newspack-publishers-earn-share-of-covid-19-relief-package/\">a total of more than $1 million in grants</a> from the Facebook Journalism Program&rsquo;s relief effort for local news due to Covid-19. Publishing online at a low cost on WordPress has helped many of these publications weather the pandemic, instead of being forced to consolidate or shutter. </p>\n\n\n\n<p>In May, 2020, analysts from&nbsp;<a href=\"https://fundjournalism.org/\">News Revenue Hub</a> published a <a href=\"https://fundjournalism.org/2020/05/26/hub-report-several-sites-are-now-on-newspack-hows-that-going/?utm_source=dlvr.it&utm_medium=twitter\">study</a> examining how Newspack-powered newsrooms are interacting with WordPress. A few key findings showed that Newspack users may require more assistance in managing their sites, which leverage the block editor and come with more than 50 pre-configured plugins:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>The role of Newspack in reducing or replacing the need for website management-related technical resources is unclear, and depends greatly on an individual newsroom&rsquo;s technical knowledge and resources.</p><p>Potential improvements going forward should focus on providing deeper, more standardized education and documentation to broad groups of users.</p></blockquote>\n\n\n\n<p>The report concluded that &ldquo;Newspack has established itself as a valuable tool for newsrooms, as well as a valuable method for building sites collaboratively,&rdquo; but warns that the project may face challenges in scaling the hands-on support that pilot newsrooms received in the early stages. More revenue-generating features are still being developed but overall participating newsrooms had a high rate of satisfaction with the platform.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 05 Feb 2021 06:38:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"WPTavern: Call for Feedback on Theme Review Action, a New Automated WordPress Theme Testing Project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111325\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:241:\"https://wptavern.com/call-for-feedback-on-theme-review-action-a-new-automated-wordpress-theme-testing-project?utm_source=rss&utm_medium=rss&utm_campaign=call-for-feedback-on-theme-review-action-a-new-automated-wordpress-theme-testing-project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5176:\"<img />GitHub output of Theme Review Action.\n\n\n\n<p class=\"has-drop-cap\">Automation. It is one of those dreams in the minds of many reviewers from the Themes Team. If there was a tool to take care of 90% of the issues, the team could focus on the 10% not easily found by automated scripts.</p>\n\n\n\n<p>Enter the <a href=\"https://github.com/WordPress/theme-review-action\">Theme Review Action</a> project. Steve Dufresne, a WordPress Meta team contributor, put out a <a href=\"https://make.wordpress.org/meta/2021/02/01/call-for-feedback-automated-theme-testing/\">call for testing and feedback </a>of the new project on Monday.</p>\n\n\n\n<p>&ldquo;If we could combine some of the existing code analysis tools, automate away some of the manual testing and open them up to more development workflows, could we improve theme quality, alleviate pressure on manual testing, and speed up the theme review process?&rdquo; asked Dufresne.</p>\n\n\n\n<p>The project currently runs several test suites, including the current <a href=\"https://wordpress.org/plugins/theme-check/\">Theme Check</a> plugin. Theme authors can run the texts by running the NPX command in their theme folder, adding it as an action on GitHub, or cloning and running it locally. Running via NPX is not currently supported on Windows.</p>\n\n\n\n<p>Right now, theme authors are needed. Regardless of whether you are building themes for the directory, clients, third-party marketplaces, or a theme shop, this is an opportunity to give back to WordPress. It is also an opportunity to improve the tools that you could benefit from as a theme developer in the long term. Automated theme tests help the entire theme ecosystem.</p>\n\n\n\n<p>&ldquo;Theme authors need to be open to this and understand that it is not all about requirements,&rdquo; said Carolina Nymark, a Themes Team representative. &ldquo;It is about improving theme quality.&rdquo;</p>\n\n\n\n<p>The project was, in part, informed by a Themes Team <a href=\"https://make.wordpress.org/themes/2020/04/03/proposal-github-theme-review/\">proposal in early 2020</a>. Denis &#381;oljom identified three problems the team was fighting against:</p>\n\n\n\n<ul><li>People don&rsquo;t like to read requirements or handbooks.</li><li>Some of the issues that are popping up are repetitive and could be caught automatically.</li><li>Reviewing themes in Trac is really cumbersome.</li></ul>\n\n\n\n<p>The proposal&rsquo;s focus was on moving reviews to GitHub, focusing on the third point. However, the Theme Review Action project could be the start of handling one or more issues.</p>\n\n\n\n<p>The obvious solution is that the project can be automated. However, because the Theme Review Action project can be set as a GitHub Action, it leaves room for the team&rsquo;s GitHub review proposal.</p>\n\n\n\n<p>&ldquo;Two things I mentioned to Steve &mdash; and these are my opinions &ndash;, is that we need checks that run on theme upload and on live themes, and we need a long-term solution,&rdquo; said Nymark. &ldquo;There have been attempts to automate testing before that have not been followed through, and without a plan for how the tool will be used, I am worried about spending time on it.&rdquo;</p>\n\n\n\n<p>The team had hoped that the <a href=\"https://make.wordpress.org/themes/handbook/theme-sniffer/\">Theme Sniffer</a> project would lead to more automation at one point. It is hard to get hopes up after previous goals never came to fruition.</p>\n\n\n\n<p>&ldquo;I too have a similar concern where the project might not get enough adoption to make it to .ORG checking, and that is one of the reasons (other than just being super busy) that I haven&rsquo;t been able to prioritize looking at [Theme Review Action],&rdquo; said Themes Team rep William Patton.</p>\n\n\n\n<p>While the team and some theme authors still use the Theme Sniffer, the UI leaves a lot to be desired. Nymark pointed out that it was hard for theme authors to distinguish between the baseline requirements and recommendations.</p>\n\n\n\n<p>&ldquo;To display messages from automated tools that are not strictly requirements is very difficult to get right,&rdquo; she said. &ldquo;For example, if a tool started reporting CSS linting errors for the WordPress CSS coding standards, many people would find that too opinionated and limiting.&rdquo;</p>\n\n\n\n<p>Theme authors, the group that reaps the most financial and reputational benefits from the theme directory, have often been reluctant to chip in. Few companies spare an employee to perform reviews or work on tools that developers and the team need. Calls for testing, feedback, and discussion often go unanswered, leaving a select few to do the lion&rsquo;s share of the work. For this project to be successful and not feel like something foisted upon them down the road, theme developers need to be in the mix.</p>\n\n\n\n<p>In the <a href=\"https://wptavern.com/wordpress-launches-wp-briefing-podcast-episodes-expected-every-2-weeks\">first episode</a> of the WP Briefing podcast, WordPress Executive Director Josepha Haden Chomphosy talked about focusing on automation as one of this year&rsquo;s goals. If there is one team that could use such tools, it would be the Themes Team.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 04 Feb 2021 22:51:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"WPTavern: New Report Estimates WordPress’ Market Share of US Higher Education Institution Websites at 40.8%\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111416\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:255:\"https://wptavern.com/new-report-estimates-wordpress-market-share-of-us-higher-education-institution-websites-at-40-8?utm_source=rss&utm_medium=rss&utm_campaign=new-report-estimates-wordpress-market-share-of-us-higher-education-institution-websites-at-40-8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2613:\"<p>A new <a href=\"https://www.eqafy.com/component/content/article/49-higher-education-research/315-us-university-and-college-content-management-systems-2021.html\">report</a> from eQAfy, a company that collects and analyzes data about higher education websites, has benchmarked which content management systems US institutions are using. The report is a snapshot of data from December 2020, sourced from the&nbsp;<a href=\"https://nces.ed.gov/\">National Center for Education Statistics</a>&nbsp;<a href=\"https://nces.ed.gov/ipeds/\">IPEDS database</a>. After scanning a list of 4,000 active institutions,  EQAfy&rsquo;s headless browser was able to detect the CMS for 3,359 homepages (83.8%).</p>\n\n\n\n<p>A market leading group of 12 content management systems made up 90% of the homepages eQAfy detected, including four open source solutions and eight proprietary solutions. WordPress captures 40.8% of the market, followed by Drupal at 19.1%, as measured across all institution types (public, private for profit, and private non-profit), levels (2-year and 4-year), and sizes.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>WordPress&rsquo; estimated market share for public institutions came in at 27%, and is much higher in the private for-profit institutions category at 55%. </p>\n\n\n\n<p>Looking at 2-year public higher education institutions by student population, WordPress falls to #3 at just 18.3%. Drupal leads the pack in that category with 29.2%, and proprietary CMS&rsquo;s take up the rest of the market. WordPress does much better in the category of 4-year private for-profit higher education institutions, capturing a staggering 75% of the market.</p>\n\n\n\n<p>When examining CMS suppliers for institutions by size, WordPress is the overall market leader but does far better in the smallest institutional size categories, with waning dominance in the large to very large categories.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>The <a href=\"https://www.eqafy.com/component/content/article/49-higher-education-research/315-us-university-and-college-content-management-systems-2021.html#table-10-2-year-private-non-profit-institutions\">report</a> has more interesting data comparisons across different categories if you want to dig deeper. It&rsquo;s important to note that eQAfy only collected the main websites for these institutions, which may not be representative of the CMS that powers the schools&rsquo; ancillary websites. They are often created using a combination of platforms. This report covers only which CMS the schools preferred to use for the face of their institutions.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 04 Feb 2021 04:48:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: FSE and WordPress Themes: What Does the MVP Look Like?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111262\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:169:\"https://wptavern.com/fse-and-wordpress-themes-what-does-the-mvp-look-like?utm_source=rss&utm_medium=rss&utm_campaign=fse-and-wordpress-themes-what-does-the-mvp-look-like\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8894:\"<p class=\"has-drop-cap\">Josepha Haden Chomphosy, the Executive Director of WordPress, <a href=\"https://make.wordpress.org/core/2021/02/01/full-site-editing-and-themes-where-things-are/\">posted a follow-up</a> to her <a href=\"https://make.wordpress.org/updates/2021/01/21/big-picture-goals-2021/\">outline of the upcoming year</a>. Questions mounted about what a minimum viable product (MVP) looked like for Full Site Editing (FSE), which is expected to be ready in the Gutenberg plugin in April. The core team is also shooting for a June launch of FSE in WordPress when it ships WordPress 5.8.</p>\n\n\n\n<p>These seem like lofty goals, but members of the WordPress development and business community were left asking, &ldquo;What is an MVP for FSE?&rdquo; This is not a new question. Whether it is the swift pace of development, a communication breakdown, or so much of the project being hidden behind layer upon layer of GitHub issues, it can be hard to follow. There is no big webpage that spells out each step in minute detail of where the project is going. Information can sometimes feel scattered. This can give pause to third-party developers and business owners who need to know what to expect to update their products.</p>\n\n\n\n<p>Joost de Valk, the CPO of Yoast, <a href=\"https://make.wordpress.org/updates/2021/01/21/big-picture-goals-2021/#comment-4975\">voiced his frustration</a> with the process in the comments. We later discussed this in more detail.</p>\n\n\n\n<p>&ldquo;I think FSE will change what a theme is, and, if it gets executed properly, will make it far easier to build a theme, as themes will be much smaller,&rdquo; he said. &ldquo;That brings the burden onto the community to come up with reliable methods of styling though, and conventions on class names or similar, to make styling work everywhere. I currently don&rsquo;t understand what is even considered as MVP for Full Site Editing, nor do I see any discussions about how it&rsquo;ll work with themes not purpose built for it, and that worries me.&rdquo;</p>\n\n\n\n<p>He shares some of the same concerns as others in the community who feel like there is no process in place for an MVP.</p>\n\n\n\n<p>&ldquo;And there is no such thing,&rdquo; he said. &ldquo;Vision without execution is just hallucination.&rdquo;</p>\n\n\n\n<p>Chomphosy said that she was aware of the interconnectedness. &ldquo;I also see that the information we have published isn&rsquo;t in a tidy and followable post that would help people make good decisions on behalf of 39% of the web,&rdquo; she said.</p>\n\n\n\n<p>She pointed to a <a href=\"https://github.com/WordPress/gutenberg/issues/24551\">ticket that lists six (now seven) milestones</a>. Each of those milestones, when taken together, represent where FSE needs to be for an MVP.</p>\n\n\n\n<p>&ldquo;Together they outline an architecture that allows the expression of a full theme using blocks and an editor capable of customizing that theme,&rdquo; she wrote. &ldquo;<strong>The MVP should make it possible to build a version of the Twenty Twenty-One theme, using only blocks, without any coding knowledge.</strong>&ldquo;</p>\n\n\n\n<p>The following is a breakdown of the milestones that need to reach completion before we see the first version of FSE land in WordPress:</p>\n\n\n\n<h2>Milestone 1: Infrastructure and UI</h2>\n\n\n\n<p>Perhaps the most crucial part of FSE is a <a href=\"https://github.com/WordPress/gutenberg/issues/24818\">workable site editor</a>. Merging the WordPress templating system into a cohesive UI is the foundation of the project. The underlying infrastructure handles how templates and template parts work. At this point, this foundation is in a reliable spot. It is all the features that build upon it that need more work. This milestone also includes getting the site-editing interface in place and handling multi-entity saving.</p>\n\n\n\n<p>The final leg of the milestone allows users to <a href=\"https://github.com/WordPress/gutenberg/issues/27814\">edit templates</a> from within the post editor, effectively switching between content and design editing. The FSE Outreach Program recently <a href=\"https://wptavern.com/first-round-of-the-fse-outreach-program-concludes-identifies-template-editing-mode-problems\">tested this feature</a> to garner feedback after Gutenberg 9.6.</p>\n\n\n\n<h2>Milestone 2: Browsing</h2>\n\n\n\n<p>This milestone covers all of the work for <a href=\"https://github.com/WordPress/gutenberg/issues/24552\">navigating the UI</a> of the site editor. There are many moving parts, such as switching between pages, templates, template parts, global styles, and more. Users must know which element they are working on.</p>\n\n\n\n<p>This is the only milestone marked as completed. However, there is an open ticket for exploring the idea of a <a href=\"https://github.com/WordPress/gutenberg/issues/23328\">&ldquo;browsing&rdquo; mode</a> alongside the edit and select modes.</p>\n\n\n\n<h2>Milestone 3: Styling</h2>\n\n\n\n<p>For the most part, this milestone centers on the upcoming Global Styles system. The <a href=\"https://github.com/WordPress/gutenberg/issues/20331\">system creates a hierarchy</a> of how styles are applied to blocks from theme defaults to global user modifications, down to per-block style options.</p>\n\n\n\n<p>While much of the work is complete for an MVP, there are dozens of feature tickets in the backlog. This is also an area where the block system is years behind third-party page builders. Expect to see long-term feature additions based on post-launch feedback.</p>\n\n\n\n<h2>Milestone 4: Theme Blocks</h2>\n\n\n\n<p>Theme authors should keep a close eye on this ticket. The only way that block-based themes become a reality for most theme developers is if all <a href=\"https://github.com/WordPress/gutenberg/issues/22724\">template tags have a corresponding block</a> in the site editor. Or, at least if the most-used template tags do. Some of these functions are no longer applicable in the block editor. Theme developers should make sure they have the blocks they need to recreate anything they are building today.</p>\n\n\n\n<p>Admittedly, I am sad to see that blocks for Bookmarks/Links are unlikely to be moving forward. While the feature is deprecated, I am still nostalgic about the good ol&rsquo; blogroll days. Maybe this would be best left a plugin. A revival of the <a href=\"https://wordpress.org/plugins/link-manager/\">Link Manager</a> plugin could be in order.</p>\n\n\n\n<h2>Milestone 5: Query Block</h2>\n\n\n\n<p>The <a href=\"https://github.com/WordPress/gutenberg/issues/24762\">Query block</a> and its corresponding Loop block are, in some ways, the most essential pieces of Full Site Editing. They handle what posts are loaded and how they are displayed. The feature is one of the more complex puzzles to solve. The Gutenberg development team has continued iterating on it for months, and it is now at a good baseline. However, it has miles to go before it can seriously handle all the things that theme authors need to do with it.</p>\n\n\n\n<p>Right now, the Query block only handles a handful of options for customizing the query. The team needs to determine what controls should be available in the sidebar for end-users and integrate the blocks with patterns for different types of post-list displays.</p>\n\n\n\n<h2>Milestone 6: Navigation Block</h2>\n\n\n\n<p>Aside from the Query block, Navigation is the only other block that requires <a href=\"https://github.com/WordPress/gutenberg/issues/27593\">its own milestone</a>. Navigation menu issues have plagued the WordPress project for well over a decade. It is one of the hardest things to get right. While nav menus in WordPress today are generally easy to work with, their design is not customizable by the end-user. The output is wholly at the theme author&rsquo;s discretion. Catering to the array of possible menu designs theme authors might want and making it customizable for the end-user is likely one of the toughest problems for the Gutenberg project.</p>\n\n\n\n<p>There are at least a couple of dozen sub-tickets that need contributors. Even then, it could be several versions later before the Navigation block is ready for the more complex patterns used in some themes today.</p>\n\n\n\n<h2>Milestone 7: Gradual Adoption</h2>\n\n\n\n<p>After the first six milestones representing the MVP are completed, WordPress needs a way to allow end-users and theme authors to gradually adopt FSE. Primarily, this would be a mix of block-based templates and traditional PHP-based templates. Developers should be allowed to update their themes without changing them wholesale, potentially leaving segments of their user base behind.</p>\n\n\n\n<p>Block-based widgets and navigation screens also fall under this milestone. Both features were punted to future releases after failing to land in 2020. However, these will be stepping stones for users who are not quite ready to switch to FSE or are unable to because of their theme.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 22:55:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WordPress.org blog: WordPress 5.6.1 Maintenance Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9574\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/news/2021/02/wordpress-5-6-1-maintenance-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8265:\"<p>WordPress 5.6.1 is now available!</p>\n\n\n\n<p>This maintenance release features&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&milestone=5.6.1&group=status&col=id&col=summary&col=status&col=milestone&col=owner&col=type&col=priority&order=priority\">20 bug fixes</a> as well as&nbsp;7 issues fixed for the&nbsp;block&nbsp;editor. These bugs affect WordPress version 5.6, so you’ll want to upgrade.</p>\n\n\n\n<p>You can&nbsp;<a href=\"https://wordpress.org/wordpress-5.6.1.zip\">download WordPress 5.6.1 directly</a>, or visit the<strong>&nbsp;Dashboard → Updates</strong>&nbsp;screen&nbsp;and click&nbsp;<strong>Update Now</strong>. If your sites support automatic background updates, they’ve already started the update process.</p>\n\n\n\n<p>WordPress 5.6.1 is a short-cycle maintenance release. The next major release will be&nbsp;<a href=\"https://make.wordpress.org/core/5-7/\">version 5.7</a>.</p>\n\n\n\n<p>To see a full list of changes, you can browse the&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&milestone=5.6.1&group=status&col=id&col=summary&col=status&col=milestone&col=owner&col=type&col=priority&order=priority\">list on Trac</a>, read the&nbsp;<a href=\"https://make.wordpress.org/core/2021/01/28/wordpress-5-6-1-rc1/\">5.6.1 RC1</a>&nbsp;post, or visit the&nbsp;<a href=\"https://wordpress.org/support/wordpress-version/version-5-6-1/\">5.6.1 documentation page</a>.</p>\n\n\n\n<h2>Thanks and props!</h2>\n\n\n\n<p>The 5.6.1 release was led by <a href=\"https://profiles.wordpress.org/audrasjb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>audrasjb</a>, <a href=\"https://profiles.wordpress.org/desrosj/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>desrosj</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>sergeybiryukov</a> and <a href=\"https://profiles.wordpress.org/whyisjake/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>whyisjake</a>. Thanks to <a href=\"https://profiles.wordpress.org/metalandcoffee/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>metalandcoffee</a> and <a href=\"https://profiles.wordpress.org/hellofromtonya/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>hellofromtonya</a> for running bug scrubs, <a href=\"https://profiles.wordpress.org/planningwrite/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>planningwrite</a> and <a href=\"https://profiles.wordpress.org/davidbaumwald/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>davidbaumwald</a> for their help on the release post.</p>\n\n\n\n<p>Props to everyone who helped make WordPress 5.6.1 happen:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/aaribaud/\">aaribaud</a>, <a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>, <a href=\"https://profiles.wordpress.org/engahmeds3ed/\">Ahmed Saeed</a>, <a href=\"https://profiles.wordpress.org/azaozz/\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/antpb/\">Anthony Burchell</a>, <a href=\"https://profiles.wordpress.org/archon810/\">archon810</a>, <a href=\"https://profiles.wordpress.org/aristath/\">Ari Stathopoulos</a>, <a href=\"https://profiles.wordpress.org/ayeshrajans/\">Ayesh Karunaratne</a>, <a href=\"https://profiles.wordpress.org/basscan/\">basscan</a>, <a href=\"https://profiles.wordpress.org/carloscastilloadhoc/\">carloscastilloadhoc</a>, <a href=\"https://profiles.wordpress.org/poena/\">Carolina Nymark</a>, <a href=\"https://profiles.wordpress.org/celendesign/\">celendesign</a>, <a href=\"https://profiles.wordpress.org/cfinke/\">Christopher Finke</a>, <a href=\"https://profiles.wordpress.org/copons/\">Copons</a>, <a href=\"https://profiles.wordpress.org/danfarrow/\">Dan Farrow</a>, <a href=\"https://profiles.wordpress.org/talldanwp/\">Daniel Richards</a>, <a href=\"https://profiles.wordpress.org/davidbinda/\">david.binda</a>, <a href=\"https://profiles.wordpress.org/denisco/\">Denis Yanchevskiy</a>, <a href=\"https://profiles.wordpress.org/dilipbheda/\">Dilip Bheda</a>, <a href=\"https://profiles.wordpress.org/ocean90/\">Dominik Schilling</a>, <a href=\"https://profiles.wordpress.org/metalandcoffee/\">Ebonie Butler</a>, <a href=\"https://profiles.wordpress.org/flixos90/\">Felix Arntz</a>, <a href=\"https://profiles.wordpress.org/mista-flo/\">Florian TIAR</a>, <a href=\"https://profiles.wordpress.org/garrett-eclipse/\">Garrett Hyder</a>, <a href=\"https://profiles.wordpress.org/gkibria69/\">gKibria</a>, <a href=\"https://profiles.wordpress.org/gziolo/\">Greg Ziółkowski</a>, <a href=\"https://profiles.wordpress.org/helen/\">Helen Hou-Sandi</a>, <a href=\"https://profiles.wordpress.org/iandunn/\">Ian Dunn</a>, <a href=\"https://profiles.wordpress.org/ifnoob/\">ifnoob</a>, <a href=\"https://profiles.wordpress.org/isabel_brison/\">Isabel Brison</a>, <a href=\"https://profiles.wordpress.org/ismailelkorchi/\">Ismail El Korchi</a>, <a href=\"https://profiles.wordpress.org/whyisjake/\">Jake Spurlock</a>, <a href=\"https://profiles.wordpress.org/macmanx/\">James Huff</a>, <a href=\"https://profiles.wordpress.org/madtownlems/\">Jason LeMahieu (MadtownLems)</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/johnbillion/\">John Blackbourn</a>, <a href=\"https://profiles.wordpress.org/desrosj/\">Jonathan Desrosiers</a>, <a href=\"https://profiles.wordpress.org/jonathanstegall/\">Jonathan Stegall</a>, <a href=\"https://profiles.wordpress.org/jorgefilipecosta/\">Jorge Costa</a>, <a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha</a>, <a href=\"https://profiles.wordpress.org/justinahinon/\">Justin Ahinon</a>, <a href=\"https://profiles.wordpress.org/kevin940726/\">Kai Hao</a>, <a href=\"https://profiles.wordpress.org/ryelle/\">Kelly Choyce-Dwan</a>, <a href=\"https://profiles.wordpress.org/kjellr/\">Kjell Reigstad</a>, <a href=\"https://profiles.wordpress.org/xkon/\">Konstantinos Xenos</a>, <a href=\"https://profiles.wordpress.org/litemotiv/\">litemotiv</a>, <a href=\"https://profiles.wordpress.org/lucasbustamante/\">lucasbustamante</a>, <a href=\"https://profiles.wordpress.org/akramipro/\">Mahdi Akrami</a>, <a href=\"https://profiles.wordpress.org/majhajob/\">majhajob</a>, <a href=\"https://profiles.wordpress.org/manzurahammed/\">Manzur Ahammed</a>, <a href=\"https://profiles.wordpress.org/clorith/\">Marius L. J.</a>, <a href=\"https://profiles.wordpress.org/mattwiebe/\">Matt Wiebe</a>, <a href=\"https://profiles.wordpress.org/maxpertici/\">Maxime Pertici</a>, <a href=\"https://profiles.wordpress.org/melchoyce/\">Mel Choyce-Dwan</a>, <a href=\"https://profiles.wordpress.org/mbabker/\">Michael Babker</a>, <a href=\"https://profiles.wordpress.org/mukesh27/\">Mukesh Panchal</a>, <a href=\"https://profiles.wordpress.org/nicolaskulka/\">NicolasKulka</a>, <a href=\"https://profiles.wordpress.org/ntsekouras/\">Nik Tsekouras</a>, <a href=\"https://profiles.wordpress.org/oakesjosh/\">oakesjosh</a>, <a href=\"https://profiles.wordpress.org/peterwilsoncc/\">Peter Wilson</a>, <a href=\"https://profiles.wordpress.org/freewebmentor/\">Prem Tiwari</a>, <a href=\"https://profiles.wordpress.org/youknowriad/\">Riad Benguella</a>, <a href=\"https://profiles.wordpress.org/iamfriendly/\">Richard Tape</a>, <a href=\"https://profiles.wordpress.org/noisysocks/\">Robert Anderson</a>, <a href=\"https://profiles.wordpress.org/rodrigosprimo/\">Rodrigo Primo</a>, <a href=\"https://profiles.wordpress.org/sebsz/\">SeBsZ</a>, <a href=\"https://profiles.wordpress.org/sergeybiryukov/\">Sergey Biryukov</a>, <a href=\"https://profiles.wordpress.org/slaffik/\">Slava Abakumov</a>, <a href=\"https://profiles.wordpress.org/sabernhardt/\">Stephen Bernhardt</a>, <a href=\"https://profiles.wordpress.org/t-p/\">t-p</a>, <a href=\"https://profiles.wordpress.org/inc2734/\">Takashi Kitajima</a>, <a href=\"https://profiles.wordpress.org/tanvirul/\">Tanvirul Haque</a>, <a href=\"https://profiles.wordpress.org/thorlentz/\">thorlentz</a>, <a href=\"https://profiles.wordpress.org/timothyblynjacobs/\">Timothy Jacobs</a>, <a href=\"https://profiles.wordpress.org/skithund/\">Toni Viemerö</a>, <a href=\"https://profiles.wordpress.org/arcangelini/\">Tony A</a>, <a href=\"https://profiles.wordpress.org/hellofromtonya/\">Tonya Mork</a>, <a href=\"https://profiles.wordpress.org/transl8or/\">transl8or</a>, and <a href=\"https://profiles.wordpress.org/vladytimy/\">Vlad T</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 21:30:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"WPTavern: WordPress 5.7 Beta 1 Is Ready for Testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=111333\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:147:\"https://wptavern.com/wordpress-5-7-beta-1-is-ready-for-testing?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-5-7-beta-1-is-ready-for-testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3105:\"<p><a href=\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-1/\">WordPress 5.7 Beta 1</a> was released this week on schedule and is ready for wider testing. This release will introduce <a href=\"https://core.trac.wordpress.org/query?status=closed&status=reopened&changetime=..02%2F03%2F2021&type=enhancement&type=feature+request&milestone=5.7&group=component&col=id&col=summary&col=type&col=status&col=milestone&col=changetime&col=owner&col=priority&col=keywords&order=changetime\">68 new features and enhancements</a>, dozens of bug fixes, and versions 9.3 &ndash; 9.9 of the Gutenberg plugin. </p>\n\n\n\n<p>A few of the highlights expected in 5.7 include the following: </p>\n\n\n\n<ul><li><strong>Lazy-load iframes</strong>: When WordPress 5.4 added lazy loading for images, contributors discussed extending this to iframes as well. Now that the&nbsp;<code>loading</code>&nbsp;attribute on&nbsp;<code>iframe</code>&nbsp;tags has been added to the HTML standard, it will be supported in core in 5.7. </li><li><strong>Streamlined migration from HTTP to HTTPS</strong>: WordPress can now detect if a user&rsquo;s hosting environment supports HTTPS and <a href=\"https://wptavern.com/wordpress-5-7-will-make-it-easier-to-migrate-from-http-to-https\">enables a one-click update process</a>, handling mixed content rewrites where possible. </li><li><strong>Standardize colors used in WP-Admin CSS to a single palette</strong>: WordPress is <a href=\"https://wptavern.com/skinning-the-wordpress-admin-css-custom-properties-on-the-way\">implementing a CSS custom properties system</a> that will make it easier to add custom color schemes.</li><li><strong>Ongoing cleanup after update to jQuery 3.5.1</strong></li><li><strong>New Robots API</strong>: <a href=\"https://core.trac.wordpress.org/changeset/49992\">This new API</a> allows developers to centrally manage the content of the&nbsp;<code>robots</code>&nbsp;meta tag injected into the page, and includes a setting to toggle whether search engines are allowed to display large media from the site. By default, a&nbsp;<code>max-image-preview:large</code>&nbsp;robots directive which will be injected into the&nbsp;<code>robots</code>&nbsp;meta tag based on the new setting.</li></ul>\n\n\n\n<p>These features need testing, along with the host of updates rolling over from the Gutenberg plugin. The editor is getting the most visible enhancements in 5.7, with features like dragging blocks and block patterns from the inserter into the canvas, major improvements to the buttons block, new social icons, and much more.</p>\n\n\n\n<p>The official release is expected in just under five weeks on March 9, 2021. Testing is a critical part of the process for making WordPress better with each update. The easiest way to get in on that is to install the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a>&nbsp;plugin (set to the&nbsp;<code>Bleeding edge</code>&nbsp;channel and the&nbsp;<code>Beta/RC Only</code>&nbsp;stream), or download and install the <a href=\"https://wordpress.org/wordpress-5.7-beta1.zip\">zip</a> of the beta version.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 18:54:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WordPress.org blog: The Month in WordPress: January 2021\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9632\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://wordpress.org/news/2021/02/the-month-in-wordpress-january-2021/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11657:\"<p>For WordPress, 2021 started on a high note. Read on to learn about updates from last month.&nbsp;</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>WordPress release updates</h2>\n\n\n\n<p>WordPress project executive director — Josepha Haden (<a href=\"https://profiles.wordpress.org/chanthaboune/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>chanthaboune</a>) <a href=\"https://make.wordpress.org/updates/2021/01/21/big-picture-goals-2021/\">shared big picture goals for WordPress in 2021</a>. Highlights include shipping&nbsp; Full Site Editing&nbsp; — first on the Gutenberg plugin in April 2021&nbsp; and later in core (with WordPress 5.8), improved learning opportunities on learn.wordpress.org, and better tooling for contributors. As per the updated <a href=\"https://wordpress.org/about/roadmap/\">WordPress roadmap</a>, WordPress version 5.7 is planned to launch in March 2021 and WordPress 5.8 in June 2021. Some related updates:</p>\n\n\n\n<ul><li>Contributor teams are working on <a href=\"https://make.wordpress.org/core/2021/01/29/introducing-css-custom-properties/\">an updated admin color palette for WordPress 5.7</a> that will be more accessible and easy to read.&nbsp;</li><li>The Core team is working on a proposal to <a href=\"https://make.wordpress.org/core/2021/01/12/recap-and-proposal-align-the-wordpress-release-cycle-with-the-industry-standard/\">align WordPress release cycles with industry standards</a>.&nbsp;</li><li>WordPress 5.6.1 <a href=\"https://make.wordpress.org/core/2021/01/28/wordpress-5-6-1-rc1/\">Release Candidate 1</a> is out. This release is set to launch by<a href=\"https://make.wordpress.org/core/2021/02/02/a-week-in-core-february-1-2021/\"> February 3, 2021</a>. Questions and answers for <a href=\"https://github.com/wpmarketingteam/WP5.6Marcomms\">WordPress 5.6</a> are now <a href=\"https://github.com/wpmarketingteam/WP5.6Marcomms\">available on GitHub</a>. Contact the <a href=\"https://wordpress.slack.com/archives/C0GKJ7TFA\">#marketing</a> channel in the WordPress Slack, if you would like to contribute.</li><li>The <a href=\"https://wordpress.org/news/2021/02/wordpress-5-7-beta-1/\">WordPress 5.7 Beta 1</a> release is out! Download the <a href=\"https://wordpress.org/wordpress-5.7-beta1.zip\">zip file</a> or use the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">beta tester plugin</a> to test it out.&nbsp;</li></ul>\n\n\n\n<p>Want to be involved in the next release? You can help build WordPress Core by following<a href=\"https://make.wordpress.org/core/\"> the Core team blog</a> and joining the <a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">#core</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>.</p>\n\n\n\n<h2>Proposal to return to in-person WordPress events in safe locations</h2>\n\n\n\n<p>The Community team is <a href=\"https://make.wordpress.org/community/2021/01/26/proposal-update-decision-making-checklist-for-safe-in-person-meetups/\">discussing an updated proposal</a> to create a decision-making checklist for meetup organizers. The proposal is aimed at locations that have more effectively contained COVID-19 (such as New Zealand and Taiwan, for instance) so that local meetup groups in these areas can organize safe, in-person events. According to the proposal, in-person meetup organizers should review local/global health instructions based on resources and complete a checklist — which recommends whether to organize an event or not based on the organizer’s inputs and other factors. Compulsory safety precautions should be taken for any in-person meetup, and participants/organizers can share event feedback with WordCamp Central. The proposal is still being discussed, so if you have any thoughts, please<a href=\"https://make.wordpress.org/community/2021/01/26/proposal-update-decision-making-checklist-for-safe-in-person-meetups/\"> share them in the comments</a>. <strong>Please note: WordPress meetups and WordCamps are still online at this time and will continue to remain online until further notice.</strong></p>\n\n\n\n<p>Want to get involved with the Community team? <a href=\"https://make.wordpress.org/community/\">Follow the Community blog</a>, or join them in the <a href=\"https://wordpress.slack.com/archives/C02RQC7RN\">#community-events</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>. To organize a local WordPress community event, <a href=\"https://make.wordpress.org/community/handbook/virtual-events/welcome/applying-for-a-virtual-event/\">visit the handbook page</a>.&nbsp;</p>\n\n\n\n<h2>Gutenberg 9.7 and 9.8</h2>\n\n\n\n<p>Contributor teams released Gutenberg <a href=\"https://make.wordpress.org/core/2021/01/07/whats-new-in-gutenberg-6-january/\">Version 9.7</a> on January 6th and <a href=\"https://make.wordpress.org/core/2021/01/20/whats-new-in-gutenberg-9-8-20-january/\">Version 9.8</a> on January 20th. Version 9.7 allows users to drag block patterns from the inserter right into a desired position within the editor. It also has a new block variations feature and several improvements to reusable blocks. Version 9.8 makes the spacer block semi-transparent, adds a variation icon to the block switcher, adds site editor content to an iframe, and stabilizes Full Site Editing (FSE) by removing the auto drafts feature. </p>\n\n\n\n<p>Want to get involved in building Gutenberg? Follow <a href=\"https://make.wordpress.org/core/\">the Core team blog</a>, contribute to <a href=\"https://github.com/WordPress/gutenberg/\">Gutenberg on GitHub</a>, and join the <a href=\"https://wordpress.slack.com/archives/C02QB2JS7\">#core-editor</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>. You can find out more about the Gutenberg roadmap in the latest <a href=\"https://make.wordpress.org/core/2021/02/01/whats-next-in-gutenberg-february-2021/\">What’s next in Gutenberg blog post</a>.</p>\n\n\n\n<h2>Inviting Learn WordPress Contributors</h2>\n\n\n\n<p>Contributor teams working on the <a href=\"https://learn.wordpress.org/\">Learn WordPress</a> initiative are asking for <a href=\"https://learn.wordpress.org/contribute/\">new workshop presenters and discussion group facilitators</a>. The Training Team is recruiting<a href=\"https://make.wordpress.org/training/2021/01/27/learn-wordpress-working-group-call-for-handbook-volunteers/\"> volunteers for the Learn WordPress handbook</a> and has put up a <a href=\"https://make.wordpress.org/training/2021/01/29/request-for-testing-slides-plugin/\">call for testing for the slides plugin</a> to identify a simplified way to present slides. The Polyglots Team has floated a proposal to <a href=\"https://make.wordpress.org/polyglots/2021/01/13/proposal-translating-learn-wordpress/\">translate Learn WordPress</a>. The Meta Team is exploring the possibility of <a href=\"https://make.wordpress.org/meta/2021/01/03/protecting-childrens-privacy-on-wordpress-through-the-lens-of-coppa/\">making Learn WordPress (and wordpress.org) COPPA-compliant</a> to host workshops aimed at kids. </p>\n\n\n\n<p>Want to contribute to the Training team? Follow the <a href=\"https://make.wordpress.org/training/\">Training team</a> blog, or join them in the <a href=\"https://wordpress.slack.com/archives/C02RW657Q\">#training</a> channel in the Make WordPress Slack.&nbsp;</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>Further Reading</h2>\n\n\n\n<ul><li><a href=\"https://make.wordpress.org/test/2020/12/23/fse-program-testing-call-1-template-editing/\">Round 1</a> of the Full Site Editing (FSE) outreach program <a href=\"https://make.wordpress.org/test/2021/01/15/fse-program-template-editing-testing-summary/\">has wrapped up</a>. As a result, gaps were identified in the Gutenberg 9.6 template-switching experience &#8211; you can follow the issues in GitHub. You can follow issues in GitHub and submit questions to the team. The program identified gaps in the current template-switching experience that shipped with Gutenberg 9.6. You can follow the <a href=\"https://github.com/WordPress/gutenberg/issues/27814\">issues reported in GitHub</a>. Do you have questions about the FSE program? You can now <a href=\"https://make.wordpress.org/test/2021/02/02/fse-program-bring-your-questions/\">submit them here as part of the outreach program</a>.</li><li><a href=\"https://wordpress.org/news/category/heropress/\">People of WordPress</a> — A cross-team initiative led by the Marketing team to highlight WordPress contributors is back with <a href=\"https://wordpress.org/news/2021/01/people-of-wordpress-thelma-mutete/\">a post featuring Thelma Muelte of Zimbabwe</a>. If you are an active contributor to a WordPress.org team or a local WordCamp, contact the Marketing Team with the #ContributorStory tag to be featured in the series.</li><li>Joseph Haden (<a href=\"https://profiles.wordpress.org/chanthaboune/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>chanthaboune</a>) launched a podcast titled <a href=\"https://wordpress.org/news/2021/02/welcome-to-your-wp-briefing/\">WP Briefing</a> which is aimed at WordPress users, builders, and contributors of all levels. The podcast &#8211; which is available on all major platforms, will include overviews of WordPress philosophy, community success stories, and major updates.&nbsp;</li><li>The Plugin team has added a requirement that <a href=\"https://make.wordpress.org/plugins/2021/01/26/reminder-plugins-must-not-interfere-with-updates/\">plugins in the WordPress repository must not make changes to the default auto-update settings on a site</a>. The only exception to this requirement is for those plugins that manage auto-updates.</li><li><a href=\"https://india.wordcamp.org/2021/\">WordCamp India 2021</a> — a regional online WordCamp has begun. It’s running over three weekends and started with <a href=\"https://india.wordcamp.org/2021/workshops/\">Multilingual workshop sessions on January 30 and 31</a>. The workshops <a href=\"https://india.wordcamp.org/2021/workshops/\">can be found on the event site</a> and will soon be featured on <a href=\"https://learn.wordpress.org/\">Learn WordPress</a>. <a href=\"https://india.wordcamp.org/2021/tickets/\">Tickets are still available</a> for the event —which will have a contribution event on February 6-7, followed by sessions on February 13th and 14th.&nbsp;</li><li>The WordPress Foundation has <a href=\"https://wordpressfoundation.org/2021/do_action-hackathons-and-open-source-workshops-in-2021/\">invited applications for online do_action hackathons and encouraged folks to organize online open-source workshops</a> in 2021.</li><li>The Themes Team shared a post on the usage of the “Report this theme” button in 2020. The team is also <a href=\"https://make.wordpress.org/themes/2021/01/25/call-for-maintainers-theme-unit-test/\">looking for maintainers</a> for its <a href=\"https://codex.wordpress.org/Theme_Unit_Test\">Theme unit test</a>.</li><li>The Meta Team has launched an initiative to <a href=\"https://make.wordpress.org/meta/2021/02/01/call-for-feedback-automated-theme-testing/\">facilitate automated theme testing</a> and is <a href=\"https://make.wordpress.org/meta/2021/02/01/call-for-feedback-automated-theme-testing/\">requesting feedback</a>.</li><li>Members of the Core Team are <a href=\"https://make.wordpress.org/core/2021/01/14/stale-issues-in-gutenberg-repository/\">considering a “stale bot”</a> to close out stale issues in the Gutenberg GitHub repository.</li></ul>\n\n\n\n<p><em>Have a story that we should include in the next “Month in WordPress” post? Please </em><a href=\"https://make.wordpress.org/community/month-in-wordpress-submissions/\"><em>submit it using this form</em></a><em>.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 15:01:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Hari Shanker R\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"HeroPress: Discover Where You Belong\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=3469\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:124:\"https://heropress.com/essays/discover-where-you-belong/#utm_source=rss&utm_medium=rss&utm_campaign=discover-where-you-belong\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7102:\"<img width=\"960\" height=\"480\" src=\"https://s20094.pcdn.co/wp-content/uploads/2021/02/020221-min.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull Quote: I discovered that the way forward was to create spaces for others.\" /><p>My path to WordPress is, like so many stories, a twisty road lined with both struggle and good fortune. And yet, when I reflect on what led me here, it simply comes down to the common threads that bind us together as a community: the desire to make meaningful connections, the ability to do amazing things together, and the very human comfort that comes with knowing that I belong here.</p>\n<h3>It starts here</h3>\n<p>Just before I made my way into this world, my parents immigrated from Taipei, Taiwan to San Diego, USA. Growing up, I held a level of pride in being first generation which warred against a long list of discomforts that, as a kid, I couldn’t fully comprehend. That unlike my school mates, I rarely saw my extended family. That my English didn’t sound like that of my Californian friends, nor did my Mandarin mirror my Taiwanese cousins’. That cultural norms at friends’ homes were diametric experiences from my home.</p>\n<p>I realize that this sounds like I had a challenging, confusing childhood, but I assure you that I had a good time growing up. My folks are loving and made sure I had opportunities whenever possible. I always have had wonderful friends who generously share their lives and love my quirks. And, I have a brother who, despite being far smarter than I will ever be, still puts up with my big sister act.</p>\n<p>My point is that, it was painfully clear to me where I couldn’t fit in. Like many third culture kids, my perplexing cultural foundation had a profound impact on my values, and created importance around the concept of belonging, something I still hold to this day, and which pushed me along my way to WordPress.</p>\n<h3>The twisty road</h3>\n<p>I was terrible at college. I had no sense of what I wanted to do with my life, and drifted from major to major until I found myself entirely broke and rudderless. It was 2010, and with minimal job experience and 45 credits short of a degree, I desperately applied for jobs, taking the first that offered me a full time position.</p>\n<p>It was a pivotal moment in my life. The job gave me purpose, and I actually felt like I was good at something for a change. I worked closely with my boss and mentor, a highly regarded commercial real estate advisor with a warm heart and penchant for dad jokes. What set him apart was his belief in community values: the importance of education, humility, empathy, good stewardship, qualities that made him a respected leader in many circles. Over the ensuing years, I would finish my degree. But the lessons that meant the most were learned by following my mentor’s example, and would later translate well to open source leadership.</p>\n<p>Meanwhile, I began volunteering with renewed passion: sorting clothes at homeless shelters, working on literacy programs, teaching English at the library, serving meals, maintaining trails, building homes. I fund raised and coordinated volunteer events. Eventually, I joined advisory boards and committees of a few nonprofits, and became enamored of the strategic, thoughtful work that came with these roles.</p>\n<a href=\"https://s20094.pcdn.co/wp-content/uploads/2021/02/HfH-Nicaragua.jpg\"><img /></a>Building homes in Estelí, Nicaragua. One of my favorite volunteer memories!\n<p>Ideas around positive change and impact through community initiatives blossomed in my mind. Driven by strongly held values, I continued to help and was welcomed at every turn. I learned that it was people who could create spaces in which anyone, everyone could belong and add value by virtue of being a unique, enthusiastic human being. I wanted to create these spaces.</p>\n<h3>Finding WordPress</h3>\n<p>Now, it is a true story that I also found my way to WordPress through my partner, and that WordPress brought us together. We met through a mutual friend, and when I realized that he could build me a website, I asked him to do so for work. Arguably, one of my first experiences with WordPress could be described either as sharing what my site required with my developer, or innocently flirting with my future partner. The joke I like to tease him with is that I needed someone to maintain the site, so I married him.</p>\n<p>The other truth was that, after eight years of volunteering and lessons in leadership, my passion had turned to community building. I wanted a career in creating sustainable communities where people were openly welcomed, and members tangibly feel that they belong and experience joy in their participation.</p>\n<p>Simultaneously, working with my WordPress site also reinforced my sense of belonging to something bigger. Despite not having any technical background (y’all, my degree is in English), I was able to not just publish with WordPress, but have a functional site that worked incredibly well for my purposes. I saw WordPress as a way for anyone to have a voice online, and as a result, I was also drawn to the idea of creating these tools that non-developers, like myself, could use in an increasingly online world.</p>\n<p>By that point, my WordPress developer had become my fiancé, and he once again suggested a WordPress-based solution, this time for my career needs. Just before we married, he forwarded a job opportunity with Automattic as a sponsored community organizer within the WordPress open source project. It was a perfect match.</p>\n<p>And that is how, in 2018, after going through the standard Automattic interview process (another story that I’m happy to share with anyone interested) I found myself a community organizer for the WordPress Project.</p>\n<h3>Where do we go now?</h3>\n<p>I’ve only been in my current role for two and a half years, but during this time, my belief in the power of resilient communities has only grown, fortified by supporting meetup and WordCamp organizers, bolstered by working on diversity initiatives, and humbled by opportunities to serve teams as their lead, mentor, or member. I’ve met and worked with so many phenomenal community members, full of passion and creativity, and have loved every minute of what we do together.</p>\n<a href=\"https://s20094.pcdn.co/wp-content/uploads/2021/02/WCUS-2019.jpg\"><img /></a>The WordCamp US 2019 team. I miss you all so much!\n<p>More than anything, what excites me the most is that we still have so much more we can achieve together. Personally, I also still have much to learn, about community growth, about WordPress, and about every individual who seeks to add WordPress to their story.</p>\n<p>In seeking out where I belong, I found WordPress, and I discovered that the way forward was to create spaces for others &#8211; I invite you to do that with me.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/discover-where-you-belong/\">Discover Where You Belong</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 07:09:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Angela Jin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"Matt: Compounding Ice\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53641\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"https://ma.tt/2021/02/compounding-ice/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1899:\"<p>I learned something novel about how the ice age happened from this <a href=\"https://www.collaborativefund.com/blog/the-freakishly-strong-base/\">Freakishly Strong Base post by Morgan Housel</a>:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>The prevailing idea before [Wladimir] Köppen was that ice ages occur when the earth’s tilt supercharges the wrath of cold winters. Köppen showed that wasn’t the case. Instead, moderately cool summers are the culprit.</p><p>It begins when a summer never gets warm enough to melt the previous winter’s snow. The leftover ice base makes it easier for snow to accumulate the following winter, which increases the odds of snow sticking around in the following summer, which attracts even more accumulation the following winter. Perpetual snow reflects more of the sun’s rays, which exacerbates cooling, which brings more snowfall, and on and on.</p><p>You start with a thin layer of snow left over from a cool summer that no one pays much attention to, and after a few tens of thousands of years the entire earth is covered in miles-thick ice.</p></blockquote>\n\n\n\n<p>Fascinating! The blog goes on to apply the idea to that strong base, accumulating a bit at a time, to investing and business. The power of compounding seems appropriate to share on <a href=\"https://www.aboutamazon.com/news/company-news/email-from-jeff-bezos-to-employees\">the day Jeff Bezos announced his retirement</a>.</p>\n\n\n\n<p>I&#8217;ll leave you with one of my favorite quotes from Charlie Munger, which is also how the <a href=\"https://www.collaborativefund.com/blog/the-freakishly-strong-base/\">article ends</a>: </p>\n\n\n\n<blockquote><p>&#8216;The first rule of compounding: never interrupt it unnecessarily.&#8217;</p><cite>Charlie Munger</cite></blockquote>\n\n\n\n<p><em>The iceberg photo is one <a href=\"https://ma.tt/2011/08/glacier/\">I took near Svalbard in 2011</a>.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 03 Feb 2021 01:44:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Tue, 02 Mar 2021 16:52:06 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Tue, 02 Mar 2021 16:30:08 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:9:\"HIT ord 1\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:5:\"build\";s:14:\"20201016172007\";}','no');
